    "girls_info" => "I am very kind, open, sincere and spiritual person. I'm also very loving and caring woman who's got a lot of love in my heart to give to my man. I love traveling, it helps to broaden one's horizons and worldview; I like meeting new people and discover new cultures. I am compassionate and love animals very much. I have an inquiring mind so I enjoy watching detective movies.\r\nMy biggest hobby is my favorite work) I love it so much that I can't even call it a work, it is something that brings me a lot of pleasure in my life. I am a person of art and I like to paint in my spare time. I also love going out with my girlfriends whether we go to the movies or sit and chat in a cafe.\r\nI wish to meet a kind-hearted and loving man. He is gentle and generous. I would like him to be a romantic person who loves to express his affection. The man I see by my side is responsible, prosperous and self-sufficient. He also should be honest and spiritual person. I hope we share the same views and values. It's very important for me to have a mutual understanding and support in relationship.",
    "girls_1st_letter_subj" => "I'm looking for a life partner!",
    "girls_1st_letter" => "I am willing to send you my letter to tell you more about myself, yes you may see my photos and even videos attached to my profile, but it is enough to understand who am I? What am I looking for to find on this web site? Ok, so here we go: I was born in Russia on Sakhalin Island, so I am Russian by birth and nationality, you may ask me how I have appeared in Ukraine. \r\nThe answer will be easy â€“ my parents moved to live to Ukraine after our close relatives have sold their apartment to my parents and moved to USA. Since it was yet during Soviet Union time our connection with relatives was cut off because the distance was very huge.\r\nI was a very beautiful and still am))) girl, after I have graduated from school I entered a college and got diploma of a hair stylist since those times I am working as a hair stylist and love my profession very much!\r\nI wish to know something about your past, where were you born? What kind of work do you do? Why did you choose your sphere of activity? Do you really enjoy it?\r\nTell me please how long have you been single?\r\nI got married, gave a birth to my son in 1987th, my son`s name is Vyacheslav, now he is an adult and independent man has a family of his own and lives separately from me. His wife Yulia and his son Nikita are my dearest people and my immediate family.\r\nTell me please more about your family please! It would be my pleasure to read about your close ones too.\r\nI have lost both parents in 2000 and 2001â€¦\r\nMy marriage failed after ten years of our mutual life together, it often happens with people when they do not feel attraction to each other anymore as it happened in my marriage. Now I am living on my own and have a dog, his name is Yugin, he is a lovely fluffy pat â€“ spitz. I receive true pleasure from talking long walks with my dog evenings. \r\nOk, I will stop here, now you know a little more about me, please, write soon,\r\nElena",
