    "girls_other_languages" => "Russian, Ukrainian, German",
    "girls_info" => "I am a very cheerful and open person by nature. I like both - being outdoors and staying at home reading a book. I am a vegetarian; though won`t mind my man to eat whatever he likes, I lead a healthy lifestyle. I am kind, gentle and supportive lady. Honesty and loyalty are things I would offer to my future beloved person. I always treat people with respect, I'm caring and loving woman who is ready to give my heart to the most special man and share my whole life with him.\r\nI have many various hobbies. I love painting a lot, I've been doing it since school and I'm very good at it. I do the swimming in a local public pool or the river. I often go out with friends to have some fun)) I like reading books, especially fiction. I also like watching movies and different TV-shows about traveling. By the way, traveling is my passion! I have already been to a few places and I want to see much more with my future husband!\r\nI dream to meet my beloved man and build a happy family together. I wish to see an intelligent, educated, well-mannered and self-sufficient man by my side. Wish him to be kind-hearted, reliable and honest person. He's got family values and knows how to appreciate his woman. I hope him to be strong and compassionate man, the one who will conquer my heart with his manners and desire to love and be loved in return.",
    "girls_1st_letter_subj" => "I can speak English and German)",
    "girls_1st_letter" => "Wish you a beautiful day and invite you to take a closer look at my profile, there are a couple of my videos which I have created to add to my presentation, please, do not hesitate to take a look and you`ll get a better personal portrait of me that may help you to decide if you like me.\r\nI am registered here with serious intentions; friends have recommended me to join this web site since they really help singles to find their soul mates. I am looking for love, ready to have a harmonious and long-lasting relationship with a man who would be looking in the same direction with me.\r\nI am cheerful, caring, and very selfless; I think that it is better to give than to receive, I am grateful and very loyal person by nature. I have everything in my life but I am lacking that special person who would make me feel complete.\r\nIf you are interested in communication with me, just ask me questions and I will answer them honestly and sincerely, I will tell you about my immediate family, about my education, about my ups and downs in life, of course would be willing to know every single detail connected with your reality.\r\nI am for a good and proper dialogue; I wait for your letter,\r\nTill soon,\r\nNatalya",
