    "girls_info" => "I am punctual, serious, kind ,have a good sense of humor, a goal-oriented and well-balanced person, love children.\r\nI am a very romantic lady and I like to spend a lot of time outside in the nature somewhere in the countryside. I live an active way of life, I like sport and cycling.\r\nI really  hope that we would share with my future partner each others interests.",
    "girls_1st_letter_subj" => "Come into my life!",
    "girls_1st_letter" => "Hello my dear friend,\r\n\r\nI am registered here in hope to find a good man, who is ready to have serious relations. A man who does not afraid to be responsible for his words and actions, are you ready to have serious relations? I hope I don't scare you with such direct question. \r\n\r\nI am hot and passionate woman and I like to show my emotions, I can not hide from people my emotions, if I am sad you can see it in my face, if I am happy you can also see it in my face. \r\nWhat kind of man are you? \r\n\r\nAt the moment I am working in real estate company, so when people want to rent or buy a flat in Vinnitsa, I help them to find a good deal. \r\n\r\nWhen I have free time I spend it with my family and with my friends, I like to go out and to exchange some news, to share new emotions, new stories with my friends, I like to travel with my family and also with friends, I use each opportunity to develop myself and my world, try to visit some interesting seminars concerning development of personality, read interesting books, to go to nice concerts or to watch a nice movie in the cinema or at home. Sometimes it is nice just to go out for a walk.. What do you like to do when you have free time?\r\n\r\nI have an inner feeling that I am not going to live in Ukraine in future, what do you think and know about Ukrainian women? \r\n\r\nI hope to get your letter soon. Have a nice day!\r\n\r\nSincerely, Nataliia",
