    "girls_1st_letter" => "Each morning when I open my eyes I say to myself: I, not events, have the power to make me happy or unhappy today. I can choose which it shall be. Yesterday is dead, tomorrow hasn't arrived yet. I have just one day, today, and I'm going to be happy in it. So every day I try to live to the fullest, to enjoy, to see the bright and not dark colors, not complain..Of course all of us have lucky and unlucky days, but I understand this all is just the experience which is given to us. I believe in love. I can love. And I want to love. I am waiting for it very much to happen and I know that it will happen in my life. So I have made the first step towards it..I will be happy if you will make the second one..\r\nWaiting for your reply,\r\nBest wishes,\r\nValentina",
