    "girls_info" => "My friends say that I am kind-hearted and my character is rather quiet. I Like to get to know always something new and to discover some interesting places in Ukraine and outside of the country. I also very romantic and I do believe in love at the first sight. I dream to meet the man with whom I will be able to create a happy and a strong family.\r\nMy man should be kind, polite and of course family oriented. It will be great if he would be ambitious in his work and we could share each others interests.",
