    "girls_1st_letter_subj" => "Is your heart still free?",
    "girls_1st_letter" => "My name is Nataliya. I am writing to you from Vinnitsa, this is a city which is located not far from Kiev. \r\nIt is central part of Ukaine! \r\n\r\nI am a lady who wants to find a good man to feel completely happy. Let me tell you a short story about me and it will be nice of you to write me your short story.\r\n\r\nI live in a two-room flat together with my brother, Valera. My parents live in the countryside, sometimes on holidays or on weekends I visit them. I live in Vinnitsa, the population of the city is 400 000 people. \r\nI was very worried about the future of my brother and took him from the village away. You know, now there is almost no future for young people there. They do not have jobs and just begin to drink a lot. I did not want such fate to my brother. \r\n\r\nI work as a consultant of cosmetics. In my spare time I like to meet with friends, to drink capuchino in a cafe and to talk. Sometimes I like to swim and go to the simming-pool, like to go outdoors and have a barbeque. What do you like sometimes? \r\n\r\nPlease, write me and I will reply to you. \r\n\r\nBest regards, Nataliya",
