    "girls_1st_letter_subj" => "Marriage is not a noun..",
    "girls_1st_letter" => "Marriage is not a noun; it's a verb. It isn't something you get. It's something you do. It's the way you love your partner every day. I want to have a best friend as a husband, and he will be my number one supporter. He will be a family man. That what will make him a beautiful man. We will not be perfect by any means, but that will make us beautiful as well. We will not be afraid to say we're not perfect. We will have our disagreements, but that comes along with marriage. And what kind of marriage do you want to have? What kind of girl are you looking for? \r\nSincerely,\r\nMariya",
