    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Next to me, I see a person who is kind, honest, caring, self-sufficient and romantic). By character I am loyal and can compromise, I can listen and here, I can make a conversation on any topic. I am fond of cooking, listening to music, driving. I try to follow all modern beauty tendencies to look good and attractive. I want my man to be proud of me and I am proud of him. Maybe I will be lucky here, why not?:)",
    "girls_1st_letter_subj" => "Ready to end the loneliness...",
    "girls_1st_letter" => "I have discovered that it is very hard to find YOUR ONLY ONE PERSON..We meet many different people all the time..we like some, some like us, in some we like certain traits but do not like others..In some we like the character, but they do not attract us physically...And, unfortunately, such meetings follow one by one..I have had so many such meeting..But I Still have not quit the hope to meet my person and become happy with him..I believe that there are such happy cases and love appears between them..And what are you looking for? I am ready for serious relationship and a family. I am here just to try my one more chance..Maybe my future husband is looking for me here, too..\r\nWarmly,\r\nOlga",
