    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a person who is not scared to try new things. I think that doing it we develop our personality and our character. I am not scared of failures either, because it is our experience which gives us certain lessons in life. I like traveling, swimming, going to the gym, different activities. Of course it is more fun when you have a person you can share this excitement with. I am also fond of reading. I atten English courses and like studying. Would be great if you could help me with it:) I am a quick learner:)",
    "girls_1st_letter_subj" => "Only feelings matter..",
    "girls_1st_letter" => "Hello and thank you for reading these lines:) To tell you the truth, I am not good at writing letters first and know that here I am supposed to write something interesting to catch your eye..But in my opinion, the most important is in a person's eyes..We can write here any description of ourselves, prasing and counting our advantages..For me communication is very important. The one thing that I can say is that I am a sincere girl who is looking for true love here. Do you think it is possible?:)) I am a simple girl - not a naughty spoiled princess who is looking for a prince or for a rich guy. But I know for sure the qualities my man must have to fall in love with him. He must be reliable, sincere, trustworthy, he must be responsible for his words and actions, but at the same time gentle with his beloved. I love and want children very much, and hope that this wish will be mutual with the man I will meet. I want a real family based on harmony, understanding, respect, and feelings, of course. If we share these thoughts, welcome to my world:) I will be happy to get to know you better.\r\nBest wishes,\r\nIrina",
