    "girls_info" => "I can describe myself as loyal, interesting, kind and optimistic. I love painting, traveling, I do charity and help homeless animals. I love animals and children, and dream about my own kids in near future. I want to find love here. Do you think it is possible?:)",
    "girls_1st_letter_subj" => "According to me Love is all",
    "girls_1st_letter" => "For me love is a very complex thing, but I'll try to explain them as clearly as possible.\r\nLove is a feeling of protectiveness, affection, and respect for anyone.\r\nYou can't see them distressed. You feel like giving them only happiness.\r\nEven if you are tensed, you won't show it in front of them so that they won't get tensed. You can share all your problems with them, and you even wish for their success. You love them from the bottom of your heart. You even place your blind trust upon them. And you are always standing beside them.\r\nIf they are hurt, you feel the pain. You act like a armour for them and prevent all negative things from reaching them.\r\nThey are the reason for your happiness. No matter how bad is your mood, you get a smile on your face on seeing them...\r\nDo we share these thoughts?\r\nWaiting for your reply,\r\nAnjela",
