    "girls_info" => "I can describe myself as a creative person. I like painting, singing, playing the guitar. I am active and sociable. I like spending time in a good company, watching nice movies and listening to music. I think in relationship it is important to match in relationship in interests and thoughts. Mutual respect and understanding are a must.",
    "girls_1st_letter_subj" => "Are we compatiable?)",
    "girls_1st_letter" => "Each morning when I open my eyes I say to myself: I, not events, have the power to make me happy or unhappy today. I can choose which it shall be. Yesterday is dead, tomorrow hasn't arrived yet. I have just one day, today, and I'm going to be happy in it. I love life and I enjoy its every moment. I think it is important to do it, to set goals, to move forward, to develop yourself to find the harmony. Here I am looking for serious relationship. First of all I want to find the person I will be able to love and who will be able to love me. Love is the most important. Without it the relationship is impossible for me. And not because of my young age, but because of my life values and my vision of a family itself. So if you think that we might be compatiable, please do not hesitate to write me back:)\r\nAnastasiya",
