    "girls_alcohol" => "socially",
    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "",
    "girls_info" => "I know I will be a pleasant kind of insomnia for my man, I am very special lady. But of course you'd better know me closer and make sure this is true. I am very tender and loving person, the best day for me is a day spend in my man's warm embraces. I am very romantic and like to surprise my man in different ways. Believe me you will never be bored with me.\r\nI love cooking a lot and i always in search of ideal recipe of a dish from different cuisine. I love trying everything new. Also when i have free time I love spending time with my friends and we are going to the dance club or karaoke. Couple days a week I can spend in gym, I love keep my body in good shape.",
    "girls_1st_letter_subj" => "WOW, ITS REALLY YOU?",
    "girls_1st_letter" => "Hello!\r\nHow are you today dear?\r\nCan you imagine that in a couple of days we will wake up together)))))he!seems it is impossible but in fact for two people who love each other I think there is nothing impossible and how do you think?\r\n\r\nWhat about me for tonight? Be sure, I'm able to surprise) It's much better to feel one time, than to hear thousand times. Don't you think? But let's get acquainted closer, firstly. \r\n\r\nAs you see, I'm very decisive. It's the first thing you'd know. Secondly, I prefer real acts, like to challenge myself. Sometimes I surprise even myself. I never knew I had confidence to experiment. I never knew because I never tried.\r\n\r\nWhat kinds of scenes do you like the most? Maybe we can use it one day :)\r\nThirdly, I'm too curious. My job keeps me always engaged into new challenges. There are millions facts, I'd like to know about you, but let's start with a few. Are you too busy with your job? What if I join you in hobbies you have? What would you never do? \r\n\r\nFinally, I'm rational. Yes, just that unique type of woman, who knows what arguments are. If you argue correctly, you're never wrong. But I promise we will solve any disagreements in a special way. Well, if you look for a woman who will laugh at jokes and do foolish things with you, I'm here) \r\nWant to know which ones? Don't delay the answer) \r\nWarmly,\r\nNataly",
