    "girls_info" => "I can discribe mytself as a loyal, trust-worthy and decent girl. Loyalty is the main thing in relationship for me, together with the feelings, of course. In my opinion, if the partners want to be together, they do their best to be together - they try to compromise, to make steps towards each other, to listen and hear each other. It is the work of both. Everything is easy - if they want to call, they just call, if they want to come, they come, and if they want to be together, they just stay.",
    "girls_1st_letter_subj" => "Looking for love..",
    "girls_1st_letter" => "You know, it is not easy to write the first letter..Maybe it is supposed to be a WOW letter, I do not know, because there are plenty of beautiful women here and everywhere..For me the effect wow make only a man's intelligence, thoughs and life values, his attitude to ladies, and not only words..We all know that we can write everything, and not all can prove the words on actions, and some turn out to be not like thay describe themselves. That is why communication is so important. For me it is important to fall in love with the person, and further to keep these feelings during the relationship. I am looking for love here. Maybe it is trivial, but it is the truth, so I do not see any point in making up something. If you are looking for the same thing, I will be glad to get acquainted.\r\nSincerely,\r\nTatiana",
