    "girls_info" => "My name is Irina, I am a positive and intelligent woman who loves life and enjoys every minute of it. I am ond of aerobics, reading, fitness, good music and movies. I want to find my life partner and to make a frest start in my life. I want to love and to be loved. I am affectionate, trustworthy and family orientated.",
    "girls_1st_letter_subj" => "Love is the fuel of life",
    "girls_1st_letter" => "Love is the primal energy that makes life what it is.\r\nLove is multidimensional and complex, and yet simple and powerful.\r\nLove is inclusive and unambiguous, and doesn't distinguish between giver and taker - it just is available.\r\nThe most we learn to trust love, the more we grow in it.\r\nLove challenges us, but always to grow up, bigger in heart, more generous in giving, and forgive easily.\r\nLove is fluid, ever changing, and yet it remains the same. Just that we're not always good at knowing what we feel.\r\nLove is always about giving, even while taking, for we honour the giver.\r\nLove doesn't compete, doesn't belittle and doesn't worry about its place in our lives, and is most glorious when we treat it that way as well.\r\nThis is what love for me..I know it is really difficult to find your person whom you will love and who will love you in return. But I do not quit believing. \r\nIf you are interested in the acquaintance, will be glad to hear from you.\r\nNelya",
