    "girls_info" => "I am fond of cooking, gardening, sport and literature. I enjoy traveling and visiting new countries. Sociable, I have an opinion about everything! I am a simple person. Waiting for simple human warmth and understanding. I like to make life interesting and exciting. I hope we will have a very interesting life with my future partner. I will do my best for this.",
