    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I can describe myself as a purposeful, loving, gentle, caring girl. I am currently living and working in Poland. I am looking for a life partner here, who will also accept my children as his own, it is very important for me. I do undersatand that it is great responsibility. I can tell that I am a good housewife, good cook and a very loving woman. I like to keep a house tidy and clean. I love music and traveling. I am sociable and open-minded. I am sure we will always find the things to talk about and will be able to spend a good time together.",
    "girls_1st_letter_subj" => "Hope you are looking for me, too",
    "girls_1st_letter" => "Hello, I hope my letter has reached you in high spitits. My name is Irina and I am glad that you are reading these lines. I am family oriented, am here to find a serious relations! \r\nOther kind of relationship do not interest me. My search is for mutual sympathy, understanding, and the most important thing is that I want to find a person who will be  close to my heart and my soul! I am not lloking for a prince, or for a sponsor or just for a flirting. I want to find a man to share my life with. If you're looking for a real, beautiful, friendly, family relationship, I will be sincerely glad to meet you.\r\nWaiting for your reply,\r\nIrina",
