    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Belief in oneâ€™s own strength, the ability to properly prioritize, hard work, dedication and feminine charm are the rules that I adhere to. I am a charismatic and beautiful woman. I have everything, good work, beautiful children, faithful friends. All I could ever dream of. But ... I know that all this will not be able to warm me up on a cold night. I am here for a serious and long relationship.",
    "girls_1st_letter_subj" => "I want to write to you who I am in real",
    "girls_1st_letter" => "Hi dear!\r\n\r\nI want to write to you who I am in real  .. without embellishment ... I appreciate candor in people, that's why I'm so honest with you.\r\n\r\nI used to hand out particles like souvenirs. I was mistaken in people - they did not deserve it. I loved men with full dedication. But in return, I only got the scars. Do not be surprised that I shudder when you touch me. It is like holding a piece of ice on the skin.\r\n\r\nToo much passion, feelings, tension, thoughts and words. I do not know how to love differently. Fire runs through my veins. So do not say never, you love me if you are not ready to meet the flames.\r\n\r\nBut if you allow to love yourself, I'll put verses on your skin with my fingertips, and write the most fascinating tale you read. I will become the easiest and hottest woman in your life.\r\n\r\nKnow that I do not have half-hearted feelings. I do not go into the water gradually, I rush into it with my head. If you are going to love me, then let me answer you in return. But I know only one way to love. I give myself to love completely, for many it is to much.\r\n\r\nDo not be afraid to open yourself to me .. your soul. Maybe my frankness will show you a little harsh and intimate, but I think that only so we can get closer to each other ...! Would you like this?\r\n\r\nDo you think we could meet? Do not think that I am in a hurry ... I just think that this is the best way to get to know each other as best you can. Do you agree with me?\r\n\r\nDear, I will gladly tell you more .... I look forward to your reply.\r\n\r\nSinserely, \r\n\r\nKsenia",
