    "girls_info" => "I'm optimistic. I have a great deal of hobbies, go in for sport. I like different funny activities. I try to take from my life everything positive. I just enjoy every small change, appreciate every person, every moment . But in the same time I know very well what is real life and how to live it, because I am independent for some years and have really many goals in my life. But for now what I really need and lack in my life is a loving and caring man, whom I can share everything with and can give him everything what I have and be with him until the last breathe.\r\nI adore running in the morning, swimming in the sea, laying on the sand, looking at the starry sky, just walking under the rain and laughing. And one more hobby is cooking. Yes, I adore being in the kitchen and surprising my close people with tasty and extraordinary food. Maybe you will come and I will cook something incredible for you?",
    "girls_1st_letter_subj" => "What are you looking for?",
    "girls_1st_letter" => "Hello, dear,\r\nMy first question that I want to ask you is do you really seek love? Are you ready to pour into these abysmal, exciting, dangerous, but such desirable feelings?\r\nI suggest you leave all the past behind and start a brave romantic journey with me. How do you like the idea?My problem is that I dedicated my whole life to my son. I raised him alone. But now he is an adult and he is building his own life and it's time for me to think about my personal life, about my happiness. I not a young woman but wants to find the one .... in whose hands I will forget about everything, in whose eyes I will dissolve ... :-) I want to give him many surprises, caresses and his infinite love.I'm fond of psychology, I read a lot of literature and attend various trainings. I always dreamed of writing a book about perfect love and ideal relationships. Maybe this book will be about our love with you? Do you have any idea how to call it? So you can go without knocking to my life, just send me a letter :-) My heart is now open and maybe it is waiting for you .....I am passing my hand to your hand..\r\nInna",
