    "girls_info" => "I'm friendly and optimistic, easy-going and attractive, intelligent and kind. I love sports a lot, nature, being outdoors. But also I am romantic. I like walks holding hands, traveling, seing new places and meeting new people. I like reading, educational shows and psychological movies. Also cooking is my big passion. So, what is you favorite meal?:))",
