    "girls_1st_letter" => "Hello and nice to meet you!\r\nThere are no perfect people, in my opinion, because each has its own pros and cons. I also have both good and bad sides. I hope that my man will accept me for who I am, and our love will have no limits. Age, nationality, country and culture are not important. I believe that there can be some unseen chemisty between people, something which attracts them to each other. I believe in destiny and in love. And I know that our life can not be complete without a beloved person. That is why I am here. I have a job, I have my lovely daughter, but still I feel that my life is missing something..I miss warm hugs, passionate kisses, nice conversations about how my day was in the evening, planning a vacation together..Maybe we will find this happiness in each other? We never know. But we can try.\r\nIf you are interested, please send me your answer.\r\nSincerely,\r\nVictoriya",
