    "girls_info" => "What is wrong with this world? Why do people throw words of love, like it's something that can be neglected, that you can play with. We disclaim from our dreams, from our ideas, from our desires just because others do not approve of this, because others do not like it. Do you agree with me? I dream, I am dreaming and will dream. I'm sure that all dreams come true. Like everyone, I am mistaken. I study but I continue to go forward. I never look back, because it's the past. You cannot build a future if you are hampered by the past. In my life there was everything, and beautiful love and insane passion and bitter disappointments, but despite this I want to love, I am maximally open to new relationships, my heart is absolutely free for a new love.",
    "girls_1st_letter_subj" => "Let's start our eternity with you today ... A tempting offer?",
    "girls_1st_letter" => "Dear, you can imagine how interesting the world is and we in it, separated by kilometers, experience of life, cares - could meet here. It is not subject to the mind and probably, so heaven decided, you do not think so? I increasingly believe that everything happens in life is not accidental, and the main thing is that everything happens on time. Love always comes to us when we need it most, strive to be happy .....\r\nYou know, my friends say that I'm the most romantic woman in the world, dreamy, tender. I do not know, it's a compliment for me or not ... but I agree with them. Perhaps this also gives me faith in a happy future) Some kind of childish naivete is mixed with adult pacification, tenderness, passion. How would you describe yourself?\r\nI'm full of love, which I want to share. And it's not about some kind of flirtation, but about the most precious thing that we have. A feeling that will haunt us all my life, which every day will grow and bring us together ..... I want it so, and not otherwise. Dear, are you ready to feel the same? Cast aside all doubts, forget all the bitterness and failure in the past and breathe new life?\r\nMy inspiration has always been in a music. To some extent, it is like an elixir for me. No wonder in the world created so many masterpieces of love, which cling to us and inspire exploits).\r\nDear, I hope when you read my message for you, you will feel my soul in this letter!\r\nI wish your day to be filled with light and good moods.\r\nI'll look forward to your answer.\r\nRegards, Tatiana",
