    "girls_info" => "I am a very energetic young girl, I like the feeling of adrenaline in the blood, I love fast cars, parachute jumping, water jerks. Extreme helps to hear who I really am. Maybe you also keen on extreme kind of spots? We can try it together if you want ?) One else of the greatest thing for me - is cooking and reading. I like to read about the psychology of a person, make my outlook wider by self-development.",
