    "girls_1st_letter" => "Hi,\r\nI give you my regards from Jordan.\r\nJust now I drink coffee in the very beautiful city of Petra ....\r\nYou probably wondered what I'm doing here now. 2 years ago I decided to radically change my life and combine a hobby and job. I know that love to travel is now in every second person, but I have a special relationship to this. The countries in which I was and plan to go are not just beautiful, but also rich in history, magnificent architecture.\r\nI confess to you immediately I am sick of extreme, ahahahaha it is in the good sense of the word. For example, I take a great interest in parachute jumps, tried climbing, riding a motorcycle. I get high on speed, drive and thrill.\r\nSince it is necessary to write about the positive qualities in letters, then I keep:\r\nI know how to be friends ... my friends are my family. I am active, energetic and hardworking. I like to read very much .. by the way, this may seem strange, but I got an education as a librarian). I learn a lot, I always improve.\r\nI am always fascinated by something new. This largely affects the choice of my partner. I strive to meet a person who can share with me the experience, to teach a lot. But I have one problem or a dignity in turn - itâ€™s hard for me to fall in love. But nevertheless, when this happens, I completely surrender to this with my heart and soul.\r\nOnce in my life I had an interesting case. I donâ€™t really believe in such things, but once life brought me together with a chiromancer))) She told me fourth children .. ahahahah you are ready for such a turn of events.\r\nWell, I'm a open up with you ... I hope for reciprocity. So, if you are not afraid of my revelations, I will look forward to your answer!\r\nSincerely,\r\nIvanna",
