    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "There are ups and downs in life. There are dreams in life and real happiness. So in my life there was a lot that made me live and struggles to become a real woman in reality. Like all women, I want to love and be loved in the heart and head of one man who wants to give warmth and sincerity to his soul and heart and perhaps a small miracle called Baby. My friends call me a volcano of passions. I am very emotional and active in life. But with my beloved, I can be both an insistent lioness and a gentle fluffy bunny. Therefore, my character is quite different.",
    "girls_1st_letter_subj" => "Nice music, tasty coffee, good hotels ....",
    "girls_1st_letter" => "Hi dear\r\nDo you want to feel the love in your heart, the warmth of hugs, the peace of soul, the passion of kisses, to see sincere smile and the fidelity in eyes...if you are looking for good relationships that can lead to better life ... This is what I would like to give you.. To have a person whom you love and to be loved is a really great gift, do you agree with me?\r\n\r\nI am looking for not just only a partner on life, I am looking for a man with whom we will make all our dreams come true, will enjoy every minute of being together both in our minds, souls, hearts and bodies.\r\n\r\nIf I love - I love devotedly and the man will get the energy when is exhausted, will get peace when is overwrought, reliability when is disappointed and pleasure when desires. You know, many people tell me that itâ€™s weird to be such a shy and a little shy person with such a look as mine. But this is because I really appreciate the depth of the soul in people.  I can listen, not just talk. People told me that I would make a good psychologist. I donâ€™t know, maybe it's true, but for now I have chosen a different path)\r\n\r\nI enjoy from visiting new places. It does not just have to be faraway countries. Rich history, culture, spiritual life ... it all attracts me very much. It makes me energetic and calm at the same time. The road, nice music, tasty coffee, good hotels, the beauty of nature and a lot of fun...that is something incredible))) Recently, I took up yoga. I am learning to control my body, keep it in shape ... I really enjoy meditations. Have you ever tried to do this?\r\n\r\nI also enjoy reading. I am especially fascinated by the literature on self-knowledge, motivation.Recently, I became interested in the topic of studying the human brain. We do not use so many resources, do not know how to dispose of them. \r\nThe smell of a new book is probably one of my favorite scents ...))) How do you feel about reading. What literature interests you?\r\n\r\nDo you know what I mean? ;) And I want to share these emotions with the man who is able to feel the taste of freedom with hand in hand, with my head on his shoulder, are you ready?..\r\n\r\nMy kisses, \r\n\r\nDaria))",
