    "girls_info" => "It's not easy for me to describe myself. I think that I'm sociable, faithful, caring and friendly. My family often says that I'm funny. I like helping my family, even if they do not ask. I'm an excellent traveler, I try to see a lot of historical places. I'm a big dog lover.\r\nI enjoy a broad range of activities and listing them all would require too much room, so I'll only mention some of them: travel to unknown places (especially warm countries), always learn something new for yourself, dance on the sand during sunset, walk barefoot under the summer rain. I like to cook something interesting, I like to experiment.",
    "girls_1st_letter_subj" => "The dance of my body .......... is the language of love",
    "girls_1st_letter" => "Hi!\r\n\r\nI have an offer for you...Let's discard all doubts and prejudices and try to start something new for both of us. I am talking now about relationships that will be doomed to happiness. I take it and I want you to believe...!\r\n\r\nWhat can I say, I'm tired of just dreaming. I am ready to act and take the initiative in my own hands. At least the fact that I am first to write  you this letter.\r\n I am what I am. In man the main thing is individuality. Everyone should be an individual and then he achieves something in life. Sometimes I want to live from some emotions, not expecting something, without questioning, and completely trust my mind, but also my feelings. And who said that we need to live reasonably? We must live happily! I always want something more than there is, and I aspire to it.\r\n\r\nIt is a little difficult to describe myself... But there are qualities in me that are clearly pronounced. For example, I am sociable, loyal, friendly, sincere, dreamy, a little trustful :) What would you say about your character?\r\n\r\nI have a great passion - it's dancing. I devoted this to almost all my life. This can be called my work and a hobby :). The body language says more than words and I understand it! How would you react to dance with me, for example on the beach, barefoot on the sand.\r\n\r\nAh, yes, I really love dogs! I have two. One of them performs at exhibitions and wins - I'm the most ardent fan of her. If it was my will, I would feed all the animals and warm them :) Do you have a pet?\r\n\r\nI hope that you take what I have written seriously and draw the most correct conclusions.\r\n\r\nI look forward to your reply!\r\n\r\nRegards, Anna",
