    "girls_info" => "They say if you do not praise yourself, no one will do it for you. So let's get started! :) Brunette, with burning eyes and gorgeous hair. This is all that nature has given me. But this is not all that I have. I am a smart, witty and funny girl. I adore my work and spend time in the gym. I persevere in my goals and dreams. All that I got in this life, I consider it my merit. Having a strong character, inside I am very romantic and sensitive. I want to be loved and give all my love to my man. Forever and ever!",
