    "girls_1st_letter" => "Hi dear...\r\n\r\nI waited a long time to write to you! Exactly! :) \r\n\r\nI'm young, bright and full of energy! I am a very sensitive person, feelings, in my opinion, in the first place! Because I believe in soul-mate! I know that every one of us need to find it! Do you believe in that fact? :) \r\n\r\nI am a very romantic person. I want to walk in the moonlight with my man, and talk about something. Mutual breakfast with him on the beach of the sea, in silence.. even I can hear the cry of seagulls in the distance and a beautiful melody of wave... Waves so attracted to me, looking at them, you will forget about all your worries when you breathe in the sea air..\r\n\r\nMy second passion is my work. I work as a cosmetologist. And I like a beauty! I like to make women prettier and see her bright eyes after all procedures. Mostly I like to make people happy :) It is also kind of my happiness. My friends say that I'm a kindhearted person. What about you and your life? \r\n\r\nI am looking for my life partner with whom I will live in happiness, love, understanding, respect. Going through life hand in hand and shoulder to shoulder. In joy and in sorrow. Because, in my opinion, Love is the most beautiful in our world! Do you agree with that? \r\n\r\nI hope that you will want to get to know me better. If \"YES\", then I'll look forward to your letter. \r\n\r\nSincerely, \r\n\r\nOksana!",
