    "girls_other_languages" => "Germany, Italian, Spanish",
    "girls_info" => "If you describe me, then you can use two words - \"Lightness\" and \"Airiness\". I am cheerful, active and always ready for travel. I like to develop and learn something new for me. I've been in more than 65 countries on our planet and I do not want to stop. Have you ever been to Kilimanjaro? Or wade through the thicket of jungle? Yes, it was difficult to do, but I'm insanely proud of myself :) There are no barriers for me, if in my head some kind of fascinating idea crept in, It is too hard to stop for me. I take life very lightly, always with a smile and tremendous optimism.",
    "girls_1st_letter_subj" => "Let's not think, let's start acting",
    "girls_1st_letter" => "Hello!\r\nIt's so unusual for me to send a letter to a stranger, to someone whom I don't know at all and I have never seen. But I hope that my future noble partner in life and my one, true love will be able to consider me in this letter.\r\n\r\nI'll tell you a few words about me. I love this life in all its manifestations, it is full of endless possibilities, that's why I try to use every moment of it completely. I am outgoing person and I bring good luck to people who are close to me because I know how to inspire and to support. The active and energetic, but sensual, delicate, careful, romantic woman and I believe in love and faithfulness -  it's all about me.\r\n\r\nI have an interest for extreme sport, cooking and travelling, monotony is not for me. I adore to learn for something new and find out something about myself. I like getting new experience, meeting new interesting people.\r\n\r\nIâ€™m quite an adult and self-sufficient woman with a broad outlook and I have a great desire to share my spiritual values and experiences with somebody. I am also interesting person and a woman with a soft and gentle character.\r\n\r\nIn the process of my family life I began to understand that not all couples are compatible and each of us has the same right to happiness. If the relationship is healthy, there should not be victims and consumers in the relationship.\r\n\r\nI know that my mission and real happiness lies in family, mutual understanding, respect and care. And what about you? What is the most important thing for you in this life?\r\n\r\nI would like to meet my soul mate, a kind man filled with hope, faith, strength, warms and love of life, a like-minded partner with whom we may go arm in arm through highs lows, to share dreams and pleasures of life, someone who want to love and to be loved.\r\n\r\nAnd what about your soul, what does it want?\r\n\r\nI wait for your answer, I would like to get to know you better.\r\n\r\nI wish you a wonderful