    "girls_info" => "Most of my friends says that 'Im showy, bright woman who loves life in all its manifestations. Life shouldn`t be boring, and I agree to this rule. I am cheerful and kind, very fond of animals (I have one dog). I think that a woman should always remain a woman, must be well-groomed and always stay beautiful. For a long time I live in Warsaw. I have my own business there. In my plans continue stay in Europe, try a new business. I never stand still, I try to constantly develop.",
    "girls_1st_letter_subj" => "You will not resist if I'll....",
    "girls_1st_letter" => "You will not resist if I'll be frank with you today? Yes, exactly I have such a mood today ... open up for you and share my thoughts with you. Do you feel it... what is sugary and romantic now in the air??? ... What can not be touched or held .... this can only be felt by the heart, or to catch the smell. I think this is something extraordinary that waits us ahead.\r\n\r\nHey, dear:) .....Nice to meet you!\r\n\r\nI hope, I did not scare you with my romantic mood ...))\r\n\r\nI am glad to welcome you to my world, even in my heart. My heart is open for love and new feelings. I'm really looking forward to this. Are you ready, leave all prejudices in the past and breathe this love with me?\r\n\r\nI am a woman and that says it all :) I can be different: fluffy and soft like a kitten (if you tame me :)), confident and charismatic when it comes to business, and fiery and passionate if I'm in love. How about you?\r\n\r\nI say what I feel, so you will always know what my mood is today :) By the way, I'll give you a little hint ... the more kisses are in the morning, the more beautiful will be my mood :)\r\n\r\nI am a very versatile person, I love sports, movies, music, theaters and travels. Tell me about your hobbies.\r\n\r\nI like to visit France and Italy. I really rest there with all my heart. Sometimes it seems to me that my place is there. What's your favorite place for rest?\r\n\r\nI always draw my knowledge from books: psychology, philosophy, business and esoteric. Yes, I read a lot and thereby I expand my worldview.. I am sure that thanks to my sense of humor and the desire to be always attractive in all situations :), I will always be a muse and inspiration for you.\r\n\r\nBut like any woman, I miss the most important into my life to feel the happiest woman in the world. I miss my second half, a strong man who will protect me and let me lay on his shoulder, embrace him tenderly and to whisper how much I love him.\r\n\r\nWill you let the white fluffy kitten soak up in your arms? That's how I want to feel - a kitten in your strong hands .... murr ...)\r\n\r\nI hope you will hear the vibration of my heart and answer me dear. I like your seriousness and determination in finding your soulmate here. I believe that your choice will stop at me.\r\n\r\nI'm looking forward to your thoughts and feelings ... be yourself .. hereby - for me!\r\n\r\nSweet kiss :*\r\n\r\nJulia",
