    "girls_1st_letter_subj" => "Maybe it's you?",
    "girls_1st_letter" => "Hello!\r\nWhile you are reviewing my photo, I will say a few words about who is looking at you from this picture :)\r\n\r\nI'm optimistic and cheerful woman. In my spare time I like to go with friends to concerts and movies. I love to travel! I think travel make our life more interesting and better. I dream about round the world journey. I know it's not very original, but traveling is my passion. What is your passion in your life? Tell me about your dream. \r\n\r\nI love flowers like all women. Domestic plants are my hobby too. I like to care and grow flowers in pots. For me best reward is to see the beauty around the world. I think flowers is the beauty of nature. I also like to cook, especially exotic dishes, for example, Oriental cuisine. What kind of cuisine do you prefer? Do you like cooking? \r\n\r\nI hope to find my happiness on this earth! I believe in love and real feelings when butterflies are in my stomach and goosebumps. I want to enjoy every minute of life with my man and I wish to give all my tenderness, warmth, caring, affection. How about you? \r\n\r\nWell, for starters, perhaps, enough. And we will continue - when you write to me. See you! \r\n\r\nSincerely, \r\nVictoriia...",
