    "girls_other_languages" => "",
    "girls_info" => "If there was an opportunity to live on a permanent holiday - I would have lived. When in the morning, before going out of the house, there is an opportunity to loudly turn on the mood-raising music - I definitely do it. Dancing during the making of breakfast, songs to myself, morning tea, almost spilling out of the cup! It charges me better than vitamins. I am by nature an extrovert, open to communication and don't like to be alone. And for this moment of my life I most of all want to meet a man who, just as I will cherish relations with me and with which I will become better.\r\nAlmost every weekend I find time to meet my friends. I like to rest in nature. My passion is fitness. I love the ancient cities and beautiful architecture, My bigger dream is a trip around the world. I also enjoy concerts and love theater and cinema.",
    "girls_1st_letter_subj" => "Life is such an unpredictable thing .....",
    "girls_1st_letter" => "Life is such an unpredictable thing that you can not know where love is waiting for you. But I hope that my happiness is waiting for me here and maybe he is reading my letter right now... who knows ??)))\r\n\r\nSo, I said a lot about me in my profile, but I want to tell you more... As you could see, I was married. I divorced 2 years ago. My son is 20 y.o. What about you? Do you have children?\r\n\r\nI have my own business, a clothing store, which I opened with my friend. My job is so creative and enjoyable. What can be better than seeing happy smiles of satisfied women!\r\n\r\nI do like to make girls beautiful, so they look like beauty queens. And what are you doing for a living?\r\n\r\nI am not a great narrator, but a great listener. Being in the spotlight is not comfortable for me. I hate empty talks or silly gossips (oh, women are very skillful at this, arenâ€™t they?).\r\n\r\nI avoid all kinds of conflicts and quarrels. I am the most peaceful person in the whole world! I follow the rule: do not criticize others and you wonâ€™t be criticized by others.\r\n\r\nMy preferences? Variety in everything, especially in clothes and food. It depends on my mood. Today I can wear high heels and a tight elegant gown, tomorrow I change them to blue jeans and moccasins. Sneakers? They are good for my exercises in the gym.\r\n\r\nI am always curious to try different ethnic cuisine, something new and exotic. Although I have some concerns regarding boiled snails and frogs' legs)) Just kidding )) Have you ever tried any meals of Ukrainian cuisine? I do love cooking (hint!). You know, my guests often complain that my meals are way too delicious because they overeat when visiting me.\r\n\r\nWell, I guess it's enough for today. Ah, one more thing: I am never bored being with myself. When I have some spare time, I like doing something for my home: to change the interior, to sew or knit. But I am not a complete homebody as I am active and adore all kinds of outdoors activities.\r\n\r\nI am curious to know how you spend your spare time. Do you practice any sport?\r\n\r\nI'm sending you lots of warm hugs and looking forward to getting your answer.\r\n\r\nIryna",
