    "girls_info" => "I'm an honest, romantic, cheerful woman with a big heart. I want to love and be loved!\r\nIf there was an opportunity to live on a permanent holiday - I would have lived. When in the morning, before going out of the house, there is an opportunity to loudly turn on the mood-raising music - I definitely do it. Dancing during the making of breakfast, songs to myself, morning tea, almost spilling out of the cup! It charges me better than vitamins. I am by nature an extrovert, open to communication and don't like be alone. And for this moment of my life I most of all want to meet a man who, just as I will cherish relations with me and with which I will become better.",
    "girls_1st_letter_subj" => "This is so funny that I am sending this letter....",
    "girls_1st_letter" => "It is so funny that I am sending this letter to someone who i don't know so far! I have only read the short info in your profile, and it attracted me.\r\n\r\nBut it is so intriguing and exciting at the same time! I believe that dreams start coming true with little steps, so I am taking the one right now! And I dream big! Big to the Moon and back! I always was like this - optimist, never a quitter, always a believer! It is coming from my family, my parents were so loving and kind to me and my elder brother. We were raised in love and warmth, and we always knew that our parents were always there for us! And it is what we are for our kids now.\r\n\r\nI hope you are ok with my having kids? I have two, a boy and a girl. I am so proud of them. My son Alex is a musician, and i believe, just a great one. I love listening to his playing, it looks so romantic, my big little son with his guitar.\r\n\r\nMy girl Natalia loves painting and photography, so both of them are energy, very open-minded, very friendly.\r\n\r\nAnd me too! I have a bunch of hobbies! I am very active, love to jog, love yoga, swimming pool and I visit the gym (when not too much slacking off after a working day LOL) I love the feeling when jogging with my earphones and listening to my fav music. Really, one of the best moments of my life!\r\n\r\nI love music very much. What about you? What about movies? Theater? Awwww, theaters are my passion too. But i don't visit them often. Only sometimes on weekends.\r\n\r\nWhat else about me? I love sweets. Like a child! No, even like a fat kid! LOL, But I keep my frame good looking and keep that under control. Its hard, especially when I bake by myself, but i struggle, ugh!\r\n\r\nMy life is really bright and active, but I missed someone special to share it with me. I would like to meet a man who is straight to the point, who knows what he wants and if he doesn't he will figure it out. He loves life too and he is adventurous, and he let himself dream. So I can be soft and tender, and feminine next to him, and surround him with my tenderness and love and devotion. I am definitely a one man woman. And we will share lots of things for two, even such small moments like watching the morning clouds, meeting the Sunrise, make a pillow fighting, like kids LOL\r\n\r\nOh, I missed those moments so much. They are so important, do you agree? They can fill the void, let you feel loved and needed, feel yourself the part of the Universe even! It is so exciting!\r\n\r\nI want to live together, learn together, share things... All together! My heart is so much longing for it!\r\n\r\nAnd what about your heart, what does it want?\r\n\r\nDid it feel anything special while you were reading my lines? If it did..I will be waiting for your response! And maybe we will start the most beautiful story ever happened on Earth!\r\n\r\nTake care, my dear Stranger,\r\n\r\nHave a nice, bright and just a great day!\r\n\r\nSending you my hugs!\r\nAlex",
