    "girls_1st_letter_subj" => "Look into my soul!",
    "girls_1st_letter" => "Do you want to meet a person with whom you get a daily charge of positive emotions and just live a happy life??\r\n\r\nI know how to make you happy because I am a woman who knows what she wants and strives to achieve her goal.. I did not hurry to marry, I wait for my only and unique husband. I feel it even at a distance. I think I feel that you need the same thing?\r\n\r\nImagine two strangers who live in different parts of the planet once to meet and never again get separated, because a real spark will flare up between them! It happens! And I believe in it! My grandmother tell me if you like a man - come and take it while warm :)) This is a joke, of course, but in every joke - there is a part of the truth. By my life I used to achieve my goal.\r\n\r\nNow my goal is loving, faithful, honest man and happy family. What is your dream?\r\n\r\nPlease do not be afraid to share with me, I want trust you and I'm a good listener!\r\n\r\nSo let's try something change in our lives. Make it vibrant, unique and full of interesting events every days!\r\n\r\nIf you are interested in me and you want to know more about me, write to me.\r\n\r\nLooking forward to your answer!\r\n\r\nSend warm greetings from Ukraine!\r\n\r\nSincerely, Larisa",
