    "girls_info" => "I am such as I am, self-sufficient, without moral, material and ethical problems. If you run, it's fast ... If you fly, it's high ... If you LOVE, FOREVER ...For me, the highest values were always friendly, freedom, love, family, and life. I always try to enjoy life, help others, and believe in miracles. To live today, enjoy every minute of our lives because every day is a gift from God.\r\nI've never been to Paris, and it's probably my most cherished dream ... I want to be there not as a tourist, but to find my Paris, to be imbued with this city, Paris is my passion. And I want to realize my dream and I would be in the seventh heaven of happiness)).\r\nI've never been to Paris, and it's probably my most cherished dream ... I want to be there not as a tourist, but to find my Paris, to be imbued with this city, Paris is my passion. And I want to realize my dream and I would be in the seventh heaven of happiness)).",
    "girls_1st_letter_subj" => "Do you like playing games?",
    "girls_1st_letter" => "Do you want to have a beautiful, reliable, funny and open-minded person behind you?\r\n\r\nIf yes â€“ you've made a good choice for reading my profile! :)\r\n\r\nFirst of all, let me introduce myself. My name is Alina, I`m from a picturesque city in Ukraine. I am a romantic person, who`s here to find her real love. I also have a great sense of humor and like making new friends. Since my deep childhood I`m fond dancing, therefore dedicated to it 15 years of my life. I dreamed to make dancing more than just a hobby, that could be my perfect job, but also God had a different plan for me.\r\n\r\nHe gave me another giftâ€¦ The most precious person in my life â€“ my little daughter :) Her blonde hair and cheerful smile reminds me of my childhood. Btw, she loves dancing too, so we often make â€œa special discoâ€ at home together. She`s my little flower.\r\n\r\nBtw, I love flowers, especially red and pink roses. That is a symbol of love â€“ so beautiful and tenderâ€¦ Doesnâ€™t that inspire you?\r\n\r\nTalking about love, that is a special feeling. If you hold it carefully and also grow it up, you will be really happy, even a lucky one. Therefore, despite my young age, I want to have a loved oneâ€¦ Somebody, next to whom you can always count on, somebody who can share my interests and feelings, somebody, reliable, with a nice sense of humor. In my man, I would like to see not only the second half but also a friend.\r\n\r\nIf you are serious, faithful, loving, generous, attentive, don`t be afraid to make a step closer!\r\n\r\nPlease, tell me more about yourself. What does inspire you? What life goals do you have?\r\n\r\nI am looking forward to hearing from you.\r\n\r\nSincerely, Alina",
