    "girls_info" => "I am a kind, light, educated and human soul of the company. I am open in my emotions and always meet my new day with a smile. I am very curious and easy-going girl. I grew up in a loving family where the friendly atmosphere, support and love for God always reigned. I know what a happy family is not by hearsay, but from the life experience of my parents. And therefore I believe that I can be a good wife, a friend or even a good lover in bed .... but only for my man.",
    "girls_1st_letter_subj" => "Heaven will help us meet!",
    "girls_1st_letter" => "Hello!\r\nThey say happiness is in each of us, we only need to see it...\r\nI am a woman whom you have not yet seen, heard or felt.. But I hope that in this letter you will see me real. The first thing I want to say is that I am looking for a serious relationship here that will lead to marriage. Family happiness and grace is very important to me. I know that a strong family is continuous work, and a successful marriage is one that withstands many years of intimacy. As one wise quote states, a husband and wife should be like a hand and eyes: when a hand hurts, the eyes cry, and when the eyes cry, the hands wipe away tears. And there is still a beautiful phrase, according to which all marriages are by calculation, because everyone expects to find his own happiness in it. Are you agree with me? \r\nMy life is very bright and cheerful, I have a favorite work and a big family, sisters and brothers. I try to surround myself with only positive and open people. I work as a speech scientist and spend almost all day with children. Children give me such bright emotions, good mood for the whole day. I dissolve in them and get a great satisfaction when they smile. I really dream about my own children. How about you? Do you want to have children?\r\nI try to dilute my life with bright colors. Since I am an optimist in life, I always smile, I love to dance and travel. Everything is always interesting to me. You can't even imagine what a curious girl I am :) Exotic dishes, drinks and even dancing is what I love. By the way, about dancing ... I have been fond of belly dancing for many years. I know that this dance will be useful to me in the future to make my man happy. Can you dance? Do you like oriental dance? \r\nAlso, I really like skiing. My father did everything to make me love skis and mountains. Every winter we go skiing as one big family. I like to do it most of all for Christmas. To lie down in the snow, play snowballs, ski and just sit by the fireplace and watch the snowflakes fall outside the window. In these moments, I dream of my future. And I know that my happiness will soon find me. Maybe it's you?:) I hope you smiled at this moment ...\r\n\r\nWith warm hugs,\r\nOlga",
