    "girls_info" => "I am a sincere romantic woman with a good character. I'm a pretty communicative and enthusiastic person. My best friends say that I'm very reliable, sociable, understanding.\r\nI have my own very cozy cafe, where they prepare the most delicious coffee on earth. I love the smell of coffee from childhood, its aroma, which will not leave anyone indifferent. So I decided to open my own cafe where you can always hear the alluring aroma of coffee. And I did it. My work inspires me, I truly fell in love with coffee and, accordingly, I asked myself in which country the best grade of coffee. Maybe you know what kind of country it is? .... I knew it! ... you do not know)). This is Bahia and Santos, the sorts of Brazilian coffee, known for their unique bitterness and specific nutty aroma. I always tell my friends ... \"... do not deny yourself anything. What could be better than a cup of black coffee !? \" Maybe you think that my hobby is strange, but since I'm an unusual woman and I have unusual interests too. Read books, ride a car, go to the cafe or cinema, gym.",
    "girls_1st_letter_subj" => "I hope my letter finds my special addressee.....",
    "girls_1st_letter" => "I hope my letter finds my special addressee. If my letter will be interesting for you,%NAME%  I'll be glad)))) What about me? Wellâ€¦I guess I'll introduce myself first. What do you think about that? Once upon a time, a nice brunet Natalia was born in Rivne. And that was me, of course. ))))) I am very big-hearted, witty, caring, intuitive, passionate, creative, extreme tenderness, loads of giggling, sensual and classy. I have a good heart, I am a romantic woman, loyal, sincere. My personality is quiet, stable, introspective, calm, honest. I have big green eyes and a slender figure. I like to wear heels because they make a woman more feminine and elegant. Besides I like to be on top))) Do you like girls with heels? I like to wear high-heeled shoes, trousers or jeans.\r\n\r\nI think that I'm even-tempered, rather reserved, calm and modest. I like staying alone and sometimes I retreat into my shell. I am serious about all of this. But I will make you laugh as we go along. At the same time I like my friends, I like to laugh and joke. I have got a sense of humor. It means I understand humor and appreciate it. My dream to have a loving family. Somebody was saying, that an ideal woman should be \"like a chef in the kitchen, a lady in the society, and lover in bed\". I agree. I try that my femininity should reflect around my home in the street in society. I am happy, but the missing ingredient is the sharing of love with a true life's partner. Do you have some dreams about your special woman? Yeah, she doesnâ€™t know youâ€™re hoping for your interest because you havenâ€™t told her yet. I think people do not mind readers. Tell them what youâ€™re thinking. People will never know how you feel unless you tell them.)) I would like to meet a man who is gentle and kind yet has inner strength and a passion for life, who likes simple things in life, like long walks holding hands, laughing together. Someone who likes to be loved and who wants to share good life, hopes, and dreams with me. Tell me about your dream,%NAME %? I believe that all dreams come true.... so let us do it together!\r\n\r\nI am quite impatient to begin.))\r\n\r\nNataly....!",
