    "girls_other_languages" => "",
    "girls_info" => "\"Some people never go crazy. What truly horrible lives they must lead. \"-Charles Bukowski, I'm an outgoing lady who loves the nightlife, weekend adventures, dancing, karaoke (I do an amazing Madonna), getting out on the lake, and meeting new people. I probably change my mind about a thousand times a day and will keep you on your toes, but I like to think I'm worth it. For one, I'm an amazing cook if I do say so myself, and love to try out new recipes. There's just nothing better then getting creative and making something that you can also eat. It's the best kind of art. Shiny things distract me, people-watching is a favorite pastime, I live for the moments you can't put into words, and few things transcend a cup of coffee and someone to share it with. On the weekends you can usually find me in a friend's yard with a barbecue, and waiting for something good to come off the grill but I love to use my Sundays to get out and exercise and get ready for the week ahead too.",
    "girls_1st_letter_subj" => "I can be sweet and damn spicy....",
    "girls_1st_letter" => "It so happened that I do not know you at all, but your profile still intrigued me. I think this is an incredible beginning?))) What do you think?))) I hope that I will interest you too)))) An acquaintance is a chance to get to know each other, which happens only once. The first impression is always important!)))) What do you think?))) I will introduce myself first. I'm a little nervous;) But I'll start first! I hope you do not mind? About me in a nutshell: a young charming English teacher, the owner of a big British cat, a motorcycle girl, a lover of rock and a lover of homemade cakes and coffee. How do you like the description?)))) Indeed, I am an English teacher! I teach at school and I love my job very much! Working with children is fun! I live a British cat-Christie! ))) She loves the smell of coffee and spends the morning with me!)))) I really love animals! And you? I also love to ride a motorcycle! It brings unreal pleasure Wind in the face, speed! If we talk about musical preferences, I love rock! Definitely! I think this type of music is crazy and alive! ))) I am the same fan as the party!) I love cooking and I have to tell you that I can do it!))) It will be pleasant for me to cook your favorite dish for you!))) Do you have a favorite dish?))) Extreme in my blood! I like everything unusual, extravagant and unexpected. I love surprises and know how to make a happy person who is next to me. Miss this is clearly not about me! I love to have fun with friends! I love board games! And spend time in nature! Tell me something interesting about yourself? Are you ready to change the world with me? In short, for happiness, I have almost everything: a favorite job, an interesting hobby, true friends, good looks, cheerful character, the ability to cook and speak well ... But there is no one with whom I could share this With a special man for whom feelings and new emotions are important, who appreciate simple things and home comfort, who are ready for serious relationships... Maybe I have already found you? It will be a pleasure to receive a letter from you :) \r\nSincerely, Julia ...",
