    "girls_info" => "I am a hot woman with fiery hair color. I am attracted by extreme and speed. I am a spontaneous, energetic and cheerful girl. Believe me - bored is not my favorite thing.\r\nI love to drive on my motorcycle in the night city. Adrenaline in my blood is what I need after my working day.  But at the same time, I like to drink a cup of coffee in a cafe or just sit in the park and watch people passing by. I am especially pleased to watch couples in love, it's so cute :)",
    "girls_1st_letter_subj" => "Dont waste your time .....",
    "girls_1st_letter" => "I understand that you receive a lot of letters every day, but I need to say that you should turn your attention to mine! \r\n My name is Irina! I am here because I want to find someone, who will be my best friend, my love and my life partner. I am from Ukraine and live in the capital of Ukraine - Kyiv.  It's very beautiful, bright, modern and historic center of  Europe! Have you ever been to Kyiv?\r\n It is difficult to describe myself but I  will try. I think I am a delicate, sensual, romantic and feminine! \r\nI am a good looking young woman. My friends say I am reliable and honest. \r\nI adore traveling, art, cinema, spend my time with friends!  What do you like to do in your free time? \r\n\r\nMy hobbies are different - from bowling to walking in parks, from music shows to playing backgammon. Also, I   like to do beadwork pictures! Everything at the right time and in a good mood. It is the main!\r\nOf course, this description is also far from ideal, but here there is definitely a living person with interests, hobbies and life position.\r\nI believe that a man in life can have goals. And may not be. This is a personal matter. It is also important for me that a man be attentive and who will respect me! I am a young, positive and cheerful person.\r\nI work as an accountant so I am very executive and attentive. After all, my work loves accuracy and attentiveness. But I have to tell you that I love my job. This is really what I want to do! How is your attitude to your work?\r\nI love life and enjoy it every minute. My credo is â€œDon't waste your timeâ€. Cos life is very short and we need to live with a taste and appreciate it. \r\nI love to improve and learn everything new!\r\nI like to dream. And  I always strive to make my dreams come true! \r\nI hope my letter touched your heart and you write me an answer!\r\nHave a nice day!\r\nIrina!",
