    "girls_info" => "My numerous friends consider me to be sincere and very charismatic lady. I'm really energetic and rather natural. I like getting new experience, meeting new interesting people. I try to help everyone in difficult minute of life. I'm really gentle, caring and passionate when I fall in love. I know that my real destination and happiness lie in a family hearth and reciprocal care.",
    "girls_1st_letter_subj" => "A chance to know each other...",
    "girls_1st_letter" => "Warm are not only tea, gloves, a blanket. Warm is all talking, views, writing, people. This is the special feeling that gives us the strength to live, believe, dream, love.\r\nHello dear!\r\n I'm Lily. I am not a very complicated person:) I like the simple things, Like a beautiful Sunset, a reflection on the water, the smell of the rain, watching a spider build a web. These things give me pleasure,I am simple thinking and positive attitude person. You can find me sincere, committed, passionate and strong will power. I am very cheerful and always look for happiness in small and simple things. I am very patient and don't get angry and upset easily. I think it's very important to have big heart and care about people around me. I am giver, not a taker. My first reaction is to share. I can be very talkative at times, but mostly I am very good listener. I don't believe or like conflicts. I tend to think very rationally and logically. I like to keep things clean and organize. I am a positive, merry girl. I easily find a good connection with people. My smile helps to find the way to people's soul ... I really like to dance. Active rest makes my life more diverse and more interesting. I also like to read, mostly classics. I love traveling and dating with interesting people. \r\nI have a dream ... to meet my man, to enjoy life together and give each other all my warmth, care and love. After all, I can not live without love, caress, warm and tender words like \"Good morning, dear! :)\" \"I love you!\", \"You are the most precious that I have!\". I just really want to wake up in the morning in a soft bed, warm, sunny, filled with something touching and light ... amazingly happy ... I just really would like to see my beloved man on the pillow next to and kiss hard....\r\nSo now it's your turn to open your heart to me and tell me more about you. I wish to know everything that you think I need to know about you. I am sure you have a lot of interesting stories to tell me from your life. Are you interested in a real meeting if you meet a girl whom you feel sympathetic? I am very interested in you, I am already anxious to get your answer. Hope you do not make me wait a long time ...:)\r\n\r\nBe open for new love, feelings and emotions!\r\n\r\nI am waiting for your reply as soon as possible for you!\r\n\r\nLili",
