    "girls_info" => "All that does not kill makes us stronger. And in this statement there is truth. There are different moments in my life, and not always good ones. But I did not lose optimism and hope for a bright future. I am a cheerful, kind and purposeful girl. There are no prizes for me. I always thirst to learn something new and interesting. At work, I am always restrained, diplomatic, business lady but when I come home, I take off my heels and become a gentle and soft kitten in a satin pale pink robe. Someday I will show you.",
    "girls_1st_letter_subj" => "Love interferes with death.....",
    "girls_1st_letter" => "Hi!\r\nLove? What is love? Love interferes with death. Love is life. Everything exists due to love. Everything is connected by her alone.  \r\n                                                                           Lev Tolstoy\r\n\r\nThese are words that are very important at this moment in my life and this is exactly what determines the condition and need of my soul.\r\nMaybe it was not for nothing that so many ingenious inventions were written about it .... All the same, love is an overwhelming feeling that can turn the highest peaks, do you agree with me?\r\nI live in the beautiful city of Rivne...I work as a civil servant and I have to be a serious and confident woman while I am at work))) But when I come home I become myself .... gentle and feminine)\r\nI am looking for my partner, friend, soul mate, the gentleman who believes in me as a woman, trusts me, respects me, supports me, knows how to love, be sensitive, give, be me. Be my equal and partner in everything !!!\r\nI always like to try new things and learn something new! I am sure that you and I could teach each other many things and share many pleasant activities !!!! I love an active lifestyle with fitness and I love to cook interesting dishes! Having tried something in a cafe, I will try to do the same at home! Do you have a favorite dish?\r\nI actually have many different interests, which are difficult to talk about all =) You will learn about it, getting to know me closer! And don't be afraid to ask me about anything, and I want to have easy communication with you !!!! You know that we live only once, but how many times do you need to hear this phrase before you realize that this is true. What is the main thing in your life?\r\nSo, we should not miss our chance !!! You should know that I am ready for a real meeting! So can we get to know each other much closer ?! I believe in our special connection !!! What about you? I look forward to your letter with great impatience !!!\r\nI send you my warm hugs!!!\r\nWith tenderness\r\nSlava",
