    "girls_info" => "Life is such an interesting thing, full of surprises and disappointments. But fortunately, in my life, I experienced only happiness, love, and support. Perhaps because I am a person who sees in everything a positive, and believes in love. In our world, everything has changed, people and attitude to life have changed. People are most interested in material goods, the outer shell. But there comes a time when you realize that happiness is not in money and then we suddenly find out that we do not know where to move on, what to strive for, there are questions like yours \"And what then? For the sake of what to live? Where is it, what will bring me happiness? How can I understand what my soul wants? \" And unlike others, I know what my soul wants. At this stage of my life, I want a stable relationship, care, and understanding of a person who loves me and most importantly to make each other happy.",
    "girls_1st_letter_subj" => "do you believe in a fairy tale?",
    "girls_1st_letter" => "I want to tell you one story, do you believe in a fairy tale?\r\n\r\nSo: there lived a little princess. She had beautiful, long, blond hair and big, gray eyes. People always told her that she is very beautiful, but she was very embarrassed and lowered her eyes.\r\n\r\nShe was always surrounded by kindness, care, understanding. At home it was noisy and fun, she grew up with two brothers and a sister.\r\n\r\nTime flew quickly ... She studied well and excellent graduated from the institute with a history teacher's diploma. She was always interested in the past, she loved to read and study this world.\r\n\r\nShe adored flowers and gardening. Always was very romantic and subtle.\r\n\r\nThe older she became, the more her head visited the thoughts of the beautiful prince. About how they will live happily, harmoniously. To understand and respect each other. They will be next in any life situations.\r\n\r\nAnd one day she met him. And they really lived for a long time, gave birth to 2 beautiful boys and experienced a lot of happiness. While their family did not get hurt, her prince went to another world ...\r\n\r\nIt's been 3 years ... Do you wonder how the princess lives now? Sons grew up, left the house and live an independent life. She has a good business. In her spare time, she takes up yoga, skiing. Many travels, traveled already 30 countries in Europe and Asia. Every year he goes to Switzerland to a friend to take care of her garden. She still reads a lot and waits again for her prince, intelligent, noble, intelligent, kind, sincere, brave, courageous, patient. The one with whom she again feels a lot of happiness and warmth!\r\n\r\nI think you understand about who this story was? :-)\r\n\r\nWhat kind of relationship are you looking for on this site? Are you ready to come to the far country of Ukraine for your princess? :-)\r\n\r\nWith impatience, I will wait for an answer, \r\nYour Princess Lesya:)",
