    "girls_info" => "We are created by nature in such a way that allows the two opposites to be one. And I agree with that. I am a woman to the smallest bone and I am proud of it. I was created to be happy and loved and I will do everything for this. I am a bright, damn attractive and cheerful woman. I know how to make my man happy and successful. I know that behind every great man there is an even greater woman. And I can be this woman. I look for beauty in everything and enjoy every moment in my life. I like laughing heartily, walking in the summer rain and meeting sunrises in warm male hugs...",
    "girls_1st_letter_subj" => "I want to know your advice as a man .....",
    "girls_1st_letter" => "Hello ...\r\nI want to know your advice as a man ..... In my photos, you will see me in a red dress. Soon I will have an event dedicated to charity. Do you think it will not be too defiant? I saw your profile and I am very interested to know exactly your opinion.\r\n\r\nThe desire to be understood and loved excites my heart and I write to you first, which in principle is not peculiar to me).\r\n\r\nI love life. I am a very optimistic and friendly woman, and perhaps that is why life for me is colorful. As you probably noticed, my favorite color is red Smile I like to enjoy every day of the week, which makes my life interesting. I am serious, honest and romantic .... I want to share with my partner everything, even crazy, if I'm really in love))) ahah, do not think anything bad)))\r\n\r\nI like to enjoy every day of the week, it makes my life interesting. I have a lot of passion in my soul and a lot of romance in my heart. I am a real woman who loves to be in the attention of her man, to pamper his delicious on the entrance and just give him warmth and good mood.\r\n\r\nI think that if the relationship is really happy, strong and based on true love, then the partners want to start a family. I see no reason to spend many years just to have a good time together and to be afraid of responsibility. What is important to you in a relationship?\r\n\r\nI want to have a family, and in this case I will be sure that everything is going in the right direction.\r\n\r\nThat's why I'm here! I am looking for a person who is serious about creating a family and a life filled with love, happiness and pleasure. This is my dream! Have you got a dream? Maybe we have similar dreams?\r\n\r\nI am open to life, and I want to enjoy life with a real man for a serious relationship ... I believe in my search here, and I am sure that one day I will get my man ...\r\n\r\nI would like to know you more, and I hope you too ...\r\n\r\nAll the best for you!\r\n\r\nTatiana",
