    "girls_info" => "I am the person who loves to develop, to do something and in no case sit still. I love to be on the move and not to stop! After all, now life is a very fast thing and you have to keep up with that ! ) As Bob Marley used to say, \"a smile is the main bend of a woman.\" I agree with this! A smile is my business card! I like to smile! Being gloomy is clearly not about me! I like communicating with people. I have rather an eager character, that is why I prefer an active lifestyle. I'm a sensual, energetic, positive, responsible and creative woman. I love my profession but family means a lot to me too. I love nice dresses, nice shoes and flowers! In that case, I feel like a woman!",
    "girls_1st_letter_subj" => "Immediately confess to me...",
    "girls_1st_letter" => "Immediately confess to me... Are you a happy person? If not... Are you ready to change it and be open to a happy life? Because I am determined to cross out all the bad things in the past and start a happy, harmonious life filled with love, family, and meaning. I live the active life of a young mother! I love drinking good coffee, meeting friends and smiling at everyone! I think a smile is an important part of life! If you are in a good mood, the world will be friendly for you! 100%. How does your morning begin?\r\n\r\nMy morning starts with a cup of coffee :) I believe that in the future I will make two cups of coffee for myself and for my man! :) Maybe you were surprised by the topic of my letter, but I really like to play such games as \"Mafia\". Did you hear anything about it? If not, then I invite you to play together! :)\r\n\r\nI appreciate honesty, kindness, and loyalty! Travel, surprises, music, dancing, sports, books, last-minute plans, open-mindedness, photography, museum, madness - these are the words that describe me. Write the words you can describe yourself? :)\r\n\r\nSince I am a young mother, I want to give my child all the best, it makes me stronger and bolder. This pushed and gave me the confidence to open my own business. I really want in the future with my man to build our joint empire and be active and successful together.\r\n\r\nBasically, I love life and I love living life. I enjoy nature, travel, restaurants, laughter, cultural events and good people. I try to live with taste! I love old buildings and to wander through the cities. I like the mountains. Seeing them, climbing them, smelling them. Really! :) I also love to sing and dance. I have a dream to sing a song on stage! :) It will be awesome!\r\n\r\nI want to meet a special man! A man with a strong heart and kind eyes. I will wait for it! And what kind of woman you'd like to meet?\r\n\r\nSincerely, Nataly!",
