    "girls_other_languages" => "Russian",
    "girls_info" => "At first glance, maybe you will see a gentle and fragile lady in me, but it's only at first glance :) In fact, I can be different, depending on the situation and my mood. I can be an interesting interlocutor, and a gentle and caring wife, and a strict boss at work))) Due to this, I consider myself a successful woman, a loving and best mother for my children. I was always lucky or with good people, or with my own wisdom and optimism. You know, I can forgive anything, because I have often convinced that a person is often hostage to the situation. Yes, there are things that are incredibly irritating to me: something low-pitched, lies and hypocrisy, and even falsehood in people. When they have a double bottom. I believe that all this should not be in a relationship, only love, trust, understanding and honesty.",
    "girls_1st_letter_subj" => "We won't have rules! We will just..",
    "girls_1st_letter" => "Hello!\r\nThe profiles we created here, do not allow us to truly express ourselves. You really cannot compose or type the body language, facial expressions or even the intentions of words and sentences. To get the real feeling or essence of someone's personality, it takes a lively conversation one on one.\r\n\r\nPersonally, I do not belong to the number of people who like to praise themselves and paint in colors. But I can say that my biggest pluses are my mind, erudition, horizons, life experience, the ability to analyze various facts and circumstances, reliability and fidelity, politeness and decency. All the rest is just simple average indicators. Because none of us can be perfect :) \r\n\r\nI am what I am. In man the main thing is individuality. Everyone should be an individual and then he achieves something in life. I always want something more and I aspire to it. I can spend the evening having fun with friends, but also, I can sit with the book in my hands all evening, and I do both with ease and joy. With great pleasure I spend an evening with children, solving their problems. \r\n\r\nWhat do I expect from you? Difficult question. Most of all, probably, comfort, warmth and reliability. Whenever and whatsoever I do, together or separately, brings peace of mind and peace, that my man is, that he is near. I like to live in comfortable conditions, I know how and I like to cook delicious, but I never do cult of food, cleaning or shopping. Being yourself in the eyes of a man is a difficult task. A man wants to see our ideal in us. But what is an ideal, and how he sees it, no one can explain. The best way out of the situation is to be perceived for who you are. We need to complement each other. Happy couples are striving for mutual understanding and partnership: they do not try to establish who is right, who is to blame. They are ready to compromise... The main thing in a relationship is the ability to listen to another, correctness during disputes and the absence of negative consequences when disagreeing.\r\n\r\nI'm not looking for a prince on a white horse, but probably, every woman desire to find reliability, mutual understanding, respect and decency in a man.\r\n\r\nIf you liked what I said to you, and you wanted to get to know me better, just write to me, to really see who I am..\r\n\r\nI will look forward to your letter.\r\n\r\nSincerely, Anastasiia",
