    "girls_info" => "Just to be a loved woman is my vocation! I am loving, caring and loyal. I enjoy simple things in life: family, music, flowers and a nice job. I like flowers and would like to have a greenhouse one day. I believe in miracles and true love. I think, my love, like fire, if once thoroughly kindled, is soon blown into a flame. I am calm and balanced, amusing and provocative. I'm really energetic and rather natural. I like getting new experience, meeting new interesting people. Also, I believe that everything depends on our desire. I am a woman who has got used to acting and I expect this from a man.",
