    "girls_1st_letter" => "My dear friend, \r\nYou will probably be surprised to receive a letter from a person whom you have never met, so I will first of alt introduce myself to you.\r\nMy name is Lyudmila. Iâ€™m tall, blonde girl with blue eyes.  I as dream))))  There is an opinion that men prefer blondes))) Do you agree with that?) But donâ€™t believe in in a stereotypes.  I'm a unusual  blonde-girl. Maybe you will check it out soon?! ))))\r\nHow to start? Really it is first time for me) Therefore, I will tell you about myself what my heart feels at this moment, and nothing fictitious...\r\nI am tender and gentle, sincere and honest, very feminine and sensuous, sexy and passionate... I am very romantic, open-minded and a one-man woman. I am family-oriented, loyal and trustworthy. Very giving, supportive and caring. I consider myself a sweet girl with a soft personality. My friends say that I have innate kindness and politeness with strong inner abilities.\r\nMy interests are very varied. I like reading, socializing with friends, cooking, cozy home life, traveling. Also for me is very important self-development and healthy style of life. I am interested in dancing, fashions, cars, videos and home-making.  I'm independent, don't smoke or drink. Sometimes I dream about my future life. I wish to give my man by blessings of true love and mutual understanding, tenderness and mutual admiration. And are you ready to open for me with such tenderness and passion at the same time?\r\nI want noble, clever, strong personality, who makes my world stop when he walks in the room. I am looking forward to meet a bright man to share life with, whom I can't stop admire and adore, give all my love and devotion. I dream about real man with big loving heart, confident personality, with passion for life, genuine man and gentleman, tender and caring, who will hug me and carry in his arms. I have a lot in my life, but most of all I want to create a strong family to raise beautiful and well educated children and to make my husband happy. Tell me about your desires. Open to me and I'll show you what true happiness is!\r\nI will waiting your answer!\r\nSincerely,\r\n  Mila!",
