    "girls_info" => "Charming, attractive and a bit modest. So my relatives can describe me. They say that it is always easy and fun with me, I am a very good friend and always adequately assess the situation, I am tactful and can make a joke about the situation. In addition, I am self-critical to madness and always know how to laugh at myself :) I really like milk chocolate, walking in the rain without an umbrella and spinning in an oriental dance. I love yellow and white orchids and morning coffee in my bed. For me, nothing is impossible, the main thing is desire !!!",
    "girls_1st_letter_subj" => "I want to share with you something",
    "girls_1st_letter" => "Hi!\r\nWhen they tell me - \"Tell me a little about yourself\", I always do not know what to say, where to start. There are so many thoughts and different ideas in my head that I lose myself among this. But I think it is better to try to start and be sincere and then no one can stop you. So, let's begin? Are you ready? \r\n\r\nLife for me is a move forward! This is development and self-improvement. I believe that I am a person, creative, hardworking, initiative, because I constantly search for new ideas, inspiration. I am a happy person because I have a wonderful son and a loving job. I am a cosmetologist and I'm riding every morning to work with joy. I find it right, because work has to bring you pleasure. \r\nIn my spare time I am engaged in dancing, I like also a gym, active rest, trips. I'm crazy about eastern dances, because in them I open myself as a woman, I feel my body, every movement and rhythm. My future husband will be very lucky with me :) \r\n\r\nI have a small dream of a creative nature - to paint pictures and learn a piano game. However, I always lack time for this. \r\n\r\nMy vision of the future is a happy, strong family, loving, caring man and healthy smiling kids. My family is a team in which love, respect, harmony and mutual help reign. Where the husband is the whole head, and the woman is the first counselor, the children are brought up on the basis of love and respect for parents and society. It is very important for me to see a strong, reliable, caring, faithful husband for whom the happiness and well-being of his own family is in the first place, who honors and gives the nicest feelings to his wife, ahead of her desire for a step forward, who may be the most delicate favorite and the best friend. My husband, the one with whom I feel protected and endlessly loved. \r\n\r\nTell me about your life. What is the most important thing for you in your life? What are your priorities? I would like to learn about you as much as possible in order to faithfully go to our community's goal... To be happy together. \r\n\r\nWarmest greetings, \r\nVictoriia",
