    "girls_other_languages" => "Germany",
    "girls_info" => "Are you ready for dizziness? This is what awaits you if we start a relationship :-) Because I want to take everything from this life! And you? I adore dancing, traveling, cooking, knitting, hanging, playing bowling, swimming, going to the theater, karaoke, reading psychology - in general, to conduct my life actively and brightly. Are you with me? \r\nMy biggest dream is Maldives. Lost in the turquoise waters of the Indian Ocean, the Maldives is struck by huge palms, bright colors of flowers, snow-white beaches, silence and complete unity with nature. I do not know when I can go there, but I dream to spend our future honeymoon exactly there. This is the most fabulous place for lovers!!!",
    "girls_1st_letter_subj" => "You intrigue me and I confess to you that....",
    "girls_1st_letter" => "You can close your eyes to what you see. But you can not close your heart to what you feel. Open your heart to me !!!\r\nHi dear!\r\nMy name is Tatiana and I want to show you my world. My friends say that I am cheerful, charismatic. Yes, I love life, look positively at everything that happens to me, I love traveling, sports, my job, and most of all I love my little daughter. With her every day is not the same as the previous day, she does not let me be bored, I teach her something new, and she's me. I check my level of patience with her). Do you have children? In what ways are you with them? Do you want to become a father?\r\n\r\nI work as a lawyer in a law office. My specifics of work is family law. Every day I meet new people and try to help them. Yes, I just love justice, and I want everyone to get their own. I love my job and I do not regret that I chose this profession. And you, what do you do? How is your day? Do you have time to have lunch during business hours?)\r\n\r\nMaybe it sounds trite but I like to travel, I like to learn the world in all its glory, to communicate with people of different nationalities. After all, we are all so different and interesting))) The most amazing places wich I have visited are Cologne Cathedral, the velvety beaches in Cancun, and the small old streets of Italy. I love architecture and different historical places. Recently I started to ride horses. Communicating with them brings me a lot of positive emotions, horses are such amazing creatures, they radiate calm and warmth ...\r\n\r\nIn the evenings, after a busy day, when the city is already falling asleep, I light candles, turn on good music and enjoy the taste of good wine. We need to let romance into our lives. Do you agree with me?  Tell me about your hobbies, what kind of music do you like, what inspires you?\r\n\r\nLife is very fleeting and sometimes you do not notice what is happening around you. So my motto is - Dance like no one is watching you. Sing like if no one hears you. Love like if you were never betrayed, and live like if the earth is a paradise!\r\n\r\nBut my story does not end here ... there are so many interesting things that I need to tell you more .... But in the next letter, if you do not mind:)\r\n\r\nWith tenderness\r\nTatyana)",
