    "girls_other_languages" => "russian",
    "girls_info" => "My parents raised me like a real lady since childhood. To be beautiful and well-groomed, to please men, and as a result, to find a worthy partner. To be smart and educated, to find a good job, to self-realize and become an independent person. To be healthy and reasonable, to give birth to healthy children, and then to be able to properly raise and nurture them. And, finally, to be an interesting, inquisitive and deep person, so as not to get lost among the crowd. I have this all. But I don't have the most important thing - LOVE. I really want to love and be loved.\r\nI have a very calm and gentle nature ... but my hobbies are against my nature :) I'm going crazy about skiing. Probably the speed, the sensations of flight and the wind in my ears is what I need. I also love to travel and my most cherished dream is to see the whole world.",
    "girls_1st_letter_subj" => "You will be surprised ....",
    "girls_1st_letter" => "What this fragile girl from the photo does in her life? Ready? :)\r\n\r\nMy name is Marta and I'm a cop!  Although to be extremely frank, I am a future policeman! Do you like women in a form? :) Iâ€™m sure youâ€™ve already imagined this in your head :) Admit it :) LOL \r\nSo, let's begin... \r\n\r\nWhen someone asks you to describe yourself, what do you think first? Your name, your job or perhaps your hobby. But do these things really explain who you are or show your identity? Not really. \r\n\r\nMy name is Marta! Intriguing start? Really? I am a simple girl from a small town in the western part of the country... I was born and raised... This is, if briefly... I am joking :)\r\n\r\nI am an ordinary girl who is looking for her love! Believe me, I love to live in a high! Drink coffee in cozy terraces, get up in the morning from sunbeams, long walks in the evening and late visits to the cinema. \r\n\r\nSometimes I feel that I am mature in everything. A strange feeling for a girl which is in her twenties :) But this is probably through my work. I should always be on the alert :)\r\n\r\nI really like to cook. And not just a check mark in the questionnaire! I think that I am prof. Because I started cooking from childhood. At first, I helped my mother. But then it turned into some passion. You just have to try my dish :) Do you like to cook? \r\n\r\nI love winter sports. Especially on skis! This is very amazing.. Speed.. Frosty air! Everything! This is my best time. And I always try to learn something new... \r\n\r\nI like to travel! Getting to know many other people and cultures was a truly amazing experience! I have a lot of stories to tell, and a lot of decisions that I want to make in the future. This is an exciting time, and I am inspired to soak up more experience and get to know more people. I was in Poland, the Czech Republic, Germany, the Netherlands! But I want to visit Paris and especially Louvre. What about you? Do you like to travel? \r\n\r\nEven at such a young age, I want to have a happy and friendly family! My dream of mutual love! Right, so that for life! I dream to meet a man for whom love is not an empty sound. A man who for me will turn the whole world! And I will offer his loyalty, love, understanding, and respect. \r\n\r\nI will be glad to find out what kind of man you are ;) Have a good day! \r\n\r\nSincerely, Marta",
