    "girls_info" => "I am an attractive, self-sufficient and happy woman. I can say that life loves me, and I love it)) At the same time, I am gentle, romantic, and a little girl lives in my soul who still believes in a fairy tale about a prince on a white Mercedes)) I am a multi-person person, I like traveling, going to the gym, going to theaters and operas and experimenting in the kitchen:) I'm communicative and funny, sometimes I like to joke with my friends. A boring life is not for me! So beware! :))",
    "girls_1st_letter_subj" => "I know what can intrigue you ....",
    "girls_1st_letter" => "Hello \r\n\r\nMy name is Tatiana!\r\n\r\nMaybe, you are also waiting for our meeting like me. I hope for that! And while you are reviewing the photo, I will say a few words about who is looking at you from this picture. ))) ok?)\r\n\r\nI have an interesting life, I enjoy every moment of that. I'm a very cheerful woman! How about you?\r\n\r\nI have two sons. They are my pride. Do you have children?)\r\n\r\nI am a slim and very charming lady with a beautiful appearance. I'm fond of sport! It helps me to be in good shape! Are you fond of the sport? I prefer a gym and athletics!\r\n\r\nIn addition, I also have a very deep and positive inner world. Someone wrote that he does not change a person and the only thing that can rebuild the system of his thoughts and feelings is love! I really hope that you're not afraid to open your heart for love! Love does not allow a person to eat, sleep, work, deprive of peace. Do you believe in love? For you more important inner world or a good appearance?))) Interesting to know your position)))) Many are afraid love because it is, appearing, crushes and breaks everything old and familiar. I'm not afraid, that's why I'm writing to you. It seems to me that we can become special to each other.\r\n\r\nIn my spare time, I like to go with friends to concerts and movies. I love to travel ! I think travel makes our life more interesting and better. I dream about around the world journey) I know it's not very original, but traveling is my passion. Do you have your own passion?\r\n\r\nI love flowers like all women))) Domestic plants is my hobby too. I like to care and grow flowers in pots.\r\n\r\nI hope you will pay attention to my letter and give the answer!\r\n\r\nI'll wait for your letter with impatience!\r\n\r\nTatiana",
