    "girls_info" => "I am simple, positive woman and i am looking for serious man to spend life together with respect and caring and understanding. All I'm looking for in a man is confidence in the future. To know that you are loved and desired. Respect, without which there is no strong relationship, trust, which is not neglected. Next to the worthy and you want to be worthy. The woman is the shadow of a man, where he will lead her, there she will follow. Love without words, but with a lot of crazy things. With such a man, I firmly took his hand, go with him along the path of life.",
