    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am open for communication and a very kind person. I remember only good, positive things and soon forget everything bad. I always try to see the good in every person and situation. I never feel jealous, as I think that jealousy is an ugly. In my opinion, if somebody wants something they should achieve it themselves. I dislike gossip. I have lots of good friends, they value my sincerity, and I do the same. \r\n\r\nI like to spend time with my friends and relatives enjoying doing something interesting together or just chattering with them. I like being in the open air, organizing picnics! I adore reading and have several favorite books, that I can reread again and again. I am a very active person and I like doing sports - this helps to keep fit! Watching movies and listening to music are also favorite past-time activities for me.\r\n\r\nI am looking for a generous, caring man with compassionate nature.  I hope him to be a cheerful, positive and kind man, who is able to take care and provide for his family. I am looking for a man for long-lasting and serious relationship that will lead to the creation of a family. It is very important for me that the man loves children and wants to have more children with me. I would like to meet a soul mate with whom I will be happy until the end of life.",
    "girls_1st_letter_subj" => "Serious relationship only",
    "girls_1st_letter" => "Hello!\r\nLet me tell you a little about myself. I am a kind, attentive and active lady. My name is Lyudmila! I was born and grew up in Melitopol, Ukraine. I always like doing sports since my school years and was an initiator of different activities in my class. I really liked physical training, so I have chosen the profession of a fitness trainer. I have got a sister, she is in her early thirties. My parents are in their sixties and now they are retired. They are very cheerful and happy by nature and we are the best friends with them! I got married in 2001 and gave a birth to my daughter Diana in 2002.She is very pretty, curious and she likes studying. I have been married to my former husband for several years and by his initiative we divorced.\r\nI like to spend time with my friends and relatives. I have a very friendly family and we love to get together not only on holidays but also for no special reason to meet. We all like to go to the countryside and try to spend time in the open air whenever we have a chance to do it. We really adore nature! I adore reading and have several favorite books, that I can reread again and again. I adore sports as well. I am a happy person, as my hobby has became my profession! I like my job very much! \r\nI have registered with the agency, because I want to change my life radically. I am really looking for serious relationship with a generous, caring man with whom I will be able to create a family and spend the rest of my life together. It would be fantastic to have mutual kids, too. \r\nIf you have the same goals, please write me.\r\nI'm waiting for your letter,\r\nWarmly,\r\nLyudmila",
