    "girls_info" => "Am looking for a long term relationship. It is important to me, that we respect each other and can talk about everything with each other so that to understand each other better. I am open-minded, honest, loving, humorous, faithful. I hope to meet a loyal, trustworthy and responsible man who wants to create a family with a good Ukrainian lady. Currently I live and work in Italy, but come from Ukraine. I will be happy to start our acquaintance.",
    "girls_1st_letter_subj" => "I am ready for a fresh start",
    "girls_1st_letter" => "Hello and thank you for reading my profile. I am a simple, open hearted, loving and honest woman. I am hard working and reliable. I would like to find a person who will be my real soul mate, my friend, who will be sincere in relationship. In a person I value intellect, kindness, honesty and sincerity, decency, reliability, responsibility. I am not looking for rich prince, but my man needs to be caring and generous. For me, ideal relationship between two people should be full of love, romance, trust, believe, confidence, harmony, sensitivity, understanding, forgiveness, reliability. I dream to have a loving and caring person next to me, to have a strong, friendly, loving family, sincere relationship and to live in respect and mutual support and understanding.\r\nHope we are looking for the same things.\r\nThen do not hesitate to write me back.\r\nBest regards,\r\nOksana",
