    "girls_other_languages" => "Russian, Ukrainian, Polish",
    "girls_info" => "I am Irina and I live in Zaporozhye, Ukraine.  Looking for my man - real soulmate, best friend, lover, care person, funny and easygoing. Hope, you are reading this now and we are only in one message to start our story. I am an optimist by nature. Always open to communication. In people I appreciate kindness, loyalty, energy, cheerful nature. Currently looking for a man to create a family with. I love nature, sports, horse riding, swimming, movies, concerts and different activities.",
    "girls_1st_letter_subj" => "And what is love to you?",
    "girls_1st_letter" => "Hello and nice to meet you here! Thank you for reading these lines. I want to tell you my thoughts about love, and hope that you will share yours with me, too..perhaps they coincide..\r\nTo me love is understanding and trust. Trust is very important. To me love growing up with each other, not in age but in understanding..Fighting doesn’t mean a bad relationship, it just means you need to mature more and make it work. To me love is about no secrets and passwords. I don’t have anything to hide, and so shouldn’t you. It is about being responsible, caring, supporting and coming back home tired to the smile of one person who makes it all worth. Having a thrill is one day thing, which I don’t believe in, but having to love someone is hard work.\r\nAnd what is love for you? \r\nHope to receive your reply,\r\nIrina",
