    "girls_other_languages" => "Russian, Ukrainian, Chinese",
    "girls_info" => "I am a well-educated and intelligent woman, I am very curious and I like studying. I have an optimistic nature. I always try to see the good in every person and situation. I believe in love at first sight. I am sure if two people are destined to be together there are no boundaries or barriers for them.\r\n\r\nI like cooking, experimenting with dishes of various cuisines, doing something with my own hands. My last hobby is diamond mosaic. I like books and read always and whenever this is possible. Travelling is my passion as well. During visiting different places I am always pleased to see the historical places and to feel wonderful atmosphere of those cities.\r\n\r\nWhen I think of the right man for me, I think of someone who can carry on a conversation whether the topic is silly or serious, who knows who he is, what he wants, and what things in life matter (if still not we can clear up together). Iâ€™m sure that our beliefs and life values will help us to become inspiring and enviable companions in every eventuality.",
    "girls_1st_letter_subj" => "Warm letter for you...",
    "girls_1st_letter" => "My name is Nataliya. I was born in the beautiful city of Zaporizhzhia in the south of  Ukraine but when I was 2 months old my family moved to the Far North of the former Soviet Union. We lived in a small town, situated on the bank of Kolyma River, beyond the Arctic Circle. The brightest memories of my childhood are Northern lights, Polar nights and daysâ€¦ I think itâ€™s one of last areas of wild nature in the world, with its huge variety of berries and mushrooms! I still remember the taste of blueberry, cowberry and cloudberry.  I finished school there and went to the Siberian City Irkutsk to enter the University. My specialty is an interpreter of Chinese and English languages.  \r\n After graduation from the University I lived and worked in Irkutsk.  By that time my parents had already returned to Ukraine, in 1998 my father died suddenly and I had to move to Ukraine to help my mother to survive. \r\nI was living and working in my native city of Zaporizhzhia from 1998 till 2006, at the end of 2006  I was offered a job in China.  It was a difficult decision for me, as I was in a five year relationship which had never ended in marriage. I had a good job, a successful career and what is the most important I had to leave my mom all alone. However after debating the matter in my mind I decided to go. And I have never regretted! I was offered a one year contract, but eventually I stayed in China for 12 years. I met my ex-husband there, he is from Russia. We got married in Bejing and lived 9 happy years together before were divorced in 2017. \r\nIn March 2019 I returned to my native City of Zaporizhzhia and now I have an adaptation period after 12 years abroad.\r\n I am a well-educated and intelligent woman, I am very curious and I like studying. I like theater very much. I didnâ€™t have a possibility go to the theater in China, so I have big plans for this now. I like cooking, experimenting with dishes of various cuisines, doing something with my own hands. My latest hobby is diamond mosaic. All these activities or simple chattering with my friends can make my day. \r\nI like books, I read always and whenever this is possible. My work in China involved lots of travelling, so I spent a lot of time on the road: in cars, buses and planes, my eBook traveled with me everywhere . I really adore reading, and I am so glad that all my favourite books, that make me think, laugh or cry, can be stored in my small eBook.\r\nTravelling is my passion as well. As I mentioned before I started travelling from the very beginning of my life when I was only 2 months old. Iâ€™ve been to some Asian countries like Malaysia, Vietnam, Thailand and Israel.  Last year I visited several  European countries, I was able not only to see the historical places but to feel wonderful atmosphere of those cities.  I fell in love at first sight with amazing Barcelona. Iâ€™ve visited Guell park and was impressed by inimitable masterpieces of Gaudi.  Salvador Dali theater-museum in Figueres impressed me greatly. \r\nI have an optimistic nature. I always try to see the good in every person and situation. I believe in love at first sight. I am sure if two people are destined to be together there are no boundaries or barriers for them. \r\nI have been lucky in life and now I am looking to be lucky in love. I want to meet a true partner for life with whom I can share my love. When I think of the right man for me, I think of someone who can carry on a conversation whether the topic is silly or serious, who knows who he is, what he wants, and what things in life matter. (If you still have no idea we can clear up this together) \r\nIâ€™m sure that our beliefs and life values will help us to become inspiring and enviable companions in every eventuality.\r\nWarmly,\r\nNataliya",
