    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am open for communication, cheerful and honest. I like to be around interesting and smart people. I have good manners and I am very kind. I have lots of good friends, they value my sincerity, and I do the same. I am educated and intelligent, this helps in life a lot.\r\n\r\nI like cooking a lot! And i am a good cook indeed, all my friends and relatives enjoy food cooked by me. I like being in the open air, organizing picnics! I adore the nature of my region and I am sure that there are always new places to discover even in your native city. I like cycling - this helps to keep fit! Reading and listening to music are also favorite past-time activities for me.\r\n\r\nI am looking for a cheerful, positive, kind and caring man. I hope my chosen one to have a great sense of humor, I hope him to be able to love and to open his soul and heart in front of me. I am looking for a man who knows how to treat a woman - with respect and dignity. I hope to meet a man who looks for the only one lady for him - for the lifetime. I would like to dive into the ocean of love with my soul mate, and to feel the same bright emotions and strong love through the whole life!",
    "girls_1st_letter_subj" => "I wish to find my soulmate!",
    "girls_1st_letter" => "I am Olga, or as my family and friends call me - Olia. I am an educated lady, I have obtained a diploma in economics and I am working at the State Department of Social Security as assistance specialist. I really like my job because I can help people and this brings true pleasure to me! I know when it's in my power to improve their life I will always do my best and as a reward I will see their happy eyes! \r\nI have got quite a big family. But I live only with my sons, we live in a flat. My parents live in their house and enjoy serene and happy life, doing gardening and growing vegetables and fruits. My mother's name is Alla she in her early sixties, my dad's name is Mikhail, he is in his mid-sixties. My mom is a big fan of flowers, her flowerbeds are always beautiful - genuine masterpieces.\r\nI have got a sister, her name is Irina, she is 2 years younger than I am. She is a happy wife and mother, her husband's name is Dmitriy, and their kids' names are Kristina and Vladimir. We enjoy spending time together. I love my family a lot.\r\nNow, I will tell you about my closest family - my two sons. My elder son's name is Ilia, he is my greatest help in everything. He is an intelligent and educated young man, he likes the speed and riding his scooter, he enjoys fishing and he has got lots of good friends.\r\nMy younger son's name is Artyom, he is a cheerful boy, he always has something funny to tell and as all kids do - he likes to play outside, ride on the swing and play with other children. He adores when I read fairy-tales to him, and he can also read children's books himself! He likes drawing and playing with toys, too.\r\nI like cooking, and I always do this with all the warmth of my soul, this helps to make all the dishes that I cook really tasty. It's a delight for me to please my closest people with delicious food! I like to watch films and to read books - thrillers and adventures are my favorites. And of course listening to music - popular, rock and classical. I like learning something new and one of my dreams is to learn how to drive a car!\r\nAnother passion for me is travelling. I haven't been abroad yet, but I like the Crimean peninsula, it is one of the most beautiful places for me! With its special atmosphere, stunning views, the combination of the sea and the mountains - the pictures that can be taken there will not leave anybody indifferent. This place is wonderful for active and leisure time - the nature is impressive and the flora and fauna are unique. \r\nAnother place in Ukraine that I find really attractive for me  - the Carpathian mountains. With their lively and pure nature this place has become a wonderful destination for me to spend my vacation. I adore the bright colors of that region, fresh greenery and bright-blue sky, that you could possibly touch with your hand if you climbed the highest peak:) \r\nI am a very romantic person by nature, maybe this is the reason why I decided to look for my soul mate. I can't live without love in my life. I am very determined to find my second half with the help of the agency and I truly hope that I will find a decent and trustworthy man, who is also in search of true love. I would like to have a real family, where everyone cares of their close people. I dream to meet my Only One to spend our lifetime together, to enjoy every day, as the best holiday, just because we have each other, giving love and tenderness every single minute! \r\nI hope that you felt the warmth with which I wrote this letter to you and you will reply very soon! \r\nOlga",
