    "girls_info" => "I can describe myself as a calm, quiet, but very open person. I am very kind and always ready to help. I am a very simple woman with experience of life who can love and who hopes to find her real love here..I can love myself and I can comfort in the house. I like cooking and can cook very well. For me family is always on the first place, and I think that a woman's mission is to be a good wife and a mother. \r\nI'm looking for a relationship with a nice man to share life and create a happy family in the future.",
