    "girls_info" => "My name is Yana. I live in Ukraine, Zaporozhye.  I am a photographer by profession. I bring up 3 children. I take a great interest in cooking, movies, theater, sport and photography. I consider myself to be well-educated, intelligent, open-minded and sociable person. I dream to meet a reliable, positive man who loves children and who is ready to create a family.",
    "girls_1st_letter_subj" => "Accept responsibility for your life",
    "girls_1st_letter" => "Hello, my dear.\r\nI am glad to welcome you in my profile, thank you for finding the time to read it and my letter. I have some life experience and I am here with the only desire - to find my man who will become my husband. My motto is the following: \r\nAccept responsibility for your life. Know that it is you who will get you where you want to go, no one else. So I strongly believe that everything is in our hands. If a person sets a goal, he will always achieve it, with God's help. Now my goal is to meet my soul mate and create a happy family with him. I know that I will be a loving and a caring wife who will never betray or cheat. And expect the same from a man. If you are interested in getting to know me better, please write me back.\r\nBest regards,\r\nYana",
