    "girls_other_languages" => "Italian",
    "girls_info" => "I am here to find my soulmate and nothing can stop me, distance, age difference, culture, all is not so important if you feel harmony with your man. I want to find a man with whom I can enjoy every second of being together, a man who wants to feel woman's love, care, attention and support. I dream to find a true gentleman, kind and respectful person, I do believe you exist! A man who can present me his smile when I smile to him , a man with whom I can have fun, to joke and laugh together.\r\n I am a rare gift for a man. I can be very flexible in any life situations. If you are sad I will always find the way to cheer you up and to calm down, if you need my support I will be always near you and do all I can to make you feel better. I try to be optimist.",
    "girls_1st_letter_subj" => "Believe in hope!",
    "girls_1st_letter" => "Hello  from Ukraine, Vinnitsa. My name is Irena,  it will be nice to find a good man with the help of a serious agency like this. All my friends give me good testimonials and recommendations to register on this website, some of them found their love and now they are happily married, so here I am writing this letter. I believe that if they were lucky I be lucky here too. Do you believe in signs in your life? \r\nDo you have any special beliefs in your life ? \r\n I think that in life things will happen how you want if you really have a strong wish, have you ever seen the movie  called : 'The Secret' ? \r\nIf not I recommend to watch it. \r\n My personality is very open and sincere, I have a good heart and like to help other people and make them happy, I feel happy when I see smiles of my friends, family and when I do something useful for society. \r\n  My children are grown up, one of my daughters lives in Turkey and has her own independent life, another daughter lives and studies in Poland and has also her own independent life. I live alone now in Vinnitsa and completely free to spend all time and give all my love and care and attention to my man.  \r\n I am ready for relations and for moving to another country, my job allows me to have free time and I can have free days off when I can. I work in real estate company, sometimes not many clients who want to rent or to buy flats or houses or lands, so I have free time. \r\nCan you have free days off when you can ? Do you have time for your family life and for your future woman? \r\nHave you ever thought of visiting Ukraine or maybe you did visit Ukraine before ? \r\nIt will be a pleasure for me to read a reply letter. \r\nThe Best Greetings, \r\nIrena",
