    "girls_info" => "I am a family-oriented lady looking for real true love and happiness in life. I am dreaming to share my life with the serious man who respects family values and can treat me with care and love. I would like to trust him and rely on him completely in any situation. I am an easy-going person and always reach my aims in my life. I am open and direct and tell people what I feel . I think it is very important and shows 'the real you\", your feelings and intentions.\r\n\r\nI would like my man to be understanding, loving and always open and feel free to share how he feels about everything. It really helps to leave all the misunderstandings out between. He also can be romantic and know how to surprise me.The only thing I really want in my life is to create a family with the man who feels the same way like me and has similar interests and ideas in life. To complete each other is the best match for both. It seems very naive but I do believe that it`s possible, just give it a go.",
    "girls_1st_letter_subj" => "I am ready to move on",
    "girls_1st_letter" => "I  would love to know you better,  it happened so in my life that I had bad luck , but it is time to move on,so here I am moving on. \r\nI am here to find a man who is ready to start a new page in his book. \r\nAre you ready to move on? \r\nI love  people, those who even in hard situations do not moan or complain, but go and win. I am very easy to get along with, whether we are having fun or solving a difficult issue. I always try to help people. I am used to treat people as they are, to smile sincerely, not only with my lips, but with heart when talking to them. Actually I believe that optimism and humor are the things that save us from despair and help to go on.\r\nI hope to meet an intelligent, kind-hearted and persistent man to share my dreams and feelings with. I like when a man knows what he wants out of life. I am looking for a partner who values relationship based on mutual trust, honesty, affection and love. It is very easy to describe the ideal relationship, but it is very difficult to implement them. I see them in my world that all should built on trust and well-being.\r\n\r\nIf my letter catch your eye, feel free to write me back.\r\nSincerely yours,\r\nViktoria",
