    "girls_info" => "I am a person who loves to live to the fullest. And I am sure you will never be bored with me. I love reading, playing basketball and all kinds of sport, riding a horse. Also I like music and play the piano. It is interesting for me to learn and to study. I am very family orientated. I hope to meet a man here with whom it is possible to start the relationship which will finish with a marriage.",
    "girls_1st_letter_subj" => "The secret of a happy marriage is...",
    "girls_1st_letter" => "The secret of a happy marriage is finding the right person. You know they're right if you love to be with them all the time. So I am here because I want to find my right person. I like the men who can smile in trouble, who can gather strength from distress, and grow brave by reflection. The men who find joy in everything they choose to do - every job, relationship, home... they either love it, or change it. In my opinion, happiness cannot be traveled to, owned, earned, worn or consumed. Happiness is the spiritual experience of living every minute with love, grace, and gratitude. And what is happiness for you? And what does love mean for you? It would be great if you shared your thoughts with me..\r\nWaiting for your reply,\r\nDasha",
