    "girls_info" => "In any difficult life situation I remain an optimist. I believe in people and I also believe that I will meet here a worthy person who needs love and support. To the man whom I love, I will give all my care and tenderness. I want to find my soul mate. For me it does not matter what kind of appearance a person has. The soul is more important for me. With the years, the appearance of the people changes but the soul remains unchanged. I consider myself to be kind, intelligent and an interesting interlocutor. I think that communication is very important in relationship. I love music, nature, animals, flowers, outdoor activities, reading and traveling.",
    "girls_1st_letter_subj" => "Music expresses what cannot be said..",
    "girls_1st_letter" => "Music expresses which cannot be said and on which it is impossible to be silent..Music has healing power. It has the ability to take people out of themselves for a few hours. I enjoy being happy every day, and hopefully you can hear my happiness in my music. Life is beautiful. But still I am not completely happy..I have 2 lovely sons, but still I am not happy as a woman. I am looking for a reliable life partner here, with whom we will be able to start everything from the beginning and build a family. A persons soul is more important for me that appearance, I am looking for a person who is beautiful from the inside, who has pure thoughts, kind heart and intelligent mind. And I am ready to give my love and tenderness to him, to make him feel loved, needed and appreciated..\r\nPerhaps it is you..I would like and I hope it is you who is reading this my letter..\r\nSincerely,\r\nNataliya",
