    "girls_info" => "I am a positive person and I love my life and everything around..But a human being can not stay alone to be fully happy, so I am looking for an honest and caring man with whom I can build a nice family and spend the rest of my life. I have a lovely daughter and I hope to find a man who will treat her as his own child. I know it is a big responsibility. In return I will make this man the happiest in the world. I can be loving, passionate, affectionate and caring.",
    "girls_1st_letter_subj" => "we have to make many choices..",
    "girls_1st_letter" => "In this life, we have to make many choices. Some are very important choices. Some are not. Many of our choices are between good and evil. The choices we make, however, determine to a large extent our happiness or our unhappiness, because we have to live with the consequences of our choices. I have made up my mind to be happy and to open a new page in my life. As I'm getting older, I'm really learning unconditional love and loyalty are extremely important. I do not want a husband who honors me as a queen, if he does not love me as a woman. Love is very important. I want to love and to be loved. I hope to meet my man here and to share my life with him. \r\nIf you are interested in getting to know me better, please write me back,\r\nSincerely,\r\nInna",
