    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am glad to welcome you on my page.  I am an open, caring, kind person, and like to smile in every situation, even if it is hard. My job is my hobby and it gives me much pleasure. I wish to spend life full of happiness so I am filling it with my warmness and positive thoughts. I am searching for an honest, caring and kind person, with loving heart to build a family.",
