    "girls_1st_letter" => "Femininity is not just lipstick, stylish hairdos, and trendy clothes. It is the divine adornment of humanity. It finds expression in your qualities of your capacity to love, your spirituality, delicacy, radiance, sensitivity, creativity, charm, graciousness, gentleness, dignity, and quiet strength. I consider myself a feminine, gentle and a real woman in all the senses of this work. I am working hard of myself and try to develop my mind as well as my appearance and body. \r\nSome of our important choices have a time line. If we delay a decision, the opportunity is gone forever. Sometimes our doubts keep us from making a choice that involves change. Thus an opportunity may be missed. I am here because I do not want to miss my chance for happiness. I think everyone deserves it, and I hope that here I will find the man to share the life with.\r\nSvetlana",
