    "girls_1st_letter_subj" => "There is no right time and place for love",
    "girls_1st_letter" => "There is no right time and right place for love... it can happen any time. For me true love is eternal, infinite, and always like itself. It is equal and pure, without violent demonstrations: it is seen with white hairs and is always young in the heart. Believe in love. Believe in magic. Believe in Santa Clause. Believe in others. Believe in yourself. Believe in your dreams. If you don't, who will? I believe in my dreams. And my biggest one is a happy family. I know that the career will not be waiting for you at home when you come from work, it will not hugs you when you need the support and will not say that everything will be just fine. Only beloved person and the children will do it. And I want it so much!\r\nHope to hear about your dreams..\r\nSincerely,\r\nLiliya",
