    "girls_info" => "I am a woman with whom you will never be bored. Besides I devote much time to my professional development, I like different kinds of sports - fitness, roller blading, swimming, I am taking the lessons of different modern dancing. I like going to the cinemas, theaters, I am fond of live music and enjoy visiting concerts, I like traveling, spending time with my son, with whom we are good friends, I like cooking, bowling, volleyball. In general, we will always find the things to do together:)",
