    "girls_1st_letter" => "All we have is today. Just live it. We don't know about tomorrow. So, enjoy the day. Love yourself, and spread love around. I love the sea's sounds and the way it reflects the sky. The colours that shimmer across its surface are unbelievable. This, combined with the colour of the water over white sand, surprises me every time. Marriage for me is not a noun, it's a verb. It isn't something you get. It's something you do. It's the way you love your partner every day. And I am ready to do and to love my partner. I am ready to create the perfect marriage, and I am ready to work hard for it, as I know it is always the work of 2 partners.\r\nAnd what is marriage for you? \r\nSincerely,\r\nIrina",
