    "girls_info" => "I am fond of animals, nature. I prefer an active style of life. I love to spend time with my family and my son outside. I am dreaming to meet a man who will understand and appreciate me. I am an opened and kind person, with a good sense of humor and very romantic. I adore my work, which brings joy and knowledge to people and a satisfaction for me. Family values are very important to me. Only beloved man is missing in my life. Do you agree that happiness becomes greater if you share it with your beloved one? I believe in my lucky chance! Good luck to all of us in this search!",
