    "girls_1st_letter" => "Hello! \r\n\r\nI will give you the key of my heart \r\nAnd when you enter \r\nPlease \r\nIrrigate the veins with all your love \r\nMaintain it with your fidelity \r\nTake care of it with all the tenderness \r\nAnd it will be the opening \r\nTo our eternal love.\r\n\r\nI have started my letter with a poem... I am a very romantic lady who is in search of her beloved man. I have been alone enough and it is time to change something in my life for the best. I have two beautiful daughters,who already are very big. I am free to start a new life with a man from abroad. I am searching for a passionate true love and serious relationship. I am ready to follow my man everywhere. Are you ready to risk and fall in love with me? \r\n\r\nWarmly,\r\nTanya",
