    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a kind and very honest person. I prefer everything to be clear and right.\r\nI am full of energy. I love life and can't let myself to waste every single day\r\non useless things. I am also very gentle and sensitive. I like to give pleasure\r\nand I know how to make the man feel comfortable and relaxed.\r\nI am happy because I have everything I need in life. Almost everything.\r\nThe only thing I miss is love. I hope to find it and become the happiest person\r\non the Earth. I like water. I like summer rain. When warm drops touch the face.\r\nI like to walk barefoot along the wet grass. I like the feeling of the silk\r\non my skin. I like the sun to touch my eyelashes, when I close my eyes.",
    "girls_1st_letter_subj" => "Hello, nice to meet you)",
    "girls_1st_letter" => "Hi)\r\nWhat love means to me...\r\nReal love is more than beautiful flowers and sweet words, more than candlelight dinners or romantic walks in the park.\r\nReal love is understanding through the difficult times, caring past the disagreements. It''s laughing together when things are good or laughing together to keep from crying when things could not seem to go more wrong. That is what I am seeking for in my future relationship and in my future marriage.\r\nThis dating site is  one more way for me to find my true love as soon as possible. My friend told me about this dating site and I made a decision to try to find my happiness in such a way. I believe it may help me in my wish to be happy and to make my beloved man happy when I find him.\r\nI have never been married. I guess it is because I have not met the right man for myself yet. \r\nYou may wonder why I am looking for my beloved person from so far. I think that Ukrainian men do not cherish their women. I believe that foreign men treat their women with respect and great understanding and moreover, they know what they want in life and they do everything to reach their goals.\r\nI work in Kharkov National University  as a  teacher. I teach tourism. I like this job as there is some sort of stability in it. And in the future I would like to combine my work with taking care of my family. I guess that I may find something closely related to my profession even after moving to another country. It does not matter for me how much I love my job as I will never love it more than my family.\r\nIn my spare time I enjoy studying makeup art in different variations. I love it!!!. Since my childhood I have always wanted to look beautiful!\r\nI believe I may be interesting for other people not just by my interesting looks but by my inner qualities as well. \r\nAt the moment only work does not let me feel myself lonely but I believe that soon there will be a special person in my life who will never let the loneliness come into my life.\r\nI hope we can get to know each other a little bit better. Do you think it will be possible? \r\nI am looking forward to hear from you soon.\r\nSincerely,\r\nOlena",
