    "girls_info" => "I consider myself to be an all around, \"nice girl\". I believe in treating others, as I myself would like to be treated. I am easy-going, fun to be with, reliable, trustworthy, caring, affectionate, also understanding, and communicative. My friends all say, I am really easy to talk to. I am someone who sets goals, creates plans, and achieves those goals. I am confident in who I am, and what I am capable of. I believe anything is possible when believed with conviction. I am creative, artistic, open-minded, intuitive, sensitive, and have a well developed sense of style. I \"see\" the world through \"feelings\". I am passionate individual, sexual, a dreamer, but in touch with reality. Hard-working and focused. My sensitive side will reveal a \"true\" romantic, in every sense of the word. I believe in love. I am definitely someone you can always rely on to make you smile, laugh, feel happy, and loved.",
    "girls_1st_letter_subj" => "Hi)",
    "girls_1st_letter" => "Hello, dear,\r\n\r\nMy name is Nadejda. I am from Kharkiv. I do want my letter to make your day ;)! I am an easy going and cheerful person. I enjoy my life, my job, being with my family, I have some true friends, but still my life is incomplete without my special one. I do not belong to people who play games with other's feelings. So, I am the one who is seriously interested in relationship. I want you to know that I am a very active woman. I enjoy being spontaneous and I do like trying new things for the first time. Creating new memories makes me feel great ;)). I love spending time on the beach in summertime, I am fond of jet skiing, water skiing, playing volleyball, body shaping, meeting my friends in parks, having picnics, BBQs, traveling to new destinations and many other. Also I love cuddling and there is nothing more pleasant than being next to a person you love. \r\nI can tell you that I am a one man woman and I believe that when you are in love any hardship is not a problem if your beloved is by your side. I do not want my first letter to be very long. If you are interested in me, please write me back and ask me anything you want, remember I am an open book for you ;)).\r\n\r\nWarmly,\r\nNadejda",
