    "girls_info" => "I am punctual, sociable, well-educated, kind, cheerful, with a good sense of humor. I have an older sister, we are very good friends with her! She is my buddy! I like to receive new knowledge. I am open for new experiments! I like changes in the life.\r\nI have a lot of different interests. I like music, cinema, theater, dancing, traveling, countries and cities. I like art, exhibitions, culture and history. I would like to find new interesting places, interesting fact about life and universe!",
    "girls_1st_letter_subj" => "Hello, nice to meet you!",
    "girls_1st_letter" => "Hello, dear,\r\nMy name is Tatiana. I am cheerful, gentle and caring. I love to dream and I am sure that if you strongly want something, it can come true. But I know that dreaming is not enough, you also need to act. One of the main qualities in a person is honesty. Lies to me is one of the sins, so I try not to break this rule. Equally important to me are faithfulness, openness and kindness. \r\nI believe that people should be treated the way you want them to treat you. I dream to meet a man who would change my life. I want to be that close to him that I will forget about the relationship I had before him. I wish that he was the best and was the only one for me. I am waiting to meet the love of my life. And I believe that this man is here. Do you believe in love at first sight? \r\nI think that if people are made for each other, they understand it immediately. Just look into the eyes. But love should be protected, because it is very fragile. Lovers should be best friends. And alas, our life is too short to waste it on those who are not created for us. I am waiting impatiently for your reply. \r\n\r\nAll the best,\r\nTatyana",
