    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "For some people I am the best in the world. Others think that I should be changed completely :) I can be a friend, a listener,  a good partner, a tender lady .\r\nI am a mature woman and I know what I want in life and know how to achieve that. I am a determined person. My favorite number is definitely one. I like to be at the first place and I am a one man woman! I love life and enjoy every moment of it. I keep smiling all the time and I believe that I will give my warm smile every day to my beloved.\r\nI appreciate honesty and faithfulness and I think that the bitter truth is better than sweet lies. I am really gentle, caring and passionate when I fall in love.\r\nI am a real woman with little sweet weaknesses and lacks but with a big kind heart and desire to give all of myself to my only one man.\r\n\r\nThe circle of my interests is very extensive. I lead an active way of life. I do fitness and swim in the swimming-pool. Sure, I prefer to swim in the sea in summer. It helps me keep my shape and to be active and full of energy. I have a hobby that is popular among men. It is fishing. I really like fishing. Some people think fishing is boring but I love the calm of the water, the escape from the everyday, the serenity or being on the water itself. I adore cooking very much. The dishes I invent can satisfy even the most extravagant tastes. One of my passions is flowers and plants. My house is full with different indoor plants. I like planting flowers and keeping them pretty.",
    "girls_1st_letter_subj" => "Hi)",
    "girls_1st_letter" => "Hello)\r\nI want to create beautiful romantic sincere relationship with the person who can love me for who I am with all my advantages and disadvantages. I want to find a person who can inspire me and make my heart beet with passion. I can say that I am calm and purposeful but I can also be passionate and I know how to achieve my aim. I like the movement of life and I like to take part in it. I think that we live only once and we should use every moment given us by fortune. I can say you that I am not interested in relationship for one day or one night, I am interested in relationship with one man, which will last for all our lifetime. I need a man who has strong family values, who knows how to love, who will take care of his family and wife, and who can live one life with one woman. I hope that you can understand what I mean.\r\nI am looking forward for your answer\r\nWarmly,\r\nYour Juliya",
