    "girls_other_languages" => "",
    "girls_info" => "I am fun and very energetic woman, I'm very passionate about life and my future partner which I hope to find here. I am easy-going and love to wake up early to have time to cook a delicious breakfast for my beloved people. My friends say that I love very much and always find beauty in everything that surrounds me. I have a great life, but I do not have a man with whom I could share this life.\r\n\r\nI like to stay in move: to walk, travel, swim, do some sport, ride a bicycle. I like to meet with friends, go to cinema or concerts, attend exhibitions or just go shopping. I like to read, run and adore to skate and cross stitching.\r\n From childhood I dreamed of becoming a police officer, but my parents were against it because it is a dangerous job. But I chose a lawyer profession, it is also very serious but less dangerous. I know how to ride a horse and often visit the equestrian club, I think that the horse is the most intelligent and divine animals. One of my favorite hobbies is cooking, especially I like to cook desserts.",
    "girls_1st_letter_subj" => "Hello, nice to meet you, dear!",
    "girls_1st_letter" => "Hello!\r\nToday I have rather a good day. Everything is just great: the weather is perfect, I feel happy and enjoy my day, but I have one problem - the lack of love,  and the thoughts about it are making me sad. I think loneliness is a very bad and unpleasant thing. We all need somebody to love. We all want to be happy and make somebody happy. I think feelings which love brings are the best in the world. How do you think, have you had your true love? When two people do love each other they survive all problems and still are happy together. What happened in your last relationship? Do you still communicate?\r\nLove is a magic thing. When you fall in love with somebody world seems to you amazing. Everything is fine and you forget about all problems you have had before. You're looking forward to spend evening with your dear person and minutes without them seem to be eternal. It sounds great and I think you're here with the same desire. If yes write me back soon and we'll be able to talk more about love and feelings. What are your most treasured plans for the future?\r\nI'll be waiting for you answer.\r\n Viktoria",
