    "girls_info" => "I'm looking for my soulmate and family. I like life, hand-made and traveling. I like healthy food and do yoga, but without fanaticism. I like my profession and my job, I prefer to work instead of to be at home. I like people and friends, like new ideas, new food, new cities and new impressions.I'm not jealously. I hope to meet my partner for life, I believe, he exist and looking for me in this Universe.",
