    "girls_info" => "I am a gentle, easy-going, and family-oriented lady. I like to bring home comfort and hospitality. I am rather a good listener. I cannot say that I really like big noisy companies, I prefer romantic atmosphere more. I love animals and nature, my pets bring me happiness! I am a very positive person, cheerful and I look forward to a new day, giving thanks a God. I do believe in real love and I genuinely believe that I can meet my love here, on this site.\r\n\r\n I have so many hobbies as: painting, dancing, singing, cooking, running, reading. I can find myself in all what I do in my life, because I make it with love. I try to put my heart in all around me. Therefore, when I will start my relationships with a man from this site, I will do all to see him happy and smiling. I will bring in our relationships love, honest, care and trust. I am a sun and I light until the end, because I know what I want. I want to create a strong family and bring new energy in your life.",
