    "girls_info" => "It always fascinated me how two people from different spots of the world, two complete strangers meet each other one day and can't live without each other from now on. I love to have the possibility to meet someone special through a service like that and hopefully soon we both can say thank you to it. I believe that I am a beautiful and smart woman, the one you can trust and the one who will stay by your side no matter what. I am very sociable and feel comfortable keeping any conversation but I don't like wasting words for no reason. I have a kind heart and open mind and most of all I enjoy meeting new people and seeing new places.\r\n\r\n  I plan to make my big dream come true pretty soon - to travel to the US by car. I love singing, I am the girl who steals all the prizes from karaoke competitions. I was invited to sing on a big scene but rejected because I believe that career of a singer is not compatible with the normal family life. My main goal in life is to become a part of happy and loving family. I also love sports, I play tennis. I take part in charity because I believe that helping others is a must for those who was blessed to have more. I believe in God but I am not fanatically religious, just know that He is me no matter where I go. I believe in fate and my intuition tells me that soon I will meet my half.",
