    "girls_info" => "I am a woman with a cheerful and tender soul. I am caring and always ready to help. I am an intelligent and charming lady with deep green eyes. I have a strong character and I like to solve difficult questions. I'm a woman with inner strength.\r\n\r\nMy hobbies are sports and traveling. I sometimes dream to go somewhere to a hot tropical island and enjoy the sun. I enjoy reading books and spending cosy evenings with my close people. I also like to go to museums. I adore finding out something new about the world, as it excites me. I like pets as they bring joy and fun to our life.",
