    "girls_info" => "My name is Olena and my character and personality seem to prove its beautiful and feminine sounding. I am a charming and joyful, very optimistic and communicative! I am a person who likes to study and explore different sides of life. I am curious though I am a grown up and a mature woman. I wish to learn, to find out more! I wonder if the search of the sense of life is the same that the search of your love! I am a doctor and work as a pediatrician!\r\n\r\nI like cooking and home is the warmest place to me, I can't understand people who neglect the care about it. \r\nSometimes there is nothing better for me than a nice calm walk in the park or next to the seaside, listening to the noise of the waves and feeling their salty breath in fresh air.",
    "girls_1st_letter_subj" => "Is your heart still free?",
    "girls_1st_letter" => "Hello!\r\n\r\nI hope I did not bother you? And your heart is still free?\r\n\r\nI want to destroy my loneliness and find a good man and I want to share with him the life together.\r\nI am who I am. In man the main thing is an individuality. Everyone should be individuality and then he achieves something in life.\r\n\r\nI always want something bigger than it is, and I aspire to it.\r\n\r\nWhen I was a kid, I really wanted to be a doctor. And I'm very happy that my dream has come true. At work I spend a lot of time with the kids, and I love everyone as my own!\r\n\r\nI can spend evenings having fun with friends, and can sit with a book in hands, but both do with ease and joy. \r\nWhat do I expect from men? A difficult question. Most of all, perhaps, comfort, warmth and reliability. When and whatever I was engaged, together or separately, brings mental satisfaction and peace of mind that he is, he was there. \r\n\r\nAs for my place of residence, I would very much like to live abroad with my beloved man. I have no restrictions on the age of my future partner, of course if he is not 20 years old ))\r\n\r\nI see my future family only happy. Because I want to give my husband care, warmth, comfort and love. I want to get the same from him. It's the only way to build a real family .\r\n\r\nI like to live in a comfortable environment, I know how and love to cook but never do worship of food, cleaning or shopping. To be oneself in the eyes of men is a difficult task. A man wants to see his ideal. But what is the ideal, and how he sees it, no one can explain. People need to complement each other. Happy couples tend to mutual understanding and partnership: they do not try to establish who is right and who is wrong. They are willing to compromise for the sake of peace and tranquility.\r\n\r\n Their fights never go out under the overall control and do not rise to insults. Everyone knows how to bring the other to a white heat, but never uses that forbidden technique. The main thing in a relationship is normal communication. For this there are three factors: the ability to listen to another correctness during disputes and absence of negative consequences in case of disagreement. They should not inhibit each other, do not force, do not specify - they should agree, because they are able to listen to each other.\r\n\r\nI am not looking for a Prince on a white horse, but, probably, reliability, mutual understanding, respect and decency in a man wants to find every woman.\r\nIf you liked what I have told you and you want to get to know me, just write me, and maybe I will be the one you have been looking for.\r\n\r\nWhat do you like to read?\r\n\r\nWhat are you favorite types of music?\r\n\r\nHow do you like to spend your free time?\r\n\r\nWhat types of food do you enjoy?\r\n\r\nDo you like cooking?\r\n \r\nHOPE to see your answer \r\n\r\nYour,  \r\nOlena",
