    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am happy to welcome you in my profile. I am a loyal woman, in a search of my reliable man. Unfortunately, I was not lucky in love. But I have a little daughter who is the center of my universe now. My heart is not occupied, I am very serious here and are looking for a husband and for a father for my daughter. I dream to meet the man who loves children and who is not scared to take responsibility. I am a very positive, open-minded and active person. I like to lead an active and healthy lifestyle, outdoor activities and sport in general. Also nature, picnics, going to the movies and listening to music.",
    "girls_1st_letter_subj" => "Real love finds you once, if you're lucky",
    "girls_1st_letter" => "I believe in love, and in the union of souls. Like every woman I just want my love to find me as soon as possible and to be happy. That is why I am here. I am a loving mother and I am sure I will be a good loving and caring wife, because I can love and care. I do not demand much. I am not looking for a prince. And I am not trying to escape from my previous relationship or to try to forget someone. No. I am single, with a free heart and 100% ready for new relationship with a kind, reliable and smart man. I want to have a complete family, with the kids, where the atmosphere is good, positive, where the people want to spend time with each other, respect and do their best to make their family happy. And I am ready to do my best in this case. And you?\r\nWaiting for your reply,\r\nLudmila",
