    "girls_english_proficiency" => "some",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very optimistic, positive and active. I have diverse interests and I don't wish to stop on what  have already achieved. I am romantic and I believe in love between a man and a woman, I believe in sincere and unconditional love, that gives you wings and makes you smile all the time. I hope to fall in love again soon.\r\nI am a big fan of sports, I like tourism and hiking. I like going to the mountains and spending time near the sea. I love reading and I also listen to audio books. I like theaters, cinemas and travelling. I like snowboarding, too. Cooking is another hobby for me, I like to cook dishes of different cuisines. \r\nI am looking for a man with whom I will be able to share my hobbies, interests and of course from whom I will learn something new and who wishes to learn new from me. I hope my future partner to be caring, attentive and tender. I do hope that my chosen one will not have any harmful habits like smoking or excessive drinking of alcohol.",
    "girls_1st_letter_subj" => "I am ready to meet my destiny!",
    "girls_1st_letter" => "Good afternoon, my name is Natalie. I live in Ukraine in the city of Zaporozhye. I was born here, studied at school and at university. I have an older brother, he lives with his family in Moscow. I do not have any pets. I work as a chief accountant in an enterprise. The work is quite scrupulous and requires attention and perseverance, so I devote my free time to the most diverse activities possible. Hiking and walking, gym, playing tennis, volleyball, swimming, skating, snowboarding, hiking in the Carpathian mountains, the Caucasus, Mont Blanc and sea travels. In the long winter evenings I like to embroider a little or make crafts from clay and wood. My latest hobby is Argentine tango, which I have been practicing for two years and which brings me pleasure. I have an adult daughter, she is in mid-thirties. She is married. My wonderful granddaughter Margaret is a school girl. They live separately in their home. Of course, Iâ€™m happy to spend some time with the children and Margo, we plant flowers and take care of the trees in the garden. We grill meat and cook pilaf. I can and I like to cook homemade food - every time I return from a trip I find recipes (canola, fondue, lasagna, Georgian pies, Transcarpathian pancakes) and cook it for family and friends. But I still give preference to vegetables and fish.\r\nI live alone in an apartment (my parents died) and in the morning when I get ready for work, I listen to jazz or rock - it is uplifting my spirits. I'm interested in listening to audiobooks too. Now I'm listening to Lloyd John, Mitchinson John - The Book of Universal Misconceptions. It is interesting and comprehensive, but there is so much appealing information in the book that it is impossible to remember everything. I think I will need to listen to it twice.\r\nI like to listen to classical music in the evening, in silence, concentrating on the sound of the orchestra. Theatrical performances, operas and operettas are all very interesting and important to me. If I am in Kiev, then I definitely plan to visit the theater, because in our city, unfortunately, the level of theatrical skill is not high enough. There are many interesting films that impressed me. It all depends on the mood - it is either a comedy or a drama. Sometimes a disaster movie, sometimes even horror movies))) All that gets in the TOP 10 can be watched)) \"Fear and Loathing in Las Vegas\", \"Bridges of Maddison County\" psychedelic movies and films of old masters. There are a lot of good films. And yet, I would like to come to the theater or watch a movie with a man, with whom you can exchange impressions, share emotions and thoughts, philosophize a little - this is one of the reasons why I turned to the agency.\r\nI was married, but we broke up two years ago. It is difficult to identify the reason of the divorce in one word - perhaps love has faded and each of us had to go further on their own way. But I am full of energy and love to give, and I will be looking forward to your reply.\r\nWarmly,\r\nNatalie",
