    "girls_1st_letter_subj" => "Love is like the sea",
    "girls_1st_letter" => "Love is like the sea. It's a moving thing, but still and all, it takes its shape from the shore it meets, and it's different with every shore. It's a very brave thing to fall in love. You have to be willing to trust somebody else with your whole being, and that's very difficult, really difficult and very brave. Everyone says love hurts, but that is not true. Loneliness hurts. Rejection hurts. Losing someone hurts. Envy hurts. Everyone gets these things confused with love, but in reality love is the only thing in this world that covers up all pain and makes someone feel wonderful again. Love is the only thing in this world that does not hurt.\r\nDo you agree with it? It would be interesting to hear your opinion regarding it.\r\nWaiting for your reply,\r\nTayana",
