    "girls_info" => "I have always my life position and my own opinion in life. I think that a person must always learn and find out something new in his or her life and develop her or his inner world and enrich her knowledge.\r\nI am interested in fitness and cooking, I can bake very tasty cakes with all kinds of ingredients, would you like to try?\r\nLooking for a man with a kind and good heart, a man who is caring, communicative and generous.",
    "girls_1st_letter_subj" => "Are you in a search?",
    "girls_1st_letter" => "I am here in a hope to meet a good man and hope this site will help me to know you better and to find my man.\r\n\r\nI am tired of being alone and I hope to find a good man, who, likes me, wants to share with me the joy of living together and happy family. What about you? Are you tired to be alone?\r\n\r\nI am living and working in Vinnitsa city, it is close to Kiev, 250 kilometers from the capital of Ukraine. I am a loving, responsible, kind, faithful and family oriented woman. I have principles and I appreciate family values. I like active rest, riding a bike, swimming, going to the forest. I want to live a long and happy life with my loved one.\r\n\r\nI want to find a positive, large-hearted and family-oriented man. Trust and mutual respect are the very important things in relations. Happy couples seeking mutual understanding and partnership: they do not try to determine who is right and who is wrong. I want to have a man in my life with whom we have this mutual understanding. A man who will accept me like I am and I will accept him like he is.\r\n\r\nIf you like what I told you, and you want to get to know me better, just write me, and maybe I would be the one you've been looking for.\r\n\r\nI am waiting for your letter.\r\n\r\nWith the best wishes,\r\nJuliya",
