    "girls_info" => "I am ambitious and funny, constantly smiling and love joking! Friends say I'm an easy-going and a creative person. I always keep my word and I do believe in Love! Life without love is like a year without summer!\r\nI am looking for a strong and positive man, with whom I would feel like in the same boat! He must be reliable, caring, and loving as we walk through the rest of our lives side by side, hand in hand, passionately looking at each other's eyes!",
    "girls_1st_letter_subj" => "A simple woman...",
    "girls_1st_letter" => "I am a simple lady from Ukraine. Like any woman I want to be happy and for me this is when you completely live in harmony in everything. When I have harmony at work, at home and with my family this what I want to have in life. \r\n\r\nAll I miss is a harmony in family life. All I need is to find a man who will be with me in bad and good times, who will be himself, and I have to feel comfort and easy with him. I want to have a man who will be a husband to me and a good friend to my child. I hope you don't mind that I have a child, do you like children? \r\n\r\nI had bitter experience marrying a Ukrainian man, I felt lack of attention to me, so, I picked my things and went away. But life goes on and I don't want to give up. \r\n\r\nWhen I have free time, I like to spend it together with my family, child and friends, we walk to the green park, can play, swim, run, have fun together. What do you like to do when you have free time? What can you tell me about your life? \r\n\r\nI will be glad to get a letter from you to get to know you better. \r\n\r\nWith the best greetings, \r\nNadia",
