    "girls_1st_letter" => "Hi,I hope to find out more about you. \r\n\r\nI hope that one day I will find my happiness and will become the happiest person in the world. For me, happiness means to have harmony in everything -  at work, at home, and with my family. \r\n\r\nI am thankful to my parents that I live in modern world and have an opportunity to use the Internet and to find you, my man. \r\nI think that love is not enough for relations, the main thing is to know how to carry it and save it. \r\nWhat do you think ? \r\nI think that first must be friendship, respect, mutual understanding and when is something missing everything can be ruined. \r\nI  I work as a travel agent in travel company that offer all kinds of countries to visit and travel. \r\nCan you tell me more about your job? \r\nI am tired of lonely and sad nights. I am tired to come back to an empty house and feel emptiness inside, because I know that nobody is waiting for me. \r\n\r\nI want to live; I want to please someone with my cooking, with my care, and with my love. I want to rush to my house and to my husband, after my work. I want to feel that I am needed to my man and he needs me. \r\n\r\nWhat do you want? Write me and I will reply to you immediately.\r\n\r\nSincerely,\r\nJuliya",
