    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I know exactly what I want from life. My friends say that I am the soul of a company. I like people with humor. I do not panic in difficult situations. Life is a game and we are all actors. I love my job, I spend most of my time there. In free time I like to meet with my friends, go to a Cafes with them. Also I like nature, good books. I am determined and always reach my aims and the only aim for me now is to create a family and feel happy.\r\nI dream to meet man of my life. I don't have definite ideal, but I think he must be confident, caring, with good sense of humor, generous. With whom I will feel comfortable, with whom I can talk about everything. I dream about family with children. I would like to spend time together, traveling and just having a good laugh. Being open and family-oriented is crucial for me. I am waiting for you in my life.",
    "girls_1st_letter_subj" => "It is a pleasure for me!",
    "girls_1st_letter" => "It is a pleasure for me to write this letter, thank you for finding time to read it. \r\nThere is a saying that inner beauty is more important then our natural beauty that you can see with eyes. Do you agree with this saying? \r\nWhat is really important for you in a woman, her heart, soul, character or only her appearance and her figure? \r\n For me a man's appearance, age, where he lives, his social status do not really matter, all what is important is to have total understanding and harmony in relations with my man. No matter for me, distance, age, nationality, location, all what is important is to be a human and have a good heart and treatment to his woman. \r\nAt the moment I am working as a manager in a sales company, my task is to deal with all paperwork and to sell as much goods as possible, there is a plan for each month how much I need to promote, so this is what I am doing. \r\nI like my job, do you like yours?\r\nIn my free time I like to go outside, to go for a walk, to enjoy fresh air,  nature, when have opportunity to travel, to see picturesque views, what do you like to do when you have free time ? \r\nI am here cause  I saw an advertisement about this agency in Internet and while I am still single and have no man, so I decided why not to try, so here I am on this website, why did you decide to use agency? \r\nIt will be nice to know more about you. \r\n Regards, \r\nTatyana",
