    "girls_other_languages" => "",
    "girls_info" => "I am a family-oriented woman looking for a soul mate to share my life with. I am dynamic and optimistic, dreaming of having a family. I would like my family to be strong and friendly. I adore cooking, sport, dancing and spending my free time with my son. I am a caring and thoughtful mother and would like to a loving wife.\r\nI am into cooking and fishing. I have a great pleasure when I rest in the nature and take photographs. Photography is my thing.\r\nMy partner needs to be positive, reliable, romantic and always ready for sharing love and happy moments. We can travel together, cook or enjoy happy moments making picnics, grilling or just swimming or sunbathing.",
    "girls_1st_letter_subj" => "What do I want?",
    "girls_1st_letter" => "My greatest dream is to find my soul mate and my heart tells me that I am going to find him on this site. If you are looking for someone tender and feminine, charming and unpredictable, caring and responsible then you will find all these qualities in me)\r\n\r\nIn every day life I am the most positive and smiling person in the world and humor plays a very important role in my life, because without laughter we would turn into boring and banal people. \r\n\r\nI prefer following my instincts, but you will never notice anything light-minded in my behavior. Discovering my hobbies and passions you will understand that I am a very creative person who is ready for innovations and challenges. I love drawing and my friends tell that my pictures reflect my inner world... Sometimes childish and innocent, but you can also notice my maturity, pain and wisdom looking at those images. \r\n\r\nI am sure that every man wants to know what his woman really expects from their relationship and from life in general. This question is simple and at the same time difficult. It is simple because every woman needs love and attention, but it is complicated, because every woman needs different amount of love and attention. Someone loves to be in the center of attention and some women can be happy only devoting themselves completely to their families. \r\n\r\nWhat do I want? My answer may seem strange for you, but I need my man... A real man with his past, present and dreams for future, with his mistakes and disappointments, stubbornness and sometimes laziness, tiredness and weakness, which I can heal with my loving heart and soul. I do not want  him to change! I know that every person possesses good and bad qualities, but I do not understand why so many people (almost everyone) try to hide their weak points. In my opinion people fall in love with imperfections, because they make us so special and unique. Do you agree with me? \r\n\r\nI hope to get your answer...\r\n\r\nYours, Alena",
