    "girls_info" => "It is easy for me to adopt to a new life atmosphere and new situations in life. I am flexible, easy going and ready for great changes in life.\r\nI want to find a strong willed man, who is not afraid any obstacles in his daily life and in his family life. A man who believes in a saying when there is a will there is the way. A man who does not give up easy and always finds the way how to reach his goal.",
