    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a serious lady, eager to start the strong, meaningful and long-term relationship, which will turn into the friendly and happy family. I have multiple interests, so that my life partner will never get bored with me. I am passionate about life, I am impressed about people and things, and I would really like to share all emotions with someone special.\r\nI love both, being at home and outdoors. I am fond of arts, crafts, interior design and some kinds of needlework, so I always have a lot to do at home. Camping, concerts and wondering around the city are the things I love to do outdoors.\r\ndescription: I am not looking for a prince on a white horse. I am just looking for an ordinary man who believes in love and has family values. He is sincere in his feelings to me and is ready to enjoy life.",
    "girls_1st_letter_subj" => "No perfect people, agree?",
    "girls_1st_letter" => "There are no perfect people in this world. I think that we must appreciate what life gives us every day and even if sometimes our rainbow consists of black and white stripes we must keep trying to make it colorful. Everything depends on us. Do you agree with me?\r\n\r\nFor that reason, I decided to try my luck abroad. Many my friends found their soul mates abroad and now they are so happy together. I am a good mother and very proud of my son. I am sure that we both deserve for happiness. \r\n\r\nAt the moment I keep trying to find a job as the work as an economist quiet popular in my city, so not so easy to find a vacant place:( \r\n\r\nI hope you don't mind that I have a son as he is a part of my life. Which thing in life can make you feel happy? \r\n\r\nItâ€™s easy to find the common language with me. I am a cheerful and active lady. I am extravert. I adore socializing with my friends. I am very curious about everything, so, I try to develop myself in different directions and learn new things. \r\n\r\nI am looking for a man who will understand me in everything! Who will value me as a woman. He should be ready to create a family. I am looking for a serious, kind, passionate decent man with a open heart for new relations.\r\n\r\nBest regards, Nataliya",
