    "girls_info" => "It is very hard for me to describe myself, as a person I don't like to make conflicts, but sometimes I can be stubborn and naughty. I like to be joy and by nature I am kind and always try to be happy. I want to give and get.\r\nI like to go out for a walk, to read books, I like to make decorations from beads.\r\nI am a good mother, a good cook, a good housewife. I am hard working person, I know how hard life can be.\r\nI want to meet a man who will accept me who I am and will understand me and feel me. A man who will respect me.\r\nA man who will accept me with my children. I am a single mother and I know how to care, to love, but I miss a man whom I can give my love, care, attention. Though I am young I have life experience and I am here not to play games, I am here only with serious intentions, to meet a man who will be with me for the rest of my life.",
