    "girls_1st_letter_subj" => "Open my letter, please!",
    "girls_1st_letter" => "You could probably ask me:\" Why are you looking for a foreigner?\" And I would answer: \"I'm simply looking for my Mr. Right and who knows, maybe he isn't Ukrainian\". \r\n\r\nMy name is Olga, and I live in a nice, cozy and quiet Ukrainian city of Vinnitsa, in one of the most comfortable accommodations among Ukrainian cities. I decided to go to the international dating agency with foreigners, because I want to find a true mate, lover and soul mate. I am not married and have never been, and have no children. I do not smoke, I drink occasionally in companies or for the holidays, do not do drugs, I lead a healthy way of life. I am a lawyer by profession and work in the specialty. I am financially stable, I have my own accommodation.\r\n\r\nI love animals, especially cats, I have a cat of the Scottish breed Tessa. My hobbies - music, movies, reading books, tourism, animals, embroidery, computer graphics. I like to watch football and figure skating, I love to swim.\r\n\r\nIn my spare time, I like to cook all sorts of food. I love nature and sea, and I cannot imagine my life without these two things.\r\n\r\nIn life I'm a romantic, an idealist and a little dreamer. Of great importance for me is to have a family and family values â€‹â€‹and traditions. I cannot imagine living alone, living without a loved one, family and children. But at the same time, I'm a person of independent, strong-willed, I'm a workaholic, diligent, assiduous, stubborn in achieving my goals. I like cleanliness, order and comfort, I like to create it myself around people close to me.\r\n\r\nMy zodiac sign is Libra under the influence of the planet Venus, this is due to my desire of equilibrium, harmony, order and beauty. By nature I am impressionable, sensitive, vulnerable, receptive to everything beautiful. I value sincere love, friendship and communication.\r\n\r\nMy goal now - to find a loved one and have a family. I'm looking for a man of independent, responsible, able to handle family life with a good sense of humor.\r\n\r\nMy favorite colors - blue, green.\r\nFavorite Food: Ukrainian, Italian and Mexican cuisine.\r\nFavourite music: rock, pop, classical music.\r\nFavorite writers: Victor Hugo, JRR Tolkien, George Martin, Leo Tolstoy, Charles Dickens.\r\nFavorite book - \"Les Miserables\" by Victor Hugo, \"David Copperfield\" by Charles Dickens, \"La Dame aux Camelias\" by Alexandre Dumas (son), \"War and Peace\" by Leo Tolstoy, the trilogy \"Lord of the Rings\" and \"The Silmarillion\" JRR Tolkien book series \"A Song of ice and fire\" by George Martin.\r\nFavorite Movies: Lord of the Rings, Pan's Labyrinth, Star Wars, The Theory of Everything, Â«VÂ» Vendetta, The Patriot.\r\n\r\nWhat about your goals, which colors are your favorite? \r\nWhich movies do you like to watch? \r\nWhat about books? Maybe you have some more things that can make you happy in your life? \r\n\r\nI will be glad for your answer.\r\n\r\nSincerely, Olga",
