    "girls_info" => "I like gardening, flowers, nature, was raised in the village and love to be outside the city, camping is also nice.\r\nA woman with a soft character, who knows how to make compromises in relations and prefers to solve some conflict in a peaceful way without shouting.\r\nLooking for a man with whom I will feel harmony in every daily life, age does not matter much, the most important for me is treatment and mutual understanding.",
