    "girls_1st_letter" => "Hi, I believe in miracle and do you believe in it? \r\nI love children and work as a nanny. It is so nice to see how they smile, make you feel happy, laugh and play with them. I will be happy to have a nice family life and my own children. Are you ready for family life? \r\n\r\nI hope that I can meet here my love, experience true feelings and further build serious relations. \r\n\r\nMy main hobby is gardening and I also like horses. Do you have a hobby?\r\nI prefer to go to work or to do some gardening rather then to hang out with friends, I feel mature and ready for family life.\r\n\r\nI love to cook the Ukrainian dishes. I lead a healthy lifestyle, and what about you? \r\n\r\nPlease, write what you are looking for in a woman here and what are your intentions? Probably you get many emails a day from beautiful girls, but I hope that I can interest you and you will be able to get something with me that you have been looking for so long. \r\n\r\nOf course, I hope that very soon you'll write to me about yourself and we will start this way in the ocean of love and passion. I am waiting impatiently for your reply!\r\n\r\nSincerely, \r\nLiudmila",
