    "girls_other_languages" => "German fluent",
    "girls_info" => "A loyal, hard working woman who is family-oriented. A woman with a big heart in which there is a place for love, care and understanding. I want to give my love, care to a man who is ready to accept it. I like to be positive in my life and try always to find the beauty in every moment of my life. It will be super to share all happy moments together with my partner and enjoy life together.\r\nI like to develop my language skills and to teach kids foreign languages, so nice when I see them happier, it gives better future in their career, I like all kind of sport activities, cinema, nature, architecture, seaside, reading, music, cooking.\r\nJust a man with a good heart. A simple man who knows how to value every second of life and who is happy to create and be together with his family.\r\nI would like to find a good family-oriented man, the captain of the family boat. I will be happy to give him all my trust knowing that with this captain we will have the best voyage on the sea of Life.\r\nI do hope my man is waiting for me and I believe that this site will help me.",
    "girls_1st_letter_subj" => "Ready for new page in my book",
    "girls_1st_letter" => "I would like to tell you a little about myself. My name is Margarita. \r\n\r\nI live in Kiev, a capital of Ukraine. I am a teacher of German and I like kids and enjoy working with them. I would like to be a sunshine that makes other little hearts happy and reflect love and smiles. I find my work creative and interesting and good results are rewarding for me. When I was a little girl I put all my dolls and toys together and acted like I am a teacher and they were my students and it was my dram to become a teacher. So, now I am so happy that my childhood dream become real, did you have any dreams when you were a child? do you still remember some nice moments from your childhood? \r\n\r\nI am divorced and have a son. His name is Gregoriy. I love him and do my best to make him happy in his life. Moreover I would like him to feel loved and have a full family like any other kids have, with a mother and a father. Not only a good friend for him, but also a good husband for me to have a strong family with. The atmosphere of happiness is very important for me and for kids in general. That is why I am here on this site. \r\n\r\nI also dream to have harmony in relations and I know that people can not be ideal, I will accept my partner with all his minuses and bonuses. \r\n\r\nI am open to meet a man who wants the same thing, love, family, romance. I would like my partner to be sincere and open to any changes in life. I think if we are able to find a compromise in difficult situations, we will work out and have strong relationships and a nice friendly happy family. \r\n\r\nI am waiting for you, my man, with hope in my heart. \r\n\r\nBest Wishes, \r\nMargarita",
