    "girls_info" => "I am very calm, peaceful, kind-hearted woman. I am creative by nature ,simple woman that wants to find a simple man to create a harmony in family life. I like to live in harmony and to be positive in any situation.\r\nI am fond of music, like to listen to good songs and also I can sing songs and play the piano. I like to visit exhibitions, theaters, fashion weeks, teach children how to play the piano. Enjoy art,reading books.\r\nI want to find a simple normal man who leads simple normal daily life, when has vacation time would like to travel somewhere together with his partner, to go out for a walk in the park, maybe to go to the cinema or to visit some nice concert, a man with a good sense of humor and charming smile. A man who likes to lead healthy and active life.\r\nI want to have a man with whom I can talk about everything and feel comfortable.",
    "girls_1st_letter_subj" => "I am a simple woman",
    "girls_1st_letter" => "It is hard to start first letter to you, but I want to attract your attention to my profile.\r\n\r\nI am a simple woman who wants to be happy and find her partner and second half that I miss in my life. \r\nI have come here with a clear mind and serious intentions as many my friends meet with the help of the agency their husbands.\r\n\r\nI am a single woman, have no children, but love children very much and will be happy to accept your children if you have.\r\n\r\nMy job is connected with children, I am a teacher of music, I play the piano and teach children to play this instrument. I also will be happy to have my own children if it is okay for you? \r\n\r\nWhen I have free time I like to sing songs and my friends enjoy my singing. Maybe one day if you like I can sing for you? :) \r\n\r\nI like nature, walking, picnics, seaside and nice relax near the beach. In spring I like to go to the forest to gather strawberries and bake tasty cake from it, in autumn I like to gather mushrooms in the forest and cook mushroom soup, also I like to cook Ukrainian borsch, would you like to try one day Ukrainian food? What food do you like to eat? How do you like to spend your free time? Tell me, why are you here?\r\n\r\nWaiting for news from you.\r\n\r\nTender greetings, Ekaterina",
