    "girls_info" => "I am very communicative, hard-working , creative and initiative person. I have my own principles, I am alway tidy and careful. I like music, choreography, active rest and reading books.\r\nI have creative mind and always can see some interesting details for clothes, I create with my hands clothes with the help of knitting it is my passion and also I teach other women how to do knitting. I use every free minute for my hobby.\r\nI want to find a man who will respect a woman in any life situations, who is loving kids with high moral qualities with active lifestyle who is willing to develop in any life spheres.\r\nWho is not afraid to be responsible for his words and actions. I want a man who can support me and my kids and with whom I can feel totally protected, relax and like a real lady. I am looking for harmony in relations.",
    "girls_1st_letter_subj" => "How are you?",
    "girls_1st_letter" => "Hello, my dear:)\r\nPlease write me more about you in your letter to me. \r\nAs for me I live together with my kids in a small house not far from the central part of Vinnitsa city, do you know my city? \r\nHave you ever been in Ukraine? \r\nI am here with hope to find a good man for me and a good friend for my kids. I am so tired of being lonely and what about you? \r\nI am alone about 3 years and how long have you been alone?:) \r\nHow is your weekend? \r\nAre you religious? I go to the church only on big holidays. \r\nI hope to get a letter from you soon,\r\nHave a super day. \r\nIrina",
