    "girls_other_languages" => "",
    "girls_info" => "I am reliable, responsible and faithful. You will feel loved and understood and I will support your great ideas and inspire you for the best. I love Music, Art, reading, IT technologies, gardening, home decor. I love walking through the park or forest. Nature is my passion. Sometimes I like drawing or playing the piano. Meditation is a good way to relax for me and think about something nice. I would like my man to see me as a woman he has been looking for all his life.\r\nI am looking for a soul mate to share our lives and create a family which will be the unit of love and happiness.\r\nI would like my partner to be open and ready to take the responsibility into his hands and feel happy and share this happiness and love with me. I would like us to be a romantic and loving couple. My man should be honest, sincere, trustworthy, passionate and friendly and all this is called love.",
    "girls_1st_letter_subj" => "No matter where you now.",
    "girls_1st_letter" => "No matter where are you now, how old you are and what time is now. The most important is the right timing and the right moment :)\r\n\r\nI hope I've chosen the right moment for writing this first letter to you, I think it is not so nice to show my attention first, but I could not stop myself and decided to write. Please, have a look at my profile and maybe you have some additional questions to me, with great pleasure I will reply. \r\n\r\nI found this website by accident and I believe that accidents happening in life for some reason. I hope this website will bring me luck and I can find my soul mate, a man with whom I can feel myself and not to think if I correctly behave if I say something wrong, just want him accept me like I am and I will accept him like he is. The most important is to feel harmony and chemistry between each other, what do you think?\r\n\r\nI like art, design, can play the piano, can go to the classic concerts, I love all kinds of music except hard rock and heavy metal. Do you like music? Do you have any special interests? \r\n\r\nMy job is in IT company working as a soft developer, I can speak fluently English and hope it will help me in my search. So it will be easy for me to communicate with my partner if he speaks English.\r\n\r\nI hope to get the reply from you. \r\n\r\nWith the best greetings from Ukraine, Svetlana",
