    "girls_info" => "I am loyal and caring person. I believe in giving to the community and helping others. That's how I would describe myself. However, my family and friends would describe me as spunky, energetic, outgoing and very, very sweet. I am not too sure about the spunky part! But they are family and friends, so they know better, right? I am easy, calm person. I like taking care of close people. I am looking for love and I hope I will find it here.\r\nI am looking for gentle, kind, generous man. Who can be a good friend, husband and father. With whom we can spend calm and happy life together. I would like to meet a man who is gentle and kind yet has inner strength and a passion for life, who likes simple things in life, like long walks holding hands, laughing together. Someone who like to be loved and who wants to share good life, hopes and dreams with me.",
    "girls_1st_letter_subj" => "I am here to try",
    "girls_1st_letter" => "It happened so in my life that I met by accident my classmate in the street and she told me that she is living now in Germany, successfully married and has a happy and harmonic life with her husband in Germany, so she advised me to register on this website. \r\n\r\nSo here I am writing to you. I have good English skills and I teach other people how to speak, to write, to read in English language. Maybe I can also try to teach my man Russian, would you like to know and speak some Russian words? \r\n\r\nI have strict boss at school where I am working and I have to wear always nice official clothes and be the best example for all kids, I am by nature modest person, I like to wear official clothes and of course for a special occasion I like to wear nice cocktail dress and high heels, do you like when a woman wears cocktail dress and high heels? Which clothes do you like to wear? \r\n\r\nI am here to find a man who will treat me with care, respect and understanding, who will help me to carry heavy things that I can feel next to him a wick woman who needs man's help. I want to feel that I have a strong man next to me and be proud of my man that he helps me and his does male things, I still have more ideas of old fashioned style life family where is the man is a boss and a woman follows his man, what do you think about this style of life? \r\n\r\nWhen I have free time, I like to do something creative with my kid, to be active, to find some nice places to visit, to go to the zoo, entertainment park, some nice festivals for kids. \r\n\r\nI think it is important to find and spend time with your kid, what do you think about this? Will you accept the fact that I need to pay attention not only to my man, but also to my kid? \r\nI count on your understanding. \r\n\r\nHope you have a super great mood today!\r\n\r\nGreetings from Ukraine, \r\nAngelika",
