    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "In general I am a very calm and kind person, always try to be patient, but sometimes I can say what I think if have no power to stand. I am kind-hearted person and always listen to other people,but also have my own opinion. I like cars and new technologies. In my free time I like to visit cinema, theater, concerts, spend time with my friends and cook some tasty dish for my closed people. I like to be active and fit.\r\nI want to meet a man without bad habits, calm and intelligent. I would like him to have a good sense of humor and be an interesting personality. A man who will be a strong support for me and our family. Who is caring and generous. And of course I dream about strong and happy family with children. I dream to show a beautiful world for our children. I want to wake up and be thankful for my happiness.",
    "girls_1st_letter_subj" => "No idea from what to start",
    "girls_1st_letter" => "I have no idea how to write first letters to a man, by nature I am very modest and serious woman, I prefer to be a good listener rather then speaker. Would you like more to speak or to listen? \r\n\r\nI've heard from my friend that there is one nice agency which I can use and try my luck. So I am here. \r\n\r\nI live in a nice city Vinnitsa, Ukraine, but it happened so that in Ukraine by statistics for one man is about 6 women, so not every woman can be lucky finding a good man, I am still single, my heart is free, I am in active search, maybe here is my man waiting for me. Who knows? Only if I try I can find out. So I am trying with writing this first letter to you. I hope you can pay attention to my profile and feel some contact and write back to me. \r\n\r\nI was born and raised in Vinnitsa, has one brother who has big passion for cars and works as a car instructor, so of course all my childhood all I heard were stories about cars and now I also have some ideas about cars, can drive a car and I like it very much, but at the moment I have no car in future I dream to have a car. Do you like to drive? Do you have a car? \r\n\r\nMaybe you have some special passion in your life? Can you write me about your passion in life? \r\nWhen I was a little girl maybe it can sound funny, but I liked to collect love stories from the chewing gum which was called 'Love is'. Do you know such brand of chewing gums? :) \r\nWhat is love for you? Do you believe that love exists or only in fairy tales? :) \r\nSometimes I believe in miracles, what about you? Are you superstitious? \r\n\r\nI dream to meet my king, I call my man king cause I will feel next to him like a queen, feel protected and secured and don't need to worry. I believe that man is responsible for feeding his family, what do you think about this idea? Are you a responsible man? \r\n\r\nI wish you a good day! \r\n\r\nSincerely, Inna",
