    "girls_other_languages" => "",
    "girls_info" => "I am a family-oriented woman and don`t like playing games. Family is the only priority for me now. I am dreaming of it and ready to do my best to make my man and my daughter happy. I am self-confident, not silly girl, who knows what she wants in life! At the same time I am very romantic! I like to spend my free time in the nature and it doesn't depend on the season: whether it is a hot summer, autumn or winter! Just during such moments you can enjoy fresh air and observe how beautiful the falling leaves are or enjoy the beauty when it is snowing!\r\nI would like to meet a man with whom I would have much in common.  He should be interesting, intelligent. He should be the man which I would like to follow anywhere in the world!\r\nI like reading of classical literature, newspapers and magazines. Also I like going to the cinema, visiting of different exhibitions, meeting with my friends. My favorite activities in my free time: traveling, aerobics, hiking, horse riding. I am looking for a partner I can share my hobbies and interests with.",
    "girls_1st_letter_subj" => "I want to hurry up home",
    "girls_1st_letter" => "It is nice to meet you here, on this website, I hope it means that you are looking for serious relations as I am here with this purpose. I was recommended to use this service by my friends and they were very happy with this website. So here I am writing to you :) \r\n\r\nI live and work in a nice Ukrainian city Vinnitsa, it is close to Kiev and if you like to fly you can even fly from Kiev to Vinnitsa, it takes only 30 minutes to fly and have a nice and romantic date with a blond woman with green eyes from Vinnitsa :) I think that real meeting is nicer than just photos and writing letters. Of course, first letters and exchanging photos are super great idea, but next step must be real meeting, how do you think?\r\n\r\nBy nature I am very passionate woman, I like to create romantic moments for my sweetheart, I like spontaneous surprises and like to please my man and do things that makes him feel happy. \r\n\r\nWhen I have free time from my work, I devote time to my daughter, Polina and go out with her and do a lot of activities, I like to be active with her, it keeps me fit and in a good shape. Hope its fine that I have a daughter? \r\n\r\nI like sports and try to use every opportunity to do sports, also love traveling, when have time. \r\n\r\nI work as a lawyer and I love my job very much, for me it is like my passion. It is so great when you love to get up every day at 7 am and visit your working place with a smile in your heart. Do you like your profession? Do you have free time to create new relations? \r\n\r\nI will be happy to know you better and move on step by step, what about you? \r\n\r\nI hope to hear from you soon.\r\n\r\nSincerely,  Victoria",
