    "girls_info" => "I adore to read books, to meet with my friends, people, I like when people visit me. I adore all kinds of sports( skiing, swimming, mountains, hiking and so on) \r\nI am an easy-going person and a person with balance in my emotions:) I \r\nhate and try to avoid conflict, always easy with me to find \r\ncompromises, friendly and responsible person.\r\nLooking for a man who is tidy and likes to work, to have sometimes fun, to make jokes sometimes, a man who will know how to treat and take care of his woman. A man with whom it will not be hard to jump out of the bed and start an interesting adventure.",
    "girls_1st_letter_subj" => "I have a good heart",
    "girls_1st_letter" => "I have a good heart, I am a romantic woman, loyal, sincere woman. My personality is quiet, stable, introspective, calm, honest. My dream to have a loving family. I am willing to travel across any sea to find true love. I need to belong to one man in the deep blue sea of love I am loving and caring. Somebody was saying, that an ideal woman should be \"like a chef in the kitchen, a lady in the society, and loving in bed\". I agree. I try that my glamour and femininity should reflect around my home in the street in the society. My life is happy, but the missing ingredient is the sharing of love with a true life's partner.",
