    "girls_english_proficiency" => "fluent",
    "girls_other_languages" => "German",
    "girls_info" => "I'm a kind, tender, sociable and sensitive person. I can be a good listener and I'm helpful and loyal to the people I care about. I like cooking when I have free time, it inspires and makes me happy. I am fond of traveling, swimming, dancing and I am always eager to discover and experience something new. I enjoy attending different concerts, going to the cinema and theater. Some people say I look like a small girl, but in fact I've got a strong character. I can't imagine my life without kids, so I have a huge desire to have my own children. I'm a teacher of English, I know the language won't be a problem for us.\r\nI want to meet a kind man, who is ready to create a family, have a child and be responsible for it. I need a loving, understanding, hard-working and generous man who can support me in any situations and be loyal and honest with me. Aristotle said â€œLove is composed of a single soul inhabiting two bodies. I immensely hope to find my soul mate and become a good wife to a caring man, the family that will be a unity. I would like to show the beauty of this world to my children, setting the example from our own family. I want to wake up every morning and be thankful to God for the amazing people I have and feel that I can make someone happy.",
    "girls_1st_letter_subj" => "Not a writer, but I will try..",
    "girls_1st_letter" => "I am very pleased to write you on this service. I decided to try my luck here, so better to try than just sit and waiting for something happening, do you agree with me? \r\n\r\nMaybe my letter will not be so long, I am not so good at writing them. I think I can start with my job. I work at state school, this year I had pupils of secondary and high school. The school I work at doesnâ€™t has any primary level. But I like working with children of different ages as well. Kids can be so hilarious when they are small. I like communicating with them a lot, they can make me happy straight away even when I donâ€™t have a good mood. Teenagers are cool too, we can speak about more serious topics and share various opinions, they can teach me different things too and I may get the newest information in the world too, they are so modern and technologically well-informed. How do I like my â€œkind of teaching? â€ Of course, my job can be difficult and tiring a lot. I have several pupils for tutoring too, sometimes I come home very tired. \r\n\r\nIn future, I would not like to work so much, and dedicate my time to my future family more and create a good cozy atmosphere at home. Have you ever tried Ukrainian food? It is very tasty! Can you cook yourself? I can cook and I like it, especially when I have some free time. My favourite is baking different deserts. Do you like sweets? \r\n\r\nTravelling makes me relaxed, excited and inspired. \r\n\r\nMy mum is a pensioner; she works in our garden lots of time. My father works in a building company; he is just a simple worker. I have a brother, one year elder than me. Do you have sisters, brothers? \r\n\r\nI am very romantic and understanding each other is very important for me too, having peaceful environment too. I am tender and I would like my husband to show feelings and be also gentle and kind to me. \r\n\r\nI wish you a wonderful day and would be waiting for a letter from you. \r\n\r\nBest regards, Alisa",
