    "girls_other_languages" => "",
    "girls_info" => "I think I am a goal-oriented and a responsible young woman. I know very well what I want from life and what am I worth of. My close friends say I am also a very optimistic person because I try to see everything good in life and successfully overcome all obstacles. I am very active - I like eastern dances, go in for sports, three times a week attend fitness classes but the biggest my hobby and at the same time my work - is cosmetology. I also like to have cozy evenings at home.\r\nI would like to meet a responsible and a serious man with whom I can feel mutual harmony and real affection. I dream of building serious relations and then strong and loving family with children. I have a lot of tenderness and warm feelings inside my soul and I want to give it to my man.It doesn't matter what country is he from,what language he speaks, the most important for me if he wants to be with me every second of his life!",
    "girls_1st_letter_subj" => "I believe..",
    "girls_1st_letter" => "My name is Aleksandra. I am writing you from Vinnytsa, this is a city that is not far from Kiev. It is the central part Ukraine!\r\n\r\nI am a woman who is looking for a good man. Let me write a short story about myself.\r\n\r\nI live in a two-room apartment. My parents live not far from me, partly on vacation or on weekend I can visit or meet with them.  I live in Vinnytsa, the population of the city is 400 000 people.\r\n\r\nI work as a consultant of cosmetics. In my spare time I like to meet with my friends to drink cappuccino in a cafe and talk. Sometimes I like to swim and spend time together with my sister. What do you like to do? Do you have a sister or a brother ?\r\n\r\nPlease, write me and I will answer you.\r\n\r\nSincerely, Aleksandra",
