    "girls_other_languages" => "",
    "girls_info" => "I am active and open, easy going and can easy find common language, do not like fights, I believe you can always find solution with a smile. I am family oriented person and ready for family life.\r\nI am here with serious intentions, all is important for me is to live in harmony every day. I like to wake up every day with a smile on my face and be happy just enjoying life, I like to see when other people smile and make other people happy.\r\nA man with whom I will feel harmony in everything. Age difference does not matter much, the age is only numbers, I am looking for a man who is not afraid to be responsible for his actions and his words, a man who does not only say nice words, but also does what he says. I am looking for a family-oriented man and a man who is ready to have a real date. I am not interested only in correspondence. If a man can not visit me in my country I am ready to visit my man.",
    "girls_1st_letter_subj" => "Are you tired to be alone?",
    "girls_1st_letter" => "I am tired to be alone and are you tired to be alone? \r\n\r\nIt happened so in my life that I am single now, I had bad luck with Ukrainian men and many of my friends successfully married and live now in another county with men from other countries, so I have a feeling that I can be happy too and here I am trying my luck to find a man from another country. \r\n\r\nI do understand we can have cultural shock and cultural difference, I am not scared of any obstacles, I just want to feel love, care and feel harmony together with my man. I am ready for big change in my life for my spouse. \r\n\r\nAt the moment I live and work in Vinnitsa city, by profession I am an economist. I have a good heart and I am open and direct person, I will never hide the truth and I will always say directly what I want and explain why. My friends always say to me that I know what I want and I always get what I want. \r\n\r\nSome of my friends call me Nastia, but my full name is Anastasia. I like to be active, to be always in some actions, go out with friends and spend time with my family, I dream to share my free time with my man. I can imagine how nice it can be. \r\n\r\nHave you ever traveled in Ukraine? \r\n\r\nDo you like to drink tea or coffee in the mornings? As for me I like both:) \r\n\r\nHope to hear from you soon. \r\n\r\nSincerely, Anastasia",
