    "girls_info" => "I like to spend my free time with my family. But, unfortunately, I did not find the man of my dreams. Therefore, I am here. I am a woman who knows what a man needs to be the happiest on the earth. I am calm and kind, I am always sincere with people. I consider myself a happy person. I am a decent woman who is great for the perfect wife. I love sports, I often go to the gym, even when I'm not in the mood.\r\nI am looking for a man who will treat me with respect and love me with all my heart and soul. I want this person to decorate my loneliness and become a true friend for me! I want to feel safe next to my chosen one, want him to protect me and care. I hope to find the right person who will make my life better, and will do everything for this. I want to create with him our little world, full of trust, mutual understanding and love.",
    "girls_1st_letter_subj" => "Are you still in a search?",
    "girls_1st_letter" => "What can I say about me? I want to share my life with a real man.  I have a place in my heart only for one person! I know how to please a man and make him happy. I am very friendly and responsible. Lonely evenings I dream only about one thing, a man who can completely change my life! I am active and cheerful. I am a woman who can appreciate love, loyalty, emotions. There are many things in this life which I like! I like to make surprises to my other half. I love sport, reading books, being on the nature. I always remain a woman who is charming and seductive,  feminine and polite. I respect honesty and sincerity in people. I love life in all its ways. Let's start our happy life full of love and bright colors.",
