    "girls_alcohol" => "socially",
    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a hard-working and active lady, I am cheerful and life-loving! I like to be next to people who like to smile and laugh, who like humor. I can be serious, too, but I prefer to live with a smile on my face. Smile helps to make new acquaintances and helps in everyday life, too.\r\nI like cooking, taking care of the house, I like pets and kids, being outdoors and going to the seaside, or to the beach which is located in our city, by the Dnipro river. I like swimming, dancing and walking along the city streets. I like playing with children and going to picnics. \r\nI hope to find a man who is strong, he has his own ideas and power of his will. I hope him to be physically strong and simple too. My future partner loves to laugh and can easily make me smile, he has a good sense of humor. My man is a Real Man by all means, he knows how to love a woman and can accept her love, too.",
    "girls_1st_letter_subj" => "Miss Joy!",
    "girls_1st_letter" => "My name is Olga, but this is my real name by passport, since childhood and everywhere people address to me as Lelya. I live together with my father in a big private house. My father is a pensioner, he is leading an active lifestyle likes gardening and currently he is working in Poland. We have a big garden near the house with beautiful roses and decorating fir-trees. We are very hospitable people and often enough we are inviting our friends to come and visit, we cook BBQ fish and meat, mushrooms and vegetables on the grill.  We have two pets, they are German Shepherds Queen and Mira, we like them very much and also we are keeping pigeons â€“ this is another hobby. \r\nMy mom died in a car accident sixteen years ago and my brother also died in a car accident eleven years ago. My father is only close and dear person to me. I work as a housekeeper for two families, taking care of their household and I enjoy this job very much. Since childhood I used to take care of the household, because my parents often went on business trips and I remained at home. I love cooking, making the place where I live cozy and comfortable.\r\nI was married but only for five years, nine years ago I got divorced, when I discovered that he was involved with other women and was taking drugs.  I need a real, good hearted, reliable man by my side who is family oriented and loving, who will be ready to have true and long-lasting relationship with me. I was dating Ukrainian men but unfortunately none of them wished to take responsibilities about the future family and our relationship, thus I came to the point of trying out internet dating and dream to meet a man who will make my life complete. \r\nI am a very sociable, jolly and open hearted person by nature, I love outdoors very much, hiking, camping, spending time in the nature, by water, I love long walks, sometimes I walk along the streets of my hometown together with my friends, we may go to cafeteria or visit dancing club, sometimes I like to be in a noisy company and once in a while I am happy to be in quiet atmosphere.\r\nI love swimming and thus I go to the public swimming pool a few times a month to keep myself in good physical shape. I wonder if you believe in horoscopes and compatibility by star signs? I am not very much into horoscopes, but if you wish to know this information, then I will tell you that I am Gemini born in the year of Monkey, I am active and very lucrative for ideas, very communicative. \r\nI am very hardworking, loyal, giving, friendly and sincere woman by nature. I lead a healthy lifestyle and I have never done drugs or smokes, I can drink only socially or for special events. \r\nI do not really like eating sweets, my favorite food is sea-food, especially caviar and mussels.\r\nMy favorite flowers are chamomiles and tulips. My favorite book â€œAngelicaâ€ if you ask me what films do I like to watch? I think I would answer: comedies, melodramatic movies and thrillers, I am not a voracious cinema or theater-goer, since it is necessary to sit there for a long time))) \r\nWell, probably enough for the first letter, how do you feel? Would you like to continue our communication? I wait to get your message in return to mine and learn more about you too!\r\nWarmly Lelya",
