    "girls_info" => "A kind-hearted personality, always ready to help when somebody needs help and I can help, I always do my best, honest, hate lies, will never cheat and will always be faithful to my partner. The most favorite and adorable hobby I have is to make photos, I also can not imagine my life without activities, sport and listening to music. I am an open, frank woman. My friends say that I am a glamorous and interesting woman.\r\nI am looking for a man who knows what he wants, a man who is responsible for his words and not only talks, but also acts, a man who is not afraid of any obstacles in his life and will fight to be together with his love. I would like to meet a kind, tactful, educated man to love and marry. I am seeking for an open-minded and sincere man for a serious relationship. My dream is a strong, tender and kind man.",
    "girls_1st_letter_subj" => "Nice to live in a modern world!",
    "girls_1st_letter" => "It is nice to live in a modern world now and have this great opportunity to communicate, to meet and see and also hear people from another country. What do you think about this? \r\n\r\nMy name is Anzhela, I live in Vinnitsa city, it is a normal city for living with all you need for comfortable life: shops, parks, theatre, concert halls, night clubs, entertainment shopping malls. \r\n\r\nI am a positive and open person. My parents are the great example of a perfect family life and relations, I dream to have a man in my life like my father. He is always loyal to me and when there is a need, he can be strict and I respect him very much. I think the main basis for good relations is a respect, what do you think? \r\n\r\nI am a simple woman, like to enjoy life and to do simple things in life, like to go out with friends, to go for a walk, to travel. One of my hobbies is to make pictures of nature and other people, do you have any special hobbies? \r\n\r\nI love nature and love to be near the seaside, mountains, what do you love in your life? \r\nAt the moment I am working at school as a teacher of literature, I don t have kids and hope if one day miracle happens, I will be very happy if miracle does not happen and I do not have a chance to have a kid I will accept that too. But I still dream and hope that I do have a chance. \r\n\r\nIt will be a pleasure for me to get a letter from you. \r\n\r\nIf you find something personal and touching for you in my profile, write to me. \r\n\r\nI wish you have a nice day!\r\n\r\nSincerely, Anzhela",
