    "girls_info" => "I would just say that I'm an honest person, decent friend. I try to be happy all the time and find at least something good in everything. I like to cook, because any dish cooked with love is a masterpiece! I am brave enough and devoted. I am sociable, well educated, intelligent and I have many interests. I like simple things in life: family, loving husband and good work. I believe that our thoughts materialize.\r\nI am looking for a real man. I am looking for a kind, honest and serious man, whom I can do even happier. I want to meet a cheerful, caring and passionate person. The sense of humor of a man is the basis of emotions in a family. I suppose I am looking for someone to be a best friend and a partner in life. My aspirations to realize myself in life, to meet a man who will complement me completely, and I will complement him.",
