    "girls_1st_letter" => "I am very sociable and friendly person. I dream of my family with a beloved one. Maybe I'm sometimes a bit of a perfectionist. But I believe that every woman should be a hostess in her home. How do you think? I am lonely to be one, independent woman. I dream to meet my soul mate. I'm looking for a man with whom I it would be interesting. I am a very positive person and I am ready to share with this my beloved person. Traveling is my passion. Another hobby is cooking - I like to find new recipes and experiment with them. I like to read books, I really like to communicate with people. If you think, that we are on the one way, let's start our communication, with a cultural dialogue!;) I am ready to make you the happiest in the world, are you ready?\r\nOksana",
