    "girls_info" => "I like to do fitness and also give lessons of  fitness, to take part in different sport competitions, to be a judge on some sport events, to be active. I am well-balanced, goal-oriented, calm and persistent person.\r\nI am fond of sports, reading, cooking, sewing.\r\nLooking for a man who will accept me with all my minuses and pluses. Hard to describe, it is better to meet and to feel!!",
    "girls_1st_letter_subj" => "Is your heart still free?",
    "girls_1st_letter" => "I have registered here with a hope to find a good man, due to recommendations of my friends. So here I am writing this letter to you.\r\n\r\nLet me tell you a little bit about myself. People say about me, that I am optimistic by nature, I have a positive outlook on life and try to find humor in the most situations ). I believe I'm an honest, a loving and caring person. I can be together with a group of people, friends, but I'm more comfortable focusing on face-to-face conversations. I'm quite independent and used to solve my own problems by myself, but I can be weak and soft at the same time. You will make no mistake if you assume that I'm a real woman in every meaning of the word. I am comfortable being myself. With or without makeup, with or without high heels)\r\n\r\nI am a fitness trainer in a gym and massage therapist. I like my job, but sometimes I feel very tired from work and dream to have a break. I think that I will never be just a housewife, but it is out of the question - the family is the most important thing for me.\r\n\r\nI like reading and travelling. I also like attending cultural events, going to the movies, watching a local band playing or going to a concert, BBQ with friends, spontaneous planned day trips or spending an evening at home to watch a movie.\r\n\r\nI have many goals and dreams and work hard to achieve them, but I also find time to enjoy life and traveling. I like walking and exploring new places.\r\n\r\nI want to find my other half, my friend and my soul mate. I am a happy mother of a daughter and I want to find a good friend and maybe father for her too. I love children. I'm genially looking for a relationship and more. Ideally, starting out as friends is always the best, but chemistry between two people has to be present and evident in the relationship.\r\n\r\nMy ideal partner is someone similar enough to be understood, different enough to surprise and delight. Someone who shares similar values and ambitions - a fellow traveler who wants to take the same journey as me. I'm seeking for an honest, intelligent, well-educated man. Maybe you are that guy?\r\n\r\nI hope my letter sparked a little interest in you and hope to hear from you.\r\n\r\nBest regards, Aleksandra!",
