    "girls_info" => "I am a happy and cheerful person, positive and full of energy. I like walking any time and any weather, meeting sunsets and sunrises, driving along night city, I like also cooking, baking, reading books. But also extreme activities:)) If you want to share all these great moments of my life, please welcome to my world:))",
