    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Hello:) Let me introduce myself first:)\r\nMy name is Olesya and I come from Odessa, Ukraine:)\r\nI am slim and attractive girl, sensual and emotional. I have a good character and good education. Also, thanks to my parents, I am cheerful, understanding, friendly and sincere. I am a happy woman as I am healthy, my family is fine, I have wonderful children whom I adore. I have a lot of friends but there is one thing, very important thing that I am missing is love..\r\nI am single and want to give all my love and care to my man. I dream about woman's happiness. I want to find my second half and enjoy each other... It can be anything, from washing the dishes, up to discovering new horizons together... \r\nI like cooking and create new meals for my family, I also like sports, good movies and the sea as I live at the seaside, in a splendid city Odessa. Maybe some day we will be walking there together, hand in hand?:) I really dream about it, and hope it will come true soon:)",
    "girls_1st_letter_subj" => "If you have reasons to love someone, you don't love",
    "girls_1st_letter" => "I believe\r\nin love at first sight\r\nbut I will always believe \r\nthat the people\r\nwe love\r\nwe have loved before.\r\nMany, many, many times before\r\nand when we stumble\r\nthrough grace and circumstance \r\nand that brilliant illusion of choice\r\nto finally meet them again, \r\nwe feel it faster\r\neach time through.\r\nThe one glance \r\nthat set life alight\r\nis two sets of two eyes\r\nstaring through the layers\r\nof lifetimes and stolen glances\r\nand first kisses and hands held;\r\nthe brace against the weight \r\nand unrelenting tide\r\nof waiting.\r\nI believe\r\nin love at first sight\r\nbut am not burdened with the misconception\r\nthat it's a first sight\r\nat all",
