    "girls_info" => "My name is Nataliya. I'm from Ukraine. I like to get new experience, meet new interesting people. I am a good listener and I love to be silent, but I am sociable and with a good sense of humor. I love sports, different activities, but also reading, driving a car and listening to music during it:) I like singing, too. So maybe it is you whom I will sing my love song some day?:) I am here for serious relationship only.",
    "girls_1st_letter_subj" => "What is it of the moment you fall in love?",
    "girls_1st_letter" => "What is it about the moment you fall in love? How can such a small measure of time contain such enormity? I suddenly realize why people believe in d&#233;j&#224; vu, why people believe they've lived past lives, because there is no way the years I've spent on this earth could possibly encapsulate what I'm feeling. The moment you fall in love feels like it has centuries behind it, generations—all of them rearranging themselves so that this precise, remarkable intersection could happen. In you heart, in your bones, no matter how silly you know it is, you feel that everything has been leading to this, all the secret arrows were pointing here, the universe and time itself crafted this long ago, and you are just now realizing it, you are now just arriving at the place you were always meant to be..\r\nAnd I want to be where I am supposed to be and with whom I am supposed to be.\r\nMaybe you?:)\r\nSincerely,\r\nNataliya",
