    "girls_1st_letter_subj" => "Love's just a word till someone comes and gives it meaning",
    "girls_1st_letter" => "and when love came to us twice \r\nand lied to us twice \r\nwe decided to never love again \r\nthat was fair \r\nfair to us \r\nand fair to love itself. \r\n\r\nwe ask for no mercy or no \r\nmiracles; \r\nwe are strong enough to live \r\nand to die and to \r\nkill flies, \r\n\r\nattend the boxing matches, go to the racetrack, \r\nlive on luck and skill, \r\nget alone, get alone often, \r\nand if you can't sleep alone \r\nbe careful of the words you speak in your sleep; \r\nand \r\nask for no mercy \r\nno miracles; \r\n\r\nand don't forget: \r\ntime is meant to be wasted, \r\nlove fails\r\nand death is useless.\r\n\r\nI know that if we are here, we all had some disappointed in love, and perhaps wanted to give up in some way, but I am sure that without a loving person next to us, everything else has no sense..If you are looking for your sense here, too, please write me back.\r\nHope to hear from you soon,\r\nValentina",
