    "girls_info" => "I am a girl who is ready for much for the sake of love, but I have to see that my feelings are mutual and my efforts are not in vain, I am looking for a man who is looking for serious relationship and ready for a family, who is sensual, passionate, but at the same time, devoted and kind. Among my interests are reading, watching nice movies, traveling and listening to music. I am a loyal ad kind very caring person and also I like to feel care from my partner too. I believe in love between 2 people, mutual understanding and respect.  I am a romantic woman, tender and feminine, I have logic thinking when needed and have a good since of humor.",
