    "girls_1st_letter" => "I am looking for a real man. Only seriously. \r\nI would be happy to find a beloved man for life. He is family oriented, he wants to be happy and give happiness to a gentle and kind woman. He can be loving and understanding. I'm looking for a man for whom distances and borders don't matter. \r\nI am a family oriented, loyal, humorous, romantic, gentle and caring woman. I am easy going, loving and kind lady with a loving heart. I am looking for love and for serious relationship here. I want to enjoy life with my only man. If we like each other, we should be ready to meet in real.\r\nIf you are looking for a good Ukrainian woman for life, please write me and I will answer you with great pleasure.\r\nSincerely yours,\r\nJuliya",
