    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a woman with lots of interests and with the great wish to create a happy healthy family where the children are loved an desired, where everyone respects each other and wants to make the family happy. I love cooking and taking care of the house, I like hand made things and can do some nice interior things by myself. I am caring and loving, educated and intelligent. And I am looking for a man whom I can give all the love I have inside.",
    "girls_1st_letter_subj" => "A simple woman with a great heart",
    "girls_1st_letter" => "Love is not finding someone to live with. It's finding someone you can't live without. Love is not a consequence. Love is not a choice. Love is a thirst. A need as vital to the soul as water is to the body. Love is a precious draught that not only soothes a parched throat, but it vitalizes a man. It fortifies him enough that he is willing to slay dragons for the woman who offers it. Take that draught of love from me and I will shrivel to dust. I want to try with someone who loves me enough to try with me. I want to grow old looking at the same face every morning. I want to grow old looking at the same face every night at the dinner table. I want to be one of those old couples you see still holding hands and laughing after fifty years of marriage. That's what I want. I want to be someone's forever.\r\nIf you think I may be the woman you want to spend the rest of your life with, please write me back.\r\nSincerely yours,\r\nOksana",
