    "girls_info" => "I am educated, kind and tolerant. My heart is full of love to nature and music. I like reading, cooking, gardening. I am family-oriented. I have an optimistic outlook, but I am alone. I hope to meet the man who needs my tenderness. I want to love and to be loved. I don't smoke. My dream is to meet the man, for whom I will go to the edge of the world, and will be happy next to him, despite the circumstances.",
    "girls_1st_letter_subj" => "I am a real Russian woman",
    "girls_1st_letter" => "Hello, my dear,\r\nI want to tell you more about myself, and hope you will get interested in me and want to get to know me better. \r\nI live  in the city Makeevka, it is a small town in the suburbs of Donetsk. It is an industrial region but also a cultural one, rather beautiful  and picturesque. Probably you know that this is the military zone now, everything is very difficult, but we hope for the best and I can say that  I am friendly and sincere. I value honesty and faithfulness, good sense of humour. There are so many things to take them as they are and to enjoy them and  it's a double pleasure when there is someone special in your life to share all you have - thoughts, feelings, emotions, to ask for advice, to discuss something, to make plans for future and just to be as you are. My heart is free now and I would like to fill this place inside, because loneliness is not a natural state for me. I dream to meet this special man and to change his and my life into complete Happiness, I'll be glad to know you closer - your character, country, and writing is a good opportunity to know each other better. I got divorced nine years ago, our marriage has exhausted itself, we did not have children who would bind us, it was a mutual decision and we parted as friends, I am now ready for new serious relationship.  I'm an energetic person, I like outdoor activities, I love nature, sea, mountains, meeting friends at a barbecue, my hobby is to collect and prepare the mushrooms, I love to cook, cooking for myself is not interesting, but it's nice to surprise a beloved one, especially for a romantic dinner with candles, especially in winter in a cold evening and to enjoy the rest together. My dream is to meet the man, for whom I will go to the edge of the world, and will be happy next to him, despite the circumstances. Make me happy and you will recognize the gratitude of the Russian soul.",
