    "girls_info" => "My name is Katerina.  I am an ordinary girl - modest and caring. \r\nI work as a hair dresser and I love my job.  I love also movies, books, music. \r\nI love children and animals. I like communication, I love meeting new people. I can listen, can hear and communicate. \r\nI really want to meet a smart, kind and decent man. I want to start a family. I know how to love, I dream to be loved. I love to cook and create comfort in home.",
    "girls_1st_letter_subj" => "What is love? two souls and one flesh",
    "girls_1st_letter" => "My point is that love is the most powerful motivator in the world. It spurs mortals to greatness. Their noblest, bravest acts are done for love. I believe that every single event in life happens in an opportunity to choose love over fear. None of us can choose where we shall love...When you start to really know someone, all his physical characteristics start to disappear. You begin to dwell in his energy, recognize the scent of his skin. You see only the essence of the person, not the shell. That's why you can't fall in love with beauty. You can lust after it, be infatuated by it, want to own it. You can love it with your eyes and body but not your heart. And that's why, when you really connect with a person's inner self, any physical imperfections disappear, become irrelevant. That is my opinion about love. Does it coincide with yours?)\r\nWaiting for your reply,\r\nKaterina",
