    "girls_info" => "I am very kind, cheerful, with open heart! I am sincere and you will easily know what I am feeling right from expression of my face or from my voice)))  I love sports - I go to the gym, I do also aerobics, and I love swimming! As any other lady I adore shopping, but I will not torture you if you don't like))) I value other people's choices and likes)) I love travelling and developing spiritually and mentally))) I love reading also and I think now I am on the edge of starting my own \"love story\" to write in my \"book of life\"))) Do you want to become one of the main character in it?:)",
    "girls_1st_letter_subj" => "Are you tired of being lonely?",
    "girls_1st_letter" => "Are you tired of being lonely? Are you a sincere man, who is openhearted, caring, confident, serious and romantic? Are you looking for true love here? If so, you should continue reading this letter, because I am here only looking for such man… I hope that the special chemistry can appear between us…. What do you think about it?\r\nTelling about myself, I am Ukrainian girl – Ludmila, or Mila for short. People say that I have beautiful name from nice Russian poem \"Ruslan and Ludmila\" and my life should become a wonderful  poem very soon… You know, I believe… Have you ever heard and read Russian poems? \r\nYou know, I have a lot of dreams and hope they will come true very soon. I want to share some of them with you…So, I dream about the family and my beloved husband, about more kids perhaps. I want to travel with my beloved around the world and I want to make every day be special and unforgettable. And you? Are you active person?\r\nAnd I want to discover every detail and every single feature of my man. I really will make you happy, I promise as I have a goal to find right keys to you heart, just give a hand of friendship! You will never regret!\r\nI will wait for your letter!)))\r\nMila",
