    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Dear gentlemen!\r\nI am a tender and kind lady, dreaming of finding a best friend, lover and strong men - 3 in 1;) In return I will be a best friend, over and companion for that one a nd only man I am sure I will find here.\r\nMost of all I value family - I love my job and I would like to develop my professional skills, but family is far more important. I love nature, most of all I love seaside. I always try to stay fit and good looking. \r\nAs for features I value in men - the main things are sense of responsibility and the ability to put the family first. I will be glad to get to know you as I am an open and sociable person.",
    "girls_1st_letter_subj" => "When you know my love, my love will warm you",
    "girls_1st_letter" => "It should be a privilege to be able to say \"I love you\" to someone. It shouldn't be something people say just because they feel like it. A privilege that is earned. They say you have to earn the right to be loved; no, love is unconditional, if you love someone, they don't have to earn it. But. The right to tell someone that you love them? That has to be earned. You have to earn the right to be believed.\r\nWhat is home? My favorite definition is \"a safe place,\" a place where one is free from attack, a place where one experiences secure relationships and affirmation. It's a place where people share and understand each other. Its relationships are nurturing. The people in it do not need to be perfect; instead, they need to be honest, loving, supportive, recognizing a common humanity that makes all of us vulnerable. And I want to have such a safe place together with my soul mate and create a happy family. If you want the same, I will be happy to hear from you.\r\nBest wishes,\r\nMarina",
