    "girls_info" => "I am interested in IT sphere, and want to develop myself in this direction in future. \r\nI like reading books, adore cooking new delicious meals and make pleasant surprises for my family. I prefer spending time outdoors than sitting at home:) As for my character, I am very sociable, open-minded, sincere and loyal. I think it is easy to communicate with me, I hate quarrels and always do my best to find a compromise in any situation.",
    "girls_1st_letter_subj" => "And what is love for you?",
    "girls_1st_letter" => "Love is a wonderful gift. It's a present so precious words can barely begin to describe it. Love is a feeling, the deepest and sweetest of all. It's incredibly strong and amazingly gentle at the very same time. It is a blessing that should be counted every day. It is nourishment for the soul. It is devotion, constantly letting each person know how supportive it's certainty can be. Love is a heart filled with affection for the most important person in your life. Love is looking at the special someone who makes your world go around and absolutely loving what you see. Love gives meaning to one's world and magic to a million hopes and dreams. It makes the morning shine more brightly and each season seem like it's the nicest one anyone ever had. Love is an invaluable bond that enriches every good thing in life. It gives each hug a tenderness, each heart a happiness, each spirit a steady lift. Love is an invisible connection that is exquisitely felt by those who know the joy, feel the warmth, share the sweetness, and celebrate the gift! \r\nAnd what is love for you? Do our thoughts coincide?\r\nwaiting for your reply,\r\nEkaterina",
