    "girls_info" => "My name is Irina and I am happy to welcome you on my page here!  I am a very active, cheerful, full of life and happiness lady))) I am honest and sincere and I truly wish to find my man and start my new life with him in his country! I love traveling, dancing, sport, fitness and cooking! I am also keen on singing and dancing))) One of my strongest features of character is justice and I love discovering everything new - countries, cultures, people...I am open to this wonderful life and I am ready for great changes in my life - all for better! I am open for My new love!",
    "girls_1st_letter_subj" => "I don't get why to be together if not to be the happiest",
    "girls_1st_letter" => "When you find somebody you love, all the way through, and she loves you—even with your weaknesses, your flaws, everything starts to click into place. And if you can talk to her, and she listens, if she makes you laugh, and makes you think, makes you want, makes you see who you really are, and who you are is better, just better with her, you’d be crazy not to want to spend the rest of your life with her...I hope that my man will not miss me, and will not pass me by..because I am here, I am waiting for him and promise to do everything I can to make him the happiest man in the world!",
