    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a very cheerful lady, I am kind and energetic! I am always busy with something and I develop my personality within my sphere of activity. I am calm and goal-oriented. I wish to find the love of my life to create a lasting family!\r\nMy interests are diverse: photography, travelling, active rest and meeting with friends! I like art! My favorite activity is to go to the theater when we have a new play by our local troupe or plays starring famous actors from Kiev or Moscow. \r\nI am looking for my future husband! He is reliable, smart, kind and caring, he also possess a great sense of humor! I would appreciate if my man wanted to develop himself professionally. I believe faithfulness is very important in a relationship, so I am looking for an honest and devoted man, too. I hope my man to be able to trust me, I think it is significant that my husband respects women and treats them well.",
    "girls_1st_letter_subj" => "BE mine!",
    "girls_1st_letter" => "I live in a private house all by myself. My father and my aunt are living not far from me, my mom lives in the city outskirts; they have divorced with my father when I turned 4. I remained together with my mother and two step sisters from my mother previous marriage. I went to school, then after graduation I entered college and later academy. I didn`t like the profession of heating engineer which I have obtained thus I worked due to my original specialty only for the first three and a half years after graduation, then tried myself in different jobs. Eventually I became a sales consultant in a jeweler shop this profession is for my liking and I enjoy it very much. At the same time I am not going to stop on what I have achieved, I wish to go upper by career ladder, developing new skills and improving myself. In reality it is better to have your own business and to be independent))) what are your thoughts on my ideas?\r\nEven though I am young I dream to start a family, I often imagine how I have three lovely kids with my special partner and we go for walks in the park over weekends all together, everybody is happy and we are enjoying our time together!\r\nI like pets very much and I have a Yorkshire terrier Oscar) and sometimes I joke and tell my friends, you know I have an Oscar at home (like a reward for achievements in movies industry)))\r\nI finish work at 9p.m. and when I get home I take a shower and go to bed â€“ not the funniest way to finish every single day being in solitude, especially when I definitely not receive any positive emotions from being on my own.\r\nWhen I have a day off I try to go somewhere, to see a movie, to meet with friends in a cafeteria or attend exhibition or walk along the streets of my city.\r\nI have a nephew and I love him dearly, kids are flowers of life) they are in need of being given love and showing life from positive side.\r\nI love music and since childhood I dreamt about playing a violin or piano, but regretfully I haven`t learned. I love poetry and sometimes surfing the net I find nice verses about love and read them with pleasure!\r\nI like summer and winter equally since each season has its own beauty. In winter I love strolling along the streets and contemplate how the snow is falling. In summer time I love beach rest, though I am scared of water (since I cannot swim) and can you swim? Do you have your favorite season?\r\nNew Year is one of the most special holidays for me and I love it really very much â€“ on the eve of coming Christmas and New Year I feel very excited always! And what is your favorite holiday and why?\r\nI am dreaming of learn how to drive a car. Will you teach me? I have never tried to do it but I think I will do well when I will learn) I have never been overseas, but I am willing to see other countries. I hope my dreams will come true and maybe you will help me to bring them into fruition.\r\nI posted my profile on the agency web site because I couldn`t find my soul mate in my native cityâ€¦\r\nI wait to hear from you,\r\nValeriya",
