    "girls_1st_letter" => "Thank you for paying your attention to me. I wish to know you better. My name is Viktoriya. I always dreamed to work teacher and I worked as a teacher, but soon I get retired.  I am already a grandmother of a beautiful small princess and soon I will be twice grandma. I am a caring and passionate woman, For me it is very important to have good atmosphere in the house and I wish to make my man always happy. I have been divorced for many years and I wish to find a good man and the best gift for me is to see my man's happy eyes and smile. \r\nI am from a very beautiful city Mukachevo, which is situated in Transcarpatia, it is on the border of 3 countries. I like to listen to different music, cooking, enjoy nice weather and simple things. Also I enjoy when I clean apartment or dishes. I wish to meet a caring and loving person. For me real happiness is love between two people. And the most important things in a man that is loyalty, passion and mutual understanding.\r\nI want him to be a friend, ready to be together in different situations, and solve all the problems together. To have trust and understanding. To help each other in everything and always. Let's try. It may be our chance to find each other and to be happy.\r\n\r\nI am looking forward to hearing from you soon.\r\nSincerely,\r\nViktoriya",
