    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "My personality is active, cheerful, kind and optimistic! I smile a lot and I have very positive attitude to life. I love sports, I am a reliable woman, I never let down my close people or friends. My heart is very big, and I have lots of love in it. I want to give this love to someone special!\r\nSports are very important for me! I like tennis, go swimming, play volleyball! I like classical music and I play the piano. I like live concerts and I often go to the theater. I like cooking, growing flowers and I like to make my home cozy. I haven't got any pets, but I like to play with my friend's dog. I believe that dogs are very devoted animals.\r\nThis is my desire to find a nice man that took me to this website. I want to find a reliable, kind and caring man. I hope him to be fond of sports, good jokes. Of course I hope to find a sexy man, healthy, active and having stable income. One of the most important things I want to mention here, I can't stand the smell of cigarette smoke.",
    "girls_1st_letter_subj" => "I want to fall in love!",
    "girls_1st_letter" => "This is my letter for you, I will be looking forward to your reply! \r\nI was born in Ukraine in a very beautiful city Zaporozhye, which is situated on two banks of Dnepr River in the middle of which there is a picturesque Khortitsa Island which gave its name to worldwide known alcohol drink vodka â€œKhortitsaâ€. I live here and now. This is the story of my life, but I am sure the best part of it is still waiting for me ahead!!!\r\n My childhood was jolly and carefree, I was lucky. I had a closely knit family of five people. My mother and father were wearing the same names by irony of fate both were Valentines, they were a beautiful couple at whom everyone looked with admiration and adoration. Their commitment, respect, attention and care about each other were manifesting naturally and easily. It happened so that both of them were orphans and they were sincerely cherishing each other and were supported by their children and atmosphere they had within the family bond. Laughter was always pouring out of the windows of our home. There were three children which was not common for that time. The elder was Olga and to keep the family in harmony everybody wanted to have second child and were expecting a boy, but when instead a boy two girls came into life - twins, this became a great surprise for my relatives. My twin sister Tatiana and I were born.\r\nHAPPINESS and JOY â€“ this was what my childhood like! Yet then my granny was alive and she lived by the Black sea. That is why SEA and anything what is connected with the sea is my passion! I cannot imagine my life without a sea. The sound of the surf is the music always nourishing and comforting my soul.\r\nOne more joy for me is music. It turned out so that we had a piano at home. My elder sister studied at a musical school and I did self-study at first on my own then I found a tutor who assisted me in learning how to play musical instrument. My tutor supported my wish to play only those compositions which I really liked. Yes it was difficult because the compositions were complex and lengthy but they were so beautiful. That is why this process could hardly be called studies. It is such a satisfaction, delight and miracle to crave music out of set of simple sounds. Still music is a big part of my life and I cherish this very much. I follow the music life of my city. When I am feeling low I am putting on headset and the sound of the vocal of famous all over the world Italian tenor Andrea Bocelli  or Ludovico  Einaudi taking me into a different dimension and I am happy.\r\nAnd what else without what I do not imagine my life that is sport. I have always had it in my life in abundance and of different kinds. For the past ten years I am playing big tennis. Regretfully I cannot learn to play by technique of Roger Federer but I receive plenty of pleasure and physical loads. \r\nNow I want to say a few words about well known to anyone of us entertainment â€“ television. From what is being offered by it I choose sport channel, programs about nature and films rewarded by Oscars, also football championships. As a rule I do not watch the entire mentioned above not from home.  \r\nI have two higher degrees in economical field. That is why I am having loads of work all my life long. I have things to do and this is not what makes me a happy person. I wish I would have learned foreign languages instead then it would have opened to me new horizons, now I will start learning them for sure!\r\nLearning is a thrilling process but would have been much better if I was married and had kids. Then I could feel the happiness of motherhood and relations with my beloved man. Yes, there was a huge and burning love in my past that lasted for long ten years. My former partner hasn`t encouraged my wish to have children and didn`t become my supporter and soul mate during the most complicated period of my life. I had to face all the difficulties being alone. It is a shame but my love, fidelity and commitment have not helped me to create a family. We separated and split apart, it was a terrible loss for me which I could forget only after years have passed. All in all I am glad I had LOVE in my life. As people say the person who lost love is miserable but a person who has never experienced love even more miserable. I am lucky since I know I am able to love.\r\nI also want to mention traveling â€“ this is one more thing which makes me happier. The ten countries I have visited inspired me to desire to see more of the world around me. Culture, people, architecture, life, nature all of the mentioned is of my interest. I have big plans for the future in the given segment. \r\nHaving registered with the agency I hope to find my man with whom we will become friends, partners, lovers, soul mates with whom we would be attentive towards each other preserving our mutual relationship, enjoying our life, and could spend evenings embracing each other, listening to the sounds of blues contemplating stars of the dark sky dome, or watching the moonlit walk on the surface of the warm and tender sea.\r\nWait for your answer,\r\nElena",
