    "girls_info" => "I am a calm and tolerant women. \r\nI love adventure, honesty, communicating with people who are very interesting, smart and open-minded. I appreciate kind heart and feelings. I like traveling, nice movies, nature, sea, pleasant conversation, when you can share with a person your feelings and thoughts. I think I have good character. I hate lies and arguments and always try to talk and discuss things before making any conclusion. The people say I am very easy to get along with:) The man I am looking for must be a decent and caring man. That is everything I need. I know a caring man wants to have a friendly family without arguing, he wants to spend time with his family and be a good husband and a good father. I dream about a harmonious family.",
    "girls_1st_letter_subj" => "In art as in love, instinct is enough",
    "girls_1st_letter" => "My name is Nataliya and I have made a very significant step of registering here:) Now I am waiting and really hope that my future husband is looking for me somewhere here, too. \r\nI am a romantic and tender lady. I am a responsible and kind lady. I believe in love and think it is the most precious feeling the God can give us. And the people who are lucky to have it, are the happiest in the world..So I want to be happy, too. \r\nThe people say, that I have a good sense of humor and they like, when I make jokes and they laugh with me together....\r\nI am an honest person and I do not like hypocrisy and lies, because this kills us from all inside. I am sure, that all the relationships must be true, honest and with the sense of respect and with the understanding. These are the things, which can create the happy marriage. I like nature, I like to take photos of it.\r\nI have come here to find a man, who will love me for who I am. Who will take care about me in all senses. I will be the whole world for this man and he will be the whole world for me...Is not is a happiness?!!!\r\nI will wait for your attention to my profile.\r\nNataliya",
