    "girls_info" => "I am a woman who is very tired of being strong..I dream about meeting the man who will allow me to be weak next to him. I do not to be a leader. I want to be a good housewife and a mother finally, to take care of my husband, kids and our house. I am sociable, tolerant, kind. I like cooking, reading, traveling, learning English (now i am at the elementary level, but I have a goal to speak fluently to be able to communicate with my future husband).",
    "girls_1st_letter_subj" => "where is my real strong man?",
    "girls_1st_letter" => "We have to allow ourselves to be loved by the people who really love us, the people who really matter. Too much of the time, we are blinded by our own pursuits of people to love us, people that don't even matter, while all that time we waste and the people who do love us have to stand on the sidewalk and watch us beg in the streets! It's time to put an end to this. It's time for us to let ourselves be loved. Here I am looking for mutual love, mutual respect and understanding. For me it is the basis of good relationship. I just want to love and be loved at last. And I can love, just believe me. Please drop me a few lines if you are really interested in the communication.\r\nSincerely,\r\nTatyana",
