    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am from the city Zaporizhzhia which is situated in the south of Ukraine. Iâ€™m a teacher of English at a high school. I am an accomplished lady who tries to be equally best at home and at work. I am kind and sincere, responsible and honest I guess these qualities help in life.\r\nI love going on trips with my friends, listening to classical and modern music, reading and watching classical music concerts. I adore spending time with my closest people, no matter what activity we are involved in what matters is that we always have lots of fun!\r\nCary Grant, Johnny Depp, any Bond or Antonio Banderas can be his counterparts (if not - I donâ€™t mind. I am not Julia Roberts myself:) My partner should be mature enough to be settled into his skin and understand that I require more than a dinner and a few martinis to get into the mood.",
    "girls_1st_letter_subj" => "I am an English-speaking and family-oriented lady",
    "girls_1st_letter" => "Hello my dear,\r\nI was asking my students to write an introductory letter about themselves so many times, checking their mistakes and giving pieces of advice on this topic that I wouldnâ€™t ever think that I could face this task one day.(my studentsâ€™ curse caught me up : ) )\r\nSo, my name is Helen. I live in the picturesque city Zaporizhzhia in the south of Ukraine. I have a flat of mine in the center of the city, sharing it with my grown-up beloved son Daniil (21). He is a student of the technical university and he combines studying and working at the metallurgical plant. He is a rather sporty guy, going to the gym and leading a healthy way of life, motivating me to do the same.\r\n I also have the best brother ever -John (38), living with his girlfriend in another city. My parents are enjoying countryside life at the bank of the marvelous river Vorskla having moved from the city. My mumâ€™s name is Aleksandra and she is 68 and my father John is 69. I adore visiting them when I have a chance. \r\n As for me, I am a well-educated and intelligent woman. Iâ€™m a teacher- methodologist of English at a high school. I wasnâ€™t having difficulties in choosing a carrier, as my teacher of English inspired me being a real example of a person who was so much devoted to what she was doing. I always receive great sense of satisfaction when my students say that Iâ€™m a part of their success. What I like most about my job is that it gives me the opportunity to learn and be creative every day. Though Iâ€™m a teacher I am very curious and like studying.\r\nI am an accomplished lady who tries to be equally best at home and at work. I love my profession, but family means a lot to me too.\r\nMy hobbies help me to make my life more colorful. An evening of theatre or performances of exquisite classical music of Vivaldi Beethoven, jazz and even pop also recharge my batteries. The songs of Adele, Sting, and the energy of â€œImagine dragonsâ€, â€œCold Playâ€ or simple chattering with my friends can make my day. \r\nBooks are sure to be my hobby-horse. Some of them are to be tasted, others to be swallowed, and some few to be chewed and digested: that is, some books are to be read only in parts, others to be read, but not curiously, and some few to be read wholly, and with diligence and attention. F.Scott Fitzgerald`s â€œThe Great Gatstsbyâ€, â€œOne hundred years of solitudeâ€ by Gabriel GarcÃ­a MÃ¡rquez, â€œAtlas Shruggedâ€  by Ayn Rand are some of the masterpieces that I adore reading. They make me think, laugh or cry.\r\nTravelling is my passion as well. Roaming the streets of London, visiting its historical sights, gulping its air full of mystery, make my heart beat faster. It has a perfect blend of traditional and modern. Iâ€™m able not only to see the historical places of Dresden, Prague, Paris, Brussels and other cities but also feel them. Guell park or Salvador Dali theater-museum in Figueres have left an unforgettable impression on me. \r\nI have an optimistic nature. I always try to see the good in every person and situation. I believe that not all relationships are unhealthy. I believe that if two people are destined to be together there are no boundaries or barriers for them. \r\nI have been lucky in life and now I am looking to be lucky in love. The missing ingredient is the sharing of love with a true life's partner. When I think of the right man for me, I think of someone who can carry on a conversation whether the topic is silly or serious, who knows who he is, what he wants, and what things in life matter.(if still not we can clear up together :) \r\nIâ€™m sure that our beliefs and life values will help us to become inspiring and enviable companions in every eventuality. Make my toes curl being with you( :) and I shiver with delight.\r\nHope to hear from you soon. Perhaps we can get together one day.\r\nSincerely yours,\r\nElena",
