    "girls_1st_letter_subj" => "there are no perfect people, but there is perfect one for you...",
    "girls_1st_letter" => "“He’s not perfect. You aren’t either, and the two of you will never be perfect. But if he can make you laugh at least once, causes you to think twice, and if he admits to being human and making mistakes, hold onto him and give him the most you can. He isn’t going to quote poetry, he’s not thinking about you every moment, but he will give you a part of him that he knows you could break. Don’t hurt him, don’t change him, and don’t expect for more than he can give. Don’t analyze. Smile when he makes you happy, yell when he makes you mad, and miss him when he’s not there. Love hard when there is love to be had. Because perfect guys don’t exist, but there’s always one guy that is perfect for you.” I adore this phrase of Bob Marley and I completely share it. I am not looking for a perfect man, nobody is perfect, but I dream to find the men who will be perfect for me. And I swear I will do him the happiest man in the world. Maybe it will be you?:))))\r\nTatyana",
