    "girls_1st_letter_subj" => "I've been making a list of the things they don't teach you at sc",
    "girls_1st_letter" => "I've been making a list of the things they don't teach you at school. They don't teach you how to love somebody. They don't teach you how to be famous. They don't teach you how to be rich or how to be poor. They don't teach you how to walk away from someone you don't love any longer. They don't teach you how to know what's going on in someone else's mind. They don't teach you what to say to someone who's dying. They don't teach you anything worth knowing..But the experience does, and it is a good teacher. I have had enough of experience in life - good and bad, but now I want to start all over from the beginning, to write a new page of the book of my life..Maybe we can start it together?\r\nLiliana",
