    "girls_info" => "I am a good looking woman and you will be always proud of me. Because I am well-behaved, well educated and take care of my appearance. besides I am very sportive, sociable, kind, attentive, caring woman. I love the life and I am always ready for new things in my life like marriage with the foreign man. I like fitness, swimming in the pool, yoga,hand-making, embroidering, drawing, making tasty tea and coffee!\r\nI am here to meet a man with a good sense of humor. It is very important for me because I like laughing as I think it longs our lives. Besides I hope he will  be honest, generous, brave man who is sure in himself. My man must appreciate women and respect them.",
    "girls_1st_letter_subj" => "Life is a puzzle..",
    "girls_1st_letter" => "Hello) So let's start to solve the puzzle of each other:))))\r\n\r\nLife is a puzzle\r\nThe answer lies in itself.\r\nOur mind keeps on wandering\r\nIn the labyrinth of real and illusion.\r\n\r\nLife is a puzzle of keys\r\nDeep hidden is the key to lock and unlock anything.\r\n\r\nLife is a puzzle of ocean\r\nDeep hidden is the secrets and emotions.\r\n\r\nLife is a puzzle of roses\r\nDeep hidden is the fragrance of love and pain.\r\n\r\nLife is puzzle of mask\r\nDeep hidden is the beauty and ugliness of life.\r\n\r\nLife is a puzzle often comes wrapped in a gift pack.\r\nWhen opened, both Joy and pain punch us together.\r\nAfter getting a punch, sure the solutions will keep on rotating in our starry eyes.\r\n\r\nLife is puzzle of solutions! \r\n\r\nHope you have got interested to solve my puzzle, and you will succeed:)\r\nGalina",
