    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a kind, easy-going, sincere and good-natured woman with a nice character. \r\nI like to have rest outdoors. I adore theaters, cinemas, classic and modern music.  Besides I am fond of riding a bicycle, swimming and other outdoor kinds of sports. I like to travel to explore new worlds and new people. I love animals, nature and listening to good music.\r\nI really dream to meet nice, reliable and confident man, loving, attentive and tender with a sense of humor. My second half should be an honest and serious man, who is active and intelligent. I am looking for my second half who will accept my love and my attention.",
    "girls_1st_letter_subj" => "Do you want to start a new life together?",
    "girls_1st_letter" => "Hi! Nice to meet you here!\r\nHow are you? I hope my letter will make your day brighter)\r\nI have been waiting for the most important meeting in my life, and I really expect it will happen here soon..And what are you doing here? What are you looking for? \r\nSo, my name is Svetlana. I was born on the 1983-11-23 in Poltava, Ukraine. Now I still live here, and I like my city a lot. Unfortunately, my personal life has not been very lucky, that is why I am here. I have completely got disappointed in our Ukrainian men, and want to build a family with someone who can value his woman, treat her in a correct way, love and care. Someone who is not scared of difficulties and problems, who is ready to overcome them to be happy with his family. Of course there are always problems and troubles, not all in life is easy, but I think that when 2 people are together and they love each other, they cope with everything. So I hope I will meet my second half here to go in life hand in hand leaving all the difficulties behind us. I hope to meet a man to follow this life together. I know you are a decent, reliable, loving the life man and it can really work between us.\r\nPlease write me back if you think that our joint future is possible. \r\nSincerely,\r\nSvetlana",
