    "girls_info" => "I am decent, honest, open-minded, faithful, woman of integrity. I am very demanded to myself. At the same time I am too loyal, too kind, too reliable and decent. I think I have a good sense of humor and be the best woman for my only one man. I love animals very much and the  nature. Most of all I like sewing, all kinds of handiwork, history, music and cooking very much. But what I do the best is hair-dressing and knitting.",
    "girls_1st_letter_subj" => "A real woman..",
    "girls_1st_letter" => "A real woman is proud and strong. She respects herself and others who have earned her respect. She is aware of who she is. She does not seek definition from the person she chooses to be with, nor does she expect them to read her thoughts. She establishes her own identity as a valuable human being. She is quite capable of articulating her wants and needs. She has no fear in seeking guidance from others when she is feeling vulnerable, weak or frail. She must understand that we were all placed on this earth for each other; at times, we all need help.\r\nA real woman knows and faces her past, understands her present and battles toward a hopeful future. She does not live in fear of the future because of her past, no matter what the past may hold. Instead, she understands that her life experiences are merely lessons that were meant to bring her closer to self-knowledge, unconditional self-love and understanding. If you cannot learn to completely know and understand yourself; you will never find anyone else who can or will.\r\nIf you want to meet this real woman, please write me:) I hope to meet my real man here, too:0\r\nLudmila",
