    "girls_info" => "I am an active person who likes to try new things in life. I adore traveling, where we can get plenty of new and positive emotions. I love watching the films with deep sense, I love smart conversations and intelligent people. Also I go in for sport - skating, dancing, walking and jogging. I am always positive, merry and optimistic. If you are ever in bad mood, you can always write to me! I will do my best to calm you down and to cheer you up. I am a very devoted friend and a caring woman.",
    "girls_1st_letter_subj" => "You will love to meet me!",
    "girls_1st_letter" => "Pretty women wonder where my secret lies.\r\nI’m not cute or built to suit a fashion model’s size   \r\nBut when I start to tell them,\r\nThey think I’m telling lies.\r\nI say,\r\nIt’s in the reach of my arms,\r\nThe span of my hips,   \r\nThe stride of my step,   \r\nThe curl of my lips.   \r\nI’m a woman\r\nPhenomenally.\r\nPhenomenal woman,   \r\nThat’s me.\r\n\r\nI walk into a room\r\nJust as cool as you please,   \r\nAnd to a man,\r\nThe fellows stand or\r\nFall down on their knees.   \r\nThen they swarm around me,\r\nA hive of honey bees.   \r\nI say,\r\nIt’s the fire in my eyes,   \r\nAnd the flash of my teeth,   \r\nThe swing in my waist,   \r\nAnd the joy in my feet.   \r\nI’m a woman\r\nPhenomenally.\r\n\r\nPhenomenal woman,\r\nThat’s me.",
