    "girls_info" => "My friends say that I am a person they can always rely on:)) Of course, it is my pleasure to hear that:) But I really think that being a good friend and a good person in general is very important in our life. I consider myself to be king, tolerant, responsible and easy-going person. I am fond of cooking and do not miss the chance to please my family with something tasty. It gives me pleasure. Also I like nature, going to the gym and listening to good music. I like animals and taking care of them. I am here to find a serious man who is able of actions.",
