    "girls_english_proficiency" => "some",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a kind, caring, jolly person by nature, very adventurous and easy to be together with. I am recently divorced and looking now for my soul mate and partner to share my life and interests together with. I am self-sufficient and well-rounded lady, intelligent, attentive and know what I wish in life, currently I am running my own online business in the sphere of marketing, will tell you more of course if you wish to know, just ask me!\r\nI love reading, music, history and traveling, seeing sights and exploring underwater world is also on the list of the pleasures and my hobbies, I love diving and snorkeling, dream to visit Caribbean, have you ever been there? I love sports and stay fit, do enjoy horseback riding) we have a horseback riding club in Zaporozhye, want to join me? \r\nOf course I am willing to meet a man who is strong, experienced, he knows life and understands the needs of his family, being ready to provide for his family having a very loving bond together me. I want to find not only life partner but soul mate and reliable person with him we will travel together, support each other and complement each other at all life levels. Drop me a few lines, let`s see what happens!",
    "girls_1st_letter_subj" => "Welcome to my world:)",
    "girls_1st_letter" => "I am Dariya, I was born in Zaporozhye, I for the last few months  I have been living with my family: my parents Inna and Roman, they are working as musicians, they sing in a restaurant, conduct weddings and parties. I also got a musical education, I learned to play the piano. Roman (my stepfather) later taught me how to play the guitar! During my student years I played in a rock band:) Well, but music is more like a hobby for me now. I like a lot of musical styles, mostly rock, classical rock, indie, opera, rock opera, classics (Imagine Dragons, Train, Arctic Monkeys, etc).\r\nI graduated from the university, my profession is manager of the hotel and restaurant business. But I had chances to try different jobs in my life, I will tell you more in further letters.\r\nI have got a sister, Polina, we have one father, but different mothers. She is a teenager, she is very much like me, a positive and cheerful person, we often see each other and spend time together.\r\nI have many hobbies and interests. I really love traveling, I haven't had the opportunity for many years, but the last year and a half I have travelled a lot. Only for the last year, according to my calculations, I have made about 20 flights! I like to visit interesting and unusual places, inspiring and emotional. I like adventures and of course I live with a bit of adventurism.\r\nI love passive rest, too, to lie with a book on the couch. My second biggest hobby is reading interesting books with an exciting storyline, historical, science fiction, or some books on my profession.\r\nI enjoy watching interesting and meaningful movies, or sometimes just comedies, intricate stories, something just about people's lives.\r\nIn my free time I am engaged assistance to animal shelter. I help as a volunteer,  just because I like to help others and especially animals. But, unfortunately, life is not always fair I am allergic to animals and I cannot live in one house with pets, the only chance is moving to a private house and to keep the animal outside, in a separate cozy house. Maybe someday it will happen:)\r\nI also like riding a horse, drinking coffee with friends (it's a daily tradition), playing billiards, bowling, table tennis, swimming in the pool, psychology, volunteer work, spending time with family and friends, also sometimes I like fast car driving, I visit local races, my favorite car is Mustang Shelby1969.\r\nI like adventures, I love to help others selflessly, I try to be a kind person, to make others laugh and I hopefully my sense of humor will stay with me forever. I am a positive and cheerful person, I like to enjoy trifles and simple things, to find good in everything. I love sincere and deep people who can empathize. I appreciate intellect and clarity of mind, I like to develop and grow in every way.\r\nI am divorced, I was married for 7 years and divorced officially last year. It's a long story, but if to put it in a nutshell, I got married when I was very young and over the years I grew up as a person and worked on myself. Unfortunately my ex-husband did not. I haven't got any children, because I was not sure that if I stop working he can provide for the family. Unfortunately my relationship ended because the man put his responsibility on me. After the divorce, I tried to find my man in Ukraine or using international dating sites, but the attempts were unsuccessful. This was the reason why I applied to the agency. I hope with the help of the agency the chance to find my second half will be higher and I will meet my very special person.\r\nWrite soon,\r\nDariya",
