    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very kind, tender and sweet. With this I am goal-oriented and responsible. I know how to take care of my closest people and friends. I am honest and respectful, my personality is calm. I like to make jokes, I have a good sense of humor. I am neat and I keep my home tidy.\r\nI am fond of photography, travelling, and cooking. I like to do different sports. Swimming and gym are my most favorite ones. I am into fashion, I like to watch fashion shows and I enjoy watching houses makeovers as I can find new design ideas for my home, too! \r\nMy future partner is kind, he is a leader in life, but knows how to be tender next to his beloved woman! He is well-organized, caring, sportive, cheerful and smart. I am looking for a loving man, with calm personality, my soul mate is generous and clever, too.",
    "girls_1st_letter_subj" => "Hi from Zaporozhye!",
    "girls_1st_letter" => "To begin with I will tell you about myself:) I am Irina, I live in Zaporizhia, Ukraine.\r\nI have got a higher education, I am a lawyer. I work in the Medical diagnostic centre as a head of legal department.\r\nMy first education is pedagogical, I used to work as a nurse in the kindergarten with children aged from 3 to 5. I love children very much, but unfortunately I don’t any of my own.\r\nI live with my mother, her name is Lidia, and she is in her 80s. My father died many years ago because of an incurable disease. His name was Alexander.\r\nI have got a younger sister Larisa, she is in her fifties, she has her own family, but we keep in touch. I have got a nephew, my sister's son. His name is Alexey, and he is in his early thirties. He is like a son to me. He is married, his wife’s name is Marina, they have got a daughter, Milana, she is a little girl. We have a very friendly family. \r\nI had been married for 6 years, my husband died because he was very ill. I didn't get married later, because didn’t have feelings to anyone. In my opinion it is impossible to build a family without love.\r\nAs my friends say, I am feminine, kind, wise, reliable and I have a creative mind. My main positive quality is my pure heart, I quickly forget all bad things, I do not focus on troubles, I don’t live with offenses in my heart, I prefer to talk with my partner and to find out what's wrong. I like to have fun, I have a good sense of humor and I am playful.\r\nI am a sensitive and passionate woman, who likes to be beautiful and dresses good, creating a complete look.\r\nI love comfort and cozy atmosphere at home, which I create with my own hands. I can cook tasty food, and I add a part of my love to each dish.\r\nI attend gym and pool. I like landscape design, needlework and I draw with a pencil in my free time. When I travel, I take photos of beautiful sights. I am fond of flowers, too.\r\nOn Sundays I visit church and thank God for what He gave to me, because the person’s soul is a part of God.\r\nI love to go to the theatre or cinema when there is an interesting play or film (kind and funny), Like to listen to music: jazz, pop and classical.\r\nIn my free time I walk outside. The nature gives special energy, earth, sun and trees nourish me with their abundance and it makes me feel trouble-free and calm. After washing my face with water from the spring, I feel new burst of energy.\r\nI love horses and elephants for their strength, dogs for their devotion, cats for their kindness, but I haven't got any pets as I work a lot.\r\nI turned to the Agency because in my opinion this is a professional approach to creation of a happy family. What do you think?\r\nWarmly,\r\nIrina",
