    "girls_1st_letter" => "Hello! I am here for serious aims - I want to make a family and to feel happy next to my beloved! I also want to have children!\r\nNow I study and work - I try to be good in all spheres of life and to reach success! I study tourism and I hope that some day I will be the director of some touristic firm or to have my own one! I find my life good in spite the fact that I don't have much free time!\r\nI like reading - especially some books with philosophical content! I like to listen to music and to travel! I hope that my profession will give me a possibility to see the world and to enjoy it!\r\nI have no children now and I was never married. I have a lot of friends and like to spend time with them! As for my character - I am a modest lady, well-mannered and educated! One can discuss a lot of things wit me! I am always tolerant to other people and I always try to help them!\r\nSo am I! Write me - it won't be boring with me for sure!\r\nSincerely, Ann.",
