    "girls_1st_letter_subj" => "Wise and gentle woman needs understanding and love!",
    "girls_1st_letter" => "Hello, dear, I am tired to be alone. I am here for serious aims and my biggest wish for now is to make my family and to have children. I have already two sons but I would like to have more children with my future husband.\r\nMy character is very simple - I like to communicate with people and to get to know something new! I think that our life is full of different events and we have to use each possibility to get new knowledge and experience! I am very talkative and people say that it is never boring with me)! I like to meet my close people and to go somewhere for a walk - it can be a park or a cafe. It doesn't matter where, I like just to be surrounded by pleasant people!!!\r\nI like to sing and do it well, I also like to dance! My biggest passion is travelling! I haven't visited much new countries but I hope I will have such a possibility in future! I also like to read books - I always try to choose some useful literature, for example some psychological literature! Sometimes I like to read love-stories - I am very much romantic in my soul....\r\nDecorating of my house is also my big passion! I think it's wonderful when you are surrounded by beautiful things!!!\r\nSo, I have many sides and I want to get to know your personality better... I am sure that it is much interesting and many-sided!!!\r\nWrite me, I am waiting for your letter much!\r\nSincerely, Olga.",
