    "girls_info" => "I am a charming lady, well-mannered and smart. I am experienced and I know exactly how to treat my future partner. I have a calm character, don't like to shout at somebody. I think that first of all people must talk and every problem can be settled up! I am wise and friendly, I am smiling and talkative. And I hope, I will find my soul-mate here!",
    "girls_1st_letter_subj" => "Maybe love is luck!",
    "girls_1st_letter" => "Maybe love is like luck. You have to go all the way to find it”, -  said Robert Mitchum.\r\n\r\n I followed his advice, went to find my soul mate on this website, and looked through hundreds of profiles, and only YOURS draw my attention. I don’t want to be all boring and make my letter dry as a cracker, so I won’t talk about how I was raised, where I studied, what my likes and dislikes are. If you feel like you are interested in me, you will ask me anything you want and I will be sincere and honest with you.\r\n\r\n%NAME%  I feel that I need to talk about my intentions though…. I am not looking for just a friend, I need a strong man’s shoulder in my life, a person who will take care of me and love me with all of his heart! Of course, you might ask me, ‘Are you sensitive and weak?’……guess what I will say……….I will say, ‘No way! I am a strong, confident lady…… but…… I just lack LOVE in my life’. I always think my fortune is playing hide and seek with me and is constantly hiding my beloved one somewhere from me……..I dream to meet family oriented man, who dreams about hapiness with right woman.  I also have a daughter. I want to have a real man by my side who is not afraid of to accept my daughter Alexandra. I truly believe that such a man is real! And this is you! Am I right?\r\n\r\nLooking forward to a reply from YOU!!!\r\nSvetlana",
