    "girls_info" => "Well-mannered, modest and friendly lady, who wants to change her life and find her soul-mate! I am dreaming about new family and want to make my future partner happy! I have a calm character, I try to understand and find approach to each person. But I also can defeat myself and my close people. I am strong but I am also very feminine, I want to see a strong man next to me!",
    "girls_1st_letter_subj" => "I just want to find my love!",
    "girls_1st_letter" => "Hello, my name is Vika! I am a happy person and live in harmony with people around and with the whole world. I enjoy every moment of my life and the only thing I want is to find my soul-mate who I can share everything with!\r\nMy character is very simple - from one side I am like a small child - everything is interesting for me, I can find something pleasant in simple things. From the other side I am an adult, responsible person who can take responsibility for other people. I was married and I have an adult son. I have grown him up alone but I managed to give him a happy childhood and now he is independent and self-confident person. He works in Kiev and I am really proud of him!\r\nIn my free time I like to visit night clubs and to go to the country-side. I like club music much but my taste depends often on my mood. I also like to read and to discover something new! I think that this life is amazing and we have to get new knowledge every day!\r\nSo, I am an optimistic and easy-going person, do you want to start our acquaintance?)))\r\nAbout myself: I am an active and positive lady, always smiling and sociable. I like to get to know new people and to discover something new! I like my life and my job, I need only to find my soul-mate in order to be happy! In my free time I prefer active rest - I like to go out, to visit my friends and to go to the cafes and night-clubs. I like reading and listening to music!\r\nSincerely, Vika.",
