    "girls_info" => "I am a very joyful, positive and active lady! I like everything new, I like to get to know new people and to communicate with them! Sometimes I like to be like a small girl, sometimes I can be very serious! I am a big optimist and I find that our life is wonderful! The only thing I want now is to share my interesting life with my partner!",
    "girls_1st_letter_subj" => "I can make your life to a fairy-tail....",
    "girls_1st_letter" => "Hello, my dear! I am a charming lady who knows well how to treat her beloved.... I am experienced and now I want to start a new period in my life....\r\nI was married and have a wonderful child who I love much. I did everything for my son and now he is an adult and independent person. We are good friends with him and I am proud of that!\r\nMy character is very easy - I am very much sociable and have a lot of good friends. I am in a bad mood very seldom - I am much positive and I give this mood to all people who surround me! I think that our life is so how we make it!\r\nI am also much self-confident, it doesn't mean that I am egoistic - on the contrary, I am very attentive to my close people, I always understand their needs. I just enjoy this life and I am so as I am!) \r\nIn my free time I prefer to go somewhere out - to the clubs, to restaurants or to cafes. I also like to go to the country, especially in summer! I like to make barbecue and to swim! But I also like passive rest - I like to read and to listen to good music! I am very much interested in psychology cause I think that it helps us to understand life and people who surround us better!\r\nSo am I - easy-going and always smiling! If you come to visit me, I will show you my beautiful city and you will discover a lot of wonderful things here!\r\nWrite me, I am waiting for your letter!\r\nYour Olya.",
