    "girls_info" => "I am friendly, sociable, positive and understanding girl. I want to find my soul-mate and to be happy next to him! It's my biggest dream for now! My character is calm, I am simple and easy-going. It's difficult to say what special characteristics I have, but I can say that it's cozy near me!",
    "girls_1st_letter_subj" => "I am a super positive lady and I want to share my mood with you!",
    "girls_1st_letter" => "Hello, dear! I am a very positive person who loves this life and tries to enjoy every moment of it! I want to share it with somebody and to find my soul-mate!\r\nMy character is calm, I don't like conflicts and I think every situation can be discussed and the way out can be found in each case!\r\nI like to smile and to laugh and I always try to be positive! I think that the life is better when we look at it smiling!) I am also very talkative and communicative, I have a lot of freinds and I adore big companies! Many people say that it's never boring with me, I always can improve ones mood!\r\nIn my free time I like to go to the country with my friends, I also adore sea! I like speed and bikes but I don't have bike because it's dangerous and I don't want to risk. I have a child that's why I have to think about it first of all and to take responsibility for it!\r\nMy son is rather adult already and I try to give him everything I can! I had a family and a wonderful husband but he died. It was a big trouble for me but so is our life. Now I am looking for serious man who will love and appreciate me. And who I will give everything I have in my big heart.... I hope much, I will find such a person.... \r\nI can also tell you that my biggest hobby is cooking. I do it well and I like much when people come to me and eat what I have cooked. So, I am a wonderful house-wife and a good mother. Will be also a good wife in future!)\r\nJust contact me and we will have a wonderful life together!\r\nSincerely, Yulia.",
