    "girls_info" => "I am beautiful and gentle like a flower, I need love and protection! I want to find a serious partner for my future and to share everything with him... I love my house, order and coziness. I adore cooking and do it very well. I am a good mom for my children and I know exactly that I can make my man happy!!! Please, contact me only when you have serious aims and are looking for real relations and love!",
