    "girls_1st_letter" => "Hello, I am Kristina and I want to be your friend! Perhaps more than a friend - the time will show that!\r\nI am a sociable and kind-hearted lady, love this life and appreciate what I have! I have a job and two wonderful children! I love them much and we are good friends. I think that I am a really good mother and I would like to have more children with my beloved!\r\nMy character is not complicated - I am easy-going and I always try to understand and to support people around me. My education is psychology and I like this profession much. That's why I am keen on psychological literature and I think that we can change our life when we choose the right way!\r\nIn my free time I also like to go in for sport and to sing! I like singing much and do it well!!! Travelling is also my big passion and I hope to discover new places and cultures with my partner!\r\nSo, I have a lot of sides of my personality and I hope that we will get good friends!!! Write me, I am waiting!\r\nYour Kristina.",
