    "girls_alcohol" => "socially",
    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very kind, my character is soft, I am patient and life-loving. I know that self-development is very important for successful relationship, as partners need to be interesting to each other always, so I develop myself. I am communicative, but not a chatter-box:) I like to take care of my close people, I am also very responsible.\r\nI am a mother of a wonderful boy, so most of the time at the moment I dedicate to him, but of course I have time for my hobbies as well, they are knitting, cooking, reading. I like to spend time outdoors, I like to visit seminars and lectures that help to develop me as a versatile personality.\r\nI am looking for a serious relationship with a man who is kind, cheerful and who loves life, just as I do. I wish my partner to be communicative, to be able to lead a dialogue. HE is caring and goal-oriented, he is reliable and responsible. I also hope my man to like tidiness, as I like keeping my home in order.",
    "girls_1st_letter_subj" => "I hope this letter will find response in your heart and you will",
    "girls_1st_letter" => "I am here in search of my soul mate, and I have an image of my ideal man, he is not flawless, but he is perfect for me. I wish to find a man who leads healthy way of life, who likes to travel and had his own hobbies. I believe that life without a hobby is quite dull, I am fond of knitting and cooking, I try to develop my culinary skills and when I have a chance I try new recipes:) I like to be outdoors and as I live in a private house I have this opportunity, but I also like to travel with my friends to the river. I like gardening and hopefully my future partner will also be a fan of this activity. Cinema and theater are also to my liking, I like opera and theatrical shows, when I go to the cinema I prefer comedies, thrillers or historical movies.\r\nI can describe myself as a kind, tender and soft lady. I like to live this life and appreciate all the opportunities it gives to me. I glad I was given this chance to find my soul mate, as in my tiny town it is very difficult to get acquainted with a decent man. So I put my profile to this website with a hope to find my ideal mate:)\r\nI like communication and I hope this trait of character can also help me to build good relationship with the help of letters at first and then to continue this during a live meeting. \r\nMy family is quite big. I have got my parents, two brothers and a sister. My son is a little boy, he likes to play with other children, to be outside and to draw. My parents own a mini-farm and a grocery shop. They are devoted to their business and support each other in every situation. There are four children in our family and we were all given the best in our lives! The vivid example of my parents' family always gives me confidence that love exists! \r\nI think I am a thoughtful and devoted mother, a good friend, a wonderful housewife and a passionate lady:) At the moment I do not work, but I have got a very nice profession - I am a lawyer. I chose this profession because I like working with people and I have good communicative skills. Though I also tried other professions like banker and cashier in a bank. \r\nI have a dream, to create my own family, where love reigns, where everyone is a support for each other and where every day there is a  chance to have new and fabulous experience! What is your biggest dream?\r\nWait to hear from you,\r\nViktoriya",
