    "girls_info" => "I am a self-sufficient person, but I feel so lonely without love and beloved man in my life. I am ready for serious relationship. I have much in life, but still my heart is lonely and no material things can take this emptiness away..I want to create a family of my own with close relationship and stable family traditions. I am caring and loving, I will support my man. He will always feel loved by me. I look after myself and eat healthy food as I want to look good for my man and to be healthy. My character is very calm and good-tempered, I am easy to get on with. I am responsible and reliable, I always do my best to smooth all the conflict situations and to live in harmony with myself and with the people who surround me.",
    "girls_1st_letter_subj" => "let's start a voyage?:))",
    "girls_1st_letter" => "Hello, my dear friend,\r\nI am very sensual, often very emotional and always have a strong intellect. And anyway, I live mostly mind. For me, there are two shrines - friends and love. I love people and thrive in the society. I can not and do not like to lie, and expect to meet the person who is honest and serious in his intentions here. \r\nI like traveling, walking and jogging. I am interested in development of myself with improving all the qualities. \r\nI am attracted to the opposite sex. But I am looking for the ideal companion for a long time and hardly make a choice. \r\nI need a man next to whom I would feel like a woman. I need to be valued and appreciated highly and in several areas: as a lover, as a hostess, as an intelligent companion, just like a beautiful woman.\r\nIf you think you will be able to treat me like that, I will be happy to get to know you! Please write me a letter, I will be waiting for it!\r\nHave a nice day,\r\nIrina",
