    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Let`s chat and get better acquainted with each other! I am very sociable, live life without drama, I am a very happy person and I would love to share my happiness with someone good hearted and kind, I am active, easy to be together with, very optimistic and sympathetic, family oriented and loving.\r\nI do read with pleasure, enjoy watching a good film either on TV or at the movies, I am sportive and full of energy. I like cooking, making my home cozy, listening to the music of different styles and yes, I love traveling and seeing new places, meeting new people.\r\nI would love to meet a self-confident, loving, sympathetic, reliable, understanding and trustworthy man, decent, intelligent, self-sufficient, honest and open hearted. A man who will surround me with all his care and will be ready to be there for me any moment of my life, willing to start a long-lasting relationship leading to a family life in the nearest future.",
    "girls_1st_letter_subj" => "Tender and caring...",
    "girls_1st_letter" => "I am Nadya )) it means in English “Giving Hope”, I am optimistic person by nature, always see everything through the good perspective, I am working as a sales manager, live in Melitopol. I have a daughter her name is Sofia.\r\nI am very family oriented woman, know what I want from life. I need a person with whom we will create harmonic and long-lasting relationship and who will be willing to be compassionate and loving, of course I will contribute equally to our relationship to make it work.\r\nI couldn`t find a man for life locally as the town where I live is very small and the population mostly is all about women and elderly people (( so here I am trying internet and registered with the agency to find my love. \r\nI have a pet at home it`s a German shepherd named Jack and he is a part of our small family, we walk together with my daughter him and spend a lot of pleasant moments playing with our dog outdoors.\r\nI am seeking for love and really believe that I will find my soul mate, let`s chat and see what may happen between you and me!\r\nI am open for a dialogue,\r\nWith care, \r\nYours Nadya",
