    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am kind and well-balanced, I love communication this is an important part of my life. I am humble and honest and I think these are rarely met among young people nowadays. I am proud of what I am. Being a goal-oriented lady I still remember about dignity, I will never use methods that are not decent to achieve my aim. I am faithful and caring and I am a good housewife, I like my dwelling to be well-organized and clean!\r\nI love reading, books help to learn more and to develop my personality. I am a book-lover! I am also into cinema-going, I enjoy films with deep sense and good plot, I do not like silly comedies) I go in for dancing and sports. I love being active, so I hope my future husband will share these hobbies with me)\r\nI am eager to meet a man who is well-educated and mature. Who is manful, strong, good-looking and has his own opinion. He is a hard-worker, but not a workaholic! He is kind and caring, goal-oriented and has high moral standards. He loves sports, life and kids!)",
    "girls_1st_letter_subj" => "My dream is to love",
    "girls_1st_letter" => "My name is Alena) I am a student of Melitopol State University of Municipal Management; I entered the department of hotel business because I like to manage people, to develop different ideas and turn them into reality. My plan is to start a network of hotels one day! :)\r\nI am living in the city of Melitopol, I live with my family in a private house. My family is not very big: my mother Lyudmila, father Yuriy and my little sister Kate. I love to spend time with my family, my sister and I love to draw together)\r\nWhen I have free time I read. I enjoy reading fantasy books, among my favorite authors are Joan Rowling and Ray Bradbury. I also love watching films, my favorite genre is melodrama. Sometimes I watch a film to relax, but I try to find the films that provoke deep thinking, that have an intricate plot and make you feel what the characters feel. Sometimes books and films teach us a lot. Do you agree?\r\nMy main hobby is dancing. I dance in different styles, but my favorite one is jazz-funk! When I perform on the stage I get so many emotions, this is a real charge of positive! I take part in different competitions and fashion shows, too! From time to time I take part in photo sessions and I truly like this! Do you like to take pictures? Or you prefer to be taken pictures of?\r\nI love animals and I have 2 pets) They are a cat and a dog! What a funny combination! Surprisingly, but they are good friends! \r\nI love travelling, but at the moment I have travelled only around my country. I have visited different cities among them are Kiev, Lviv, Zaporozhye. I enjoyed my stay in Kiev, it is a very beautiful city with fascinating architecture and places to see. It has also a great choice of shopping malls! You can find an activity to your liking in Kiev! It has a lot to offer! \r\nI can call myself a kind and brave, communicative and cheerful lady! I am always glad to help my close ones and friends. I decided to post my profile on the site because I believe that my chosen one is not necessarily in Ukraine, he can be anywhere! So I widen the horizons of my search and hope to find you, my soul mate, very soon!\r\nI have lots of dreams, but my biggest one is to create a happy family with a strong-willed, caring, kind, generous and loving man! A man, who can support me in any situation and be my second half. \r\nI am looking forward to your letter!\r\nWarmly,\r\nAlena",
