    "girls_info" => "Love means making the other happy, even from a distance. Love looks not with the eyes, but with the heart and soul. You see, I am very romantic, sensual and sensitive person. I am cheerful, kind, warm-hearted, devoted, loyal and easy-going by nature. I am genuine, sincere and family oriented, I have serious views on life and I do hope to build my future relationship, based on honesty, openness, trust, respect and mutual understanding. \r\nI like eastern dances, fitness, training; I like to lead an active way of life.  I enjoy cooking and it brings me pleasure to cook something special for my beloved ones. As for my tastes in arts and music they are vast and versatile, I like to visit exhibitions and theaters, cinema. I like to meet my friends and to go out to a nice bar somewhere near the river. I like the beauty of nature and animals, my favorite season is summer.\r\nIn life everything worth living for, and for me a good husband and family mean true happiness. Money and nice things come from business, but only love and family mean something at the end of our life. But I am serious in my search of my life partner and do hope to find him. I would appreciate him to be an interesting interlocutor with versatile points of view, strong, handsome and reliable. With whom I can feel myself being fully defended. Maybe if I can catch your attention, who knows this could be the beginning of a beautiful fairy-tail. Would you write the second part?",
    "girls_1st_letter_subj" => "Life is beautiful when you are in love.",
    "girls_1st_letter" => "My name is Anna, I live in Zaporozhye, it’s a wonderful and very nice city that is situated on the picturesque banks of Dnieper river. My life is simple and I am easy-going person by nature. I was raised in a very friendly and happy family. My parents met each other in the first form of a secondary school and since that time they never split apart. My mother’s name is Irina and my father’s name is Alexander. I also used to have a younger brother whose name was also Alexander he was killed two years ago in the street by a robber and it was a big loss for our family, I have a sister her name is Lilia and she is the youngest in our family, married to a fabulous man and has a daughter Nika, I love my relatives very much.\r\nI got a college degree and received a diploma of a professional cook, so I can spoil my beloved one with exotically prepared meals, now I do not work due to this profession, as I started to work in a small real estate company as a realtor.\r\nI have registered with the web site and I believe that with the help of this wonderful service I can find my special person, whom I want to get closer to, becoming his special friend, getting closer to his heart and meet in person.\r\nWe will develop our relationship through the correspondence first and I think we will find many things in common. Hobbies ....I like traveling very much , I had not  traveled much, but I hope that in future it would be even more exciting to take a trip somewhere being in a company of my beloved person. \r\nI have a dream to visit the most beautiful European cities, as I think, they are: Prague, Florence, \r\nVenice, St Petersburg, Paris and Barcelona!!!!\r\nI like walking, nature. I like going in the forest to find wild mushrooms.....\r\nI like reading, books on mind improvement, philosophy and history.\r\nI like reading especially poetry. I’m a romantic at heart!\r\nI like theater, cinema, and music. Sport is also one of my passions; I enjoy dancing very much, so I used to visit classes of eastern dancing three times a week\r\nSometimes when I have spare time I like watching circle films on TV my favorite is Moonlight! \r\nMuseums, castles, river boat trips are also on the list of my favorite things.\r\nIn another words I like many things. I like life!!!!!  \r\nAs for you can tell me more about your hobbies, things you like, things you will look in your woman to posses.\r\nI’m looking forward to your early reply.\r\nHave a beautiful day,\r\nAnna",
