    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am communicative, honest, articulate, loving, caring and very reliable person by nature. I am kind and sympathetic, sensitive and gentle, caring and very attentive to my beloved ones. I am very family oriented and serious about starting a long-lasting relationship leading to a happy marriage in not so far away future.\r\nI love pets very much, I keep a dog of a mops breed at home and I like walking with my dog, I like having active rest, going out, meeting with friends, reading, watching movies on TV or going to the cinema. I have versatile interests, I am well-rounded and selfless, I like to travel and be outdoors.\r\nI would love to meet a self-sufficient, well off man, intelligent and sophisticated, understanding, caring and confident, willing to change his life and being introduced to a new realities of a life inside international marriage, confident in his tomorrow, supportive, not a softy type, articulate but not wordy, smiley and happy!",
    "girls_1st_letter_subj" => "Perfect Choice",
    "girls_1st_letter" => "My full name is Ekaterina, but you can address to me as Katya or Kate. I have obtained a degree in accounting, I am economist by profession. I have been working with one and the same company for several years but since it was closed a couple of months ago I am searching for new job offers and it is not easy to find something good and worth my consideration. I live in a rented apartment and I have a dog of mops breed its name is Boris to keep my company! My family – father and mother are living in Kamenka-Dneprovskaya region a few km away from Zaporozhye. My family consists of four persons who are the dearest people in my life, father, mother and elder sister; she is 8 years older than me. Parents are still working, my sister is single and she is working as a director of an insurance company. \r\nI lead an active style of life, I enjoy going to the cinema, and I have a dream to take a romantic trip to Prague together with my beloved man. I have never been overseas, but I am certain that traveling and seeing new places is the thing for two people or a company, as it will be boring to go anywhere on my own!\r\nDo you have any dreams? Will you share them with me in your letters?\r\nI am new to the internet dating and these are my first initial steps, let’s make them together holding hands and discovering this world with new wonders it may offer for two of us!\r\nA dream can come true, when you are being supported by the encouragement of someone meaningful and dear to your heart, so, please, do not be timid to make new steps in my direction, write me and I will write you, we will have an absolutely beautiful dialogue together, I wish you a nice time of your day and will be looking forward to your news,\r\nSincerely yours,\r\nEkaterina",
