    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very optimistic by nature, and I like this quality about me, in any situation I can find positive sides and I know that there will always be a happy ending. I have a wonderful sense of humor. I love animals, especially dogs.\r\nI love reading, my favorite book is \"Master and Marguerite\". I also enjoy travelling and have been to different countries. Outdoor activities is also a great way to spend free-time, I am more into active rest. I also enjoy peasant conversations with friends. \r\nTo my mind the most important trait of character for a man is masculinity. Witt and nobleness, generosity and honesty, truthfulness and kindness are also very important characteristics. I wish to meet a man to be happy with him and to share mutual interests.",
    "girls_1st_letter_subj" => "Optimistic lady in search of love:)",
    "girls_1st_letter" => "It is my pleasure to introduce myself. My name is Vika, I am from Ukraine, Zaporozhye. I have a degree in economics and I have worked for a long period of time in a huge construction organization. I occupied two positions there: the head of HR department and the head of transportation department. But at the moment I work as administrator of a beauty salon.\r\nI was married for 22 years. Now I am divorced. You can ask why? I will answer that I could not forgive infidelity. I am what I am. I am not ideal, as all people are. May be everyone wishes to see their partner as an ideal, but no one can explain what is \"ideal\" for them. So I prefer being myself, being real and I wish to be accepted for what I am.\r\n\r\nI live with my mother in an apartment. My mother's name is Asya Ivanovna, she is in her early seventies, she suffered a stroke. Now a nurse helps me to look after her. I have a grown up daughter. Her name is Dasha. I love her so much. Dasha and I are very close. For 10 years, she has been involved in professional swimming. I support my daughter in her beginnings always. Dasha is a student of RUDN in Moscow.\r\nI have a versatile personality. I can spend the evening having fun with friends, or I can spend the whole evening reading an interesting book, but both activities will bring equal joy to me. With great pleasure I spend time with my daughter. Earlier, when I had a car I was very fond of driving. Driving soothes me, and it brings thoughts to order. Now, when I need to escape from routine I go with my friends to play bowling, or visit a sports club: a good workout, swimming in the pool and some sauna after - the negative thoughts vanish! In my spare time I like going to the cinema, to the theater, to concerts. And I love to travel. I always take a lot of photos, to have memories. I traveled to Egypt, Turkey, South Korea, twice flew to Thailand (the island of Phuket), I was in Spain: on the island of Tenerife and in Barcelona. Barcelona - is a city of incomparable architectural delight, one of the capitals of Art Nouveau. I particularly remember Barcelona for its architecture, I was never tired of admiring the masterpieces of the famous Catalan architect Antonio Gaud&#237;.\r\nI used to living in a comfortable environment, I can and I like to cook, but never make a cult out of food, cleaning or shopping. Why I decided to register with the agency? I want to find a good man, who later will become my beloved and the only one, in whose eyes I will see happiness and understand that this is what we created together.\r\nWith respect,\r\nVika",
