    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a cheerful brunette, with a positive look on life, energetic, reliable, loving and caring. I am a mother of a wonderful boy. I own a business, it is a small boutique with unique brand vintage clothes. I am a very artistic person, I love to help people create looks that will emphasize their beauty. My lifetime dream is to design clothes:)\r\nI enjoy travelling, but the best trip is the journey with your beloved person. I love romance, pleasant music, nature, pets. Fashion is not only my profession but also my hobby. I study vogue magazines, latest trends. I am also interested in cars, I read articles on them and love to drive.\r\nI wish to meet a strong-willed, cheerful, self-sufficient man, who wants to find love of his life, who is ready to love a woman with a child, who is not afraid of being responsible. He will be my champion! It would be nice if we had common interests.",
    "girls_1st_letter_subj" => "A Woman of your dreams",
    "girls_1st_letter" => "Good day to you!\r\nMy name is Antonina. I wish to tell you what my name means, and I hope later you will find out that this is true:) Antonina - is a roman name meaning \"cheerful and kind\". I had a wonderful childhood, family values are always in the first place for me.\r\nMy parents were chemists, so I obviously entered a technical faculty. But life brought its corrections and I tried different professions. Now I am an owner of my small business, it is a vintage shop of brand clothes. \r\nMy family is very small, just me and my son. He is my closest person. My son's name is Rinat, he is a school boy, an intelligent, smart and creative boy he is! He is really into biology and Information technology.\r\nWe have got a pet, it's a cat:) \r\nI am an active lady, one of the brightest memories of my life is the moment when I tired skiing for the first time - unforgettable experience! I had opportunities to travel to different countries: the USA, Israel, Hong-Kong, France, Italy, Austria, Seychelles, Mavriki. I was impressed by Italy and Israel most of all! These places are unique!\r\nI have other hobbies too, I can and love cooking, reading, sports.\r\nAt the moment, I haven't got love in my life, this is why I decided to turn to the agency - to find the man of my dreams, a person who will be my second half. I am in active search of my happiness, unfortunately I lead a lifestyle that mainly involves communication with women, so I put my profile here, to have a chance to meet you:)\r\nWrite me if you wish to be loved with all my heart...\r\nSincerely,\r\nAntonina",
