    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "My horoscope sign is Leo, and I am a Rooster according to Chinese Zodiac. I am an ordinary woman, who is well-balanced and kind. I am natural and interesting to be with, I am not intrusive and I don’t like such people. I am feminine and communicative; I am able to understand my man at a glance! \r\nI am a good housewife, I love creating comfort at home, and in this my flowers in pots help me! I enjoy this hobby and my flowers are always pleasing me with their vivid blooming! I love to watch different sport competitions and to read books. I cook deliciously! Knitting is another activity that brings delight to me!\r\nI would be happy to meet a man who is attentive to his second half, who is caring and generous, understanding and reliable, who is serious and treats his family as the biggest treasure in the world. He knows how to love and appreciates love that is given to him!",
    "girls_1st_letter_subj" => "Love that will last forever",
    "girls_1st_letter" => "I am sending you my letter from Ukraine, Zaporozhye city. My name is Tatiana and I was born and grew up in this region fabulous and very calm place with absolutely fantastic nature and friendly people. Since childhood I loved everything beautiful and desired to create something nice to those whom I loved. I got married in 1977 and got divorced in 1993, my former husband was a very good man, but fell out of love with me. And we decided to live apart, I have three children, all of them are independent and have their lives. I worked all my life long in a bank sphere and achieved quite good post but now I am a pensioner and stay home. I spend my time doing handmade work such as knitting, cooking, taking care about my grandchildren. I think that I deserve to be happy in life and not lonely, that is why I decided to come to the marriage agency keeping in mind that I should meet a reliable and honest person with whom we will live happily as long as destiny decides.\r\nI have not traveled much, since my life was rotating in prior years around my family and children, of course as a good mother and proper wife I was very dedicated to my dearest ones. Once I went to Egypt, where I was sent to a conference from work, and I was surprised and really touched with the outstanding beauty of this foreign country. \r\nI am very easy person by nature, I love life, and I can appreciate good things, I am selfless and always ready to help, I love music, cinema, spring, sunshine, summer rain, sea, roads, culture of different countries, learning something new every day. I also fond of photography. I am just normal, ordinary woman, very well educated, balanced, patient and forgiving.\r\nMy dream is to fall in love again and to give all my tender feelings to only one person, creating a cozy home atmosphere, treating him with good meals and properly looking after his health. I wish to be happy….\r\nIt would be my pleasure to talk with you, write me a letter and I will answer!\r\nTanya",
