    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am joyful, purposeful and active person by nature, I believe in myself and love life in all its manifestations. I believe that a person maybe happy when enjoy today and doesn`t wait luck tomorrow, this statement is all about me! |I am family oriented and very compassionate, understanding and warm hearted.\r\nI have a great job, which I consider to be my hobby too, I am interested in vogue, like to learn something new about hair styling, I love arts. I live in a cozy atmosphere and I like to do hand work. It is really good to travel and see new places and people, I like simple things in life. I have many friends and spend some time together with them.\r\nI wish to meet a kind, intelligent, joyful, hardworking man, who is ready to start relationship, who likes life, and has strive for sports, who is interesting interlocutor and knows how to spoil his lady. I wish he would possess a great sense of humor and has an aim - to have a family of his own.",
    "girls_1st_letter_subj" => "Best Choice!",
    "girls_1st_letter" => "It`s my pleasure to introduce myself, my name is Ekaterina. Let`s get better acquainted with each other! Probably I will start my story with things I do for life, as anyone has its own profession, I have the diploma of an accountant, but my profession is completely different, I am a hairdresser. I think it’s the best job in the world for me. It brings both delight and good income. I like working with hair, cutting, brushing and giving the best shape and color to it. I like to help people change their style and appearance and I am absolutely happy to see their smiles when they take notice of the result in the mirror. Making my clients happier brightens up my life. I also like the fact that my occupation helps me to meet new people who are absolutely different.\r\nI can say that I try to develop myself every day, to be a real professional you have to polish your skills from day to day, you have to master new techniques and enlarge your knowledge. The process of learning is endless. The best way to study something new is to attend seminars and master-classes. I like improving my skills, and I won’t stop where I am.\r\nI live in Zaporozhye, in my own house together with my daughter. My daughter’s name is Ann. We’ve got a pet, it’s a cat and her name is Effie. We all get on really well; we have a peaceful and cheerful life.\r\nMy parents live in Melitopol, it’s a town which is about 130 km away from Zaporozhye. My mother Irina used to work as a kindergartener, and my father Vitaliy used to work as a builder. Now they are retired.\r\nMy daughter has just finished school and entered junior technical college, the faculty of design. My daughter can draw really well; she even organized her personal exhibition, and sold several pictures. She has a very creative mind, and lots of ideas to bring to life. She likes the nature, travelling and animals.\r\nMy daughter and I have lots in common. We like cooking together, especially something new. When we try some new dish in a restaurant or caf&#233; we try to cook the same dish ourselves. We also go in for fitness together. We adore walks in the park; it’s a fortune that we live near a beautiful park “The oak grove”. \r\nThe best time for me – when my house is full of guests. We gather in my spacious kitchen, eat delicious food and discuss new films or books.\r\nI have been to several countries and I can tell you that all of them impressed me a lot. Bulgaria is a European country with developed recreation system; you can always find something to do and to see there both in summer and in winter. You can feel delight watching picturesque sceneries and sea-views; you can watch the sun raising over the mountains…It’s an unforgettable sight. I also visited the churches there; I have never felt so blessed before… I had lots of fun in Turkey and Spain, too. The rest was perfect. I can say that all my life consists of unforgettable memories because every day has something unique in it.\r\nI am a very inquisitive person, I have lots of hobbies and I try to devote my time to all of them. I like to adorn my house with handmade decorations. I like creating something with my own hands and I think I am good at it. \r\nI decided to go to the agency because I want to create a family and to live in harmony and happiness. I am a kindhearted, sympathetic and responsive person. I like punctuality and tactfulness in everything. I like unselfish people. My goal for the nearest future is to build new and firm relations with a nice and beloved man. I hope my future will be bright and rose-colored together with a man who has high moral values, who is outgoing, kind and educated.\r\nI will appreciate your reply to this letter!\r\nTake care!\r\nEkaterina",
