    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am kind, communicative, thrifty, loving, caring, very tender and kind hearted, well-educated, posh and classy woman. I know how to treat a man, how to make him feel loved and special in all ways. I am a very family oriented person by nature, ready to start a relationship leading to the marriage in the nearest future.\r\n\r\nI like to communicate with people, enjoy making design, I can sew well and I like stylish things. I like pets and I like nature and beautiful places, get positive emotions from taking distant journeys along my country or visiting some other places. I read a lot and watch movies with pleasure, try to stay fit and well organized most of the time.\r\n\r\nI would love to meet a decent, family oriented, trustworthy man, who knows the value to a good relationship, who cares about his partner, who is able and willing to see the beauty of the world through the eyes of his beloved woman. I want my man to be active, well-off, confident in his future, ready for serious communication with a good hearted woman, who is looking for commitment and family, well-read and intelligent.",
    "girls_1st_letter_subj" => "My Man, are you here???",
    "girls_1st_letter" => "Thank you for your time, I would be happy to enter upon acquaintance and interesting correspondence through letters first and then hopefully we will find even better ways of keeping dialogues making our personal meeting the aim of the starting conversation.\r\nI would like to say a few things about myself here, I have almost everything in my life and it is the right timing for me to think about making a family what do I mean here are: wish, time, energy, good health, genes and grace.\r\nI live in Zaporozhye – it is an industrial city with many factories but it also possess sights such as Khortitsa Island, the place where Zaporozhian Cossacks have erected first fortress (Sech) turning it into in an independent state. Dnepr River divides Zaporozhye in two parts, but bridges keep them united, there are almost no traffic jams in our city so, one may live, enjoy and have rest here.\r\nIt is only due to my parent that I had anything I would wish for…I am not the only child in my family, I have a younger sister, but this story will follow…\r\nMy father is a prosecutor, many respect him and I am proud of him. My father has inculcated such qualities as purposefulness, persistence and almost always I reach the targeted aim and bring every matter to an ending. I am a lawyer by profession and it helps in many aspects of life, the understanding of legal system and laws gives confidence in my actions and understanding the responsibilities connected with current events. I go to seminars of improving and upgrading my professional skills annually. I was rewarded with diploma in 2011 “The Best Lawyer In Economic Law”. I know that my relatives are proud of me.\r\nI have inherited kindness, patience and many good talents such sewing, cooking, knitting from my mother. My mother has degree in economics, but nevertheless she was working she has been always keeping the household, making our place cozy, my parents live together more than for 30 years, they are taking care about the house which is located in the city suburbs, where they have a garden and grow vegetables, fruits and flowers. Motherly warmth is always inside our hearts.\r\nAs I have mentioned prior I have a younger sister, she also has a degree in legal sphere, so it is a family business. My sister has a wonderful daughter Veronika and a loving husband. I like to share my time with my family.\r\nFamily values should be similar inside the couple, this gives two partners to understand each other better in this world and look at life in common way.\r\nI hope you will write me and I wish you a wonderful day, I will be happy to tell you more in new letters which will follow soon when you will try to give me a sign that you crave interest in getting to know me better,\r\nYours Sincerely,\r\nOlga",
