    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I love life, I am young and feminine. I love my job and I highly value family, I know the importance of a cozy home atmosphere and I can create it. I never pay attention to negative things, I see only positive and continue going forward, to the better future and happiness. \r\nMy interests comprise sports, I like fitness, cycling with sons and playing active games with them. I also like to read, to listen to music and to create handmade decorations of all kinds. I enjoy cooking and try to experiment with dishes. Spending time with kids is precious I enjoy this a lot!\r\nI am looking for a man who is brave, manly, self-sufficient and who loves children. I wish to find a man who knows how to love, who is faithful and reliable, with a wonderful sense of humor, generous, attentive caring and decent.",
    "girls_1st_letter_subj" => "With love",
    "girls_1st_letter" => "I would like to introduce myself to you, I am Svetlana, from Zaporozhye. I am cheerful, honest  and reliable. I would like to tell you about my life and my closest people.\r\nI am a mother of three wonderful sons, my oldest son is Yegor, he wants to be a cook on the ship, so he has entered a college of water transport. His interests are cooking, drawing and travelling, so hopefully he will be able to combine all of them in his future profession. My youngest sons are Arthur and Andrei, they are still school boys, they both are interested in classic wrestling. I like to spend time with my sons.\r\nWe all live in a flat, which is located in a wonderful district of our city, with lots of parks, stores, entertainment centers and other facilities. Not far from it there is a swimming pool, where we can go when we have free time. We have got a dog and enjoy taking it for walks. \r\nI am into fitness and try to lead an active way of life. I enjoy listening to music, reading historical novels, cooking, going to the cinema and theater. I have a wonderful job - I am a tailor and work in a local atelier \"Seamstress\". This is a profession that will never be boring for me - I apply my creativity, I communicate with clients and help them to find the style that will be the best for them. I enjoy creating new clothes, I can say that I fulfilled my childhood dream - to be a designer and a tailor. \r\nI still have another dream - to be a wonderful wife, to create the family with a man who is decent, manly, self-sufficient, intelligent, generous and who has a great sense of humor. I am open to this new relationship, I wish to have a happy family, to give my warmth and love, care and attention to my only one beloved man. I wish to trust and to love him!\r\nI decided to turn to the agency because I am serious in my intentions, I do not wish to waste time I am ready to become a wife for the man who likes me, who can make me happy. I am here not for endless correspondence, but to start a new life! A life full of love and happiness!\r\nSincerely,\r\nSvetlana",
