    "girls_info" => "I am very kind and jolly person by nature, very communicative, purposeful and open to the world around me. I am registered with the marriage agency site with genuine desire to meet my soul mate and partner for long-term relationship. I am family oriented, trustworthy and honest. \r\nI like to spend my time with friends and family members, I love outdoors activities and may be happy with a cozy evening at home with my beloved man, I love visiting cinema, theater, listen to different types of music. I am a good cook and very hospitable. I have a dream to learn to be a professional masseur it will allow my beloved ones in my family to feel healthier and better.\r\nI wish to meet a reliable, honest, loving and understanding man who is not afraid of challenges connected with building an international relationship. I wish him to be decisive and able to solve any life problems easily and calmly, using his intelligence, professionalism and self-confidence. I want to create a loving and strong bond with my man and have a happy family.",
    "girls_1st_letter_subj" => "Great lady:)",
    "girls_1st_letter" => "I am happy to introduce myself, please, read this message from me and let me know if you like what you see in my profile. I am humble, sexy, loving and very compassionate lady. I have a nice education I have graduated from the medical University and became a nurse. Since childhood I was dreaming of helping people and being a doctor. I have a small but very friendly and happy family my parents live in Zaporozhye where I was born and have lived all my life long. My marriage was not the worst but after giving birth to my son and certain years together with my former husband we grew very much apart our interests were different and views on life too. Eventually we decided to get divorced, since none of us was happy inside our marriage. \r\nI am in such an age when I can achieve yet a lot of things, I am ready and able to love, I wish to have a connection with my future man on all life levels. I wish to support him, to inspire him and be near through thick and thin...does it sound naive? I think now! I follow traditional family values and I appreciate bond that is keeping two people together, I will always be there for my man and will never betray his feelings. Please, write me if you really wish to have a mutual future with me,\r\nWith sincere wishes,\r\nSvetlana",
