    "girls_info" => "I am a very kind person, I try to help all the people who need it and I love animals! I have a small child and it's my biggest love now! But of course I am dreaming of a good and reliable partner who I can spend my whole life with!",
    "girls_1st_letter_subj" => "Serious and responsilble lady is looking for her soul-mate!",
    "girls_1st_letter" => "My dear, do you want to get to know a serious lady? I have a big experience in life and I appreciate what I have. I have a good job and I can say that I am hard-working. I am very much responsible and I take responsibility for my parents and my little daughter. She is my real treasure and for me she is the best child! She is very small now and I spend all my free time with her! For a pity her father has left us and we live alone. Now I want to make my own family and to make my beloved happy!\r\nMy character is very quite, I like to be at home, to read books and to communicate with my close friends. I can say that I am modest and I find this quality good for women! For a pity not many women are so today. I don't like crazy parties and noisy people, I like nature and love my house!\r\nAs for reading - I prefer books in philosophy and psychology, I find it very useful for life! All my free time I try to get some new knowledge and to develop my personality. I would like to travel and to see new countries, but for a pity it's not possible now.\r\nBut I hope I will manage it in future and my dreams will come true!\r\nI am waiting for your letter much! Your Vera!",
