    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a very positive person by nature and always see good in people around me, I am very open hearted and caring lady, I know what I need to be happy in life – I am here to find my soul mate and I am sure that I will succeed. I am family oriented and very compassionate, intelligent and naturally beautiful.\r\nI love to live an active style of life, I enjoy sports, can play chess, and receive pleasure from dancing. I like to spend my time outdoors hiking, traveling and meeting with my friends. I can support my partner`s interests for instance I do not mind watching a boxing or wrestling programs on TV. I like cinema, theater and music of different types. \r\nI would like to meet a serious, direct and honest man, trustworthy and family oriented person, who would love to have a strong bond and long-term relationship. I wish he would appreciate loyalty and compassion, would have a good sense of humor and could deal with any problems without fear, would be willing to meet with me in person preferably inside the Ukraine.",
    "girls_1st_letter_subj" => "Fall in love with me...",
    "girls_1st_letter" => "I am Yana and I have sincere desire to start our correspondence, that is why you have received my message))) I would love to get better acquainted with you and here I wish to tell you a few things about myself in idea of offering you my introduction. I am well-educated and intelligent lady, I have a diploma in the legal sphere and I am a jurist by profession. My family is friendly and happy and I dread to have a family of my own and this is one of the reasons why I have decided to get registered with the marriage agency web site. I consider that love doesn`t know the boarders and we have to look at life positively and receive anything what is offered us by our destiny with gratitude. I respect people`s opinions and I am a good listener, I am avoiding sharp angles and harsh conversations I am not a judgmental by nature, I am very calm and soft. I have genuine desire to meet my beloved man using this web site. How did I hear about this platform? My friend just recently got engaged with a man from Poland and they have met each other in the same way – they were in correspondence and liked each other yet while they were writing letters to each other. When they met in person they understood that it was love from the first sight – when my friend was retelling me her story I even got goose bumps on my skin…so romantic and touching it was! I also would love to experience these tremendous feelings of falling in love and being in love with my soul mate, I wish to have this fabulous and special life term relationship. I am not afraid of challenges and ready to be patient and understanding, I will support my man in all his endeavors and will be happy to make his life more beautiful decorating it with my presence inspiring him and giving him all my love unconditionally.\r\nPlease, ask me questions, tell me about yourself, I will be looking forward to read from you very soon!\r\nHave a lovely time of your day,\r\nYana",
