    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am tender, sweet, loving, caring and happy person by nature. I am willing to share my life with a decent and reliable partner who will become my bosom friend and partner for life. I am eager to start a long-lasting relationship, which will be based on fidelity, commitment and unconditional love.\r\n\r\nI like sports, traveling, going to new places and visiting interesting sites. I like to read and to watch educational programs on TV, going to the cinema and theater, visiting concerts, I like listening to the music, it can popular or jazz, sometimes classical. I like to cook and to take care about the home.\r\n\r\nI would love to meet a pleasant, decent, intelligent and trustworthy man with a kind heart and genuine wish to have a family of his own with a woman like I am. I hope that he will be generous and financially secure, able to provide for his future family, ready for serious relationship.",
    "girls_1st_letter_subj" => "Choose me!",
    "girls_1st_letter" => "My name is Oksana, I am divorced and I am raising my dear daughter by myself.\r\nI have a high education - I have finished the university and have received a diploma in psychology.  Psychology has always been an interesting subject for me as I enjoy to communicate with people and to understand their nature in a deep way.\r\nNow while educating daughter in her teenager age it is easy for me to understand her, taking age into consideration this turned out to be very interesting.\r\nI used to live in Kerch city – between two seas – the Black one and the Sea of Azov. Kerch is one of the most ancient cities in the world. On its territory there are lots of historical and architectural monuments, which belong to different epochs and cultures. Now, because of my work I am living in between two countries and two cities, I am traveling to work from Kerch to Zaporozhye and spend there a lot of time in rehabilitation center for the people who have gone through the turmoil of recent events started in the Eastern part of Ukraine. I work with them as psychologist and make sure they come back to normal way of life after their participation in ATO.\r\nWhen I am in Kerch I live with my daughter in the three roomed apartment. \r\nSpeaking as for parents my father passed away certain time ago, my mother Valentina has been living for the past several years in Italy. She got married to Italian man.\r\nI have a brother Peter – he is in his thirties. He is married. He works on a ship thus he spends lots of time working in the sea. \r\nI am raising my daughter – Diana she is attending college. We are very close with her. She studies well and likes animals. She used to go into the dancing studio in the past and attended tennis lessons, when now she goes in for fitness and takes hairdresser`s classes. \r\nI consider myself to be an all-round person. I like to cook; I prefer sea food as we used to live on the sea coast we always had a huge choice of fish. I like Italian cuisine. I like pets very much I have two of them – a cat and a dog. We go to the cinema together with my daughter and my friends quite often. During the summer time we spend lots of time on the sea beaches as they are close to our home place. For more than 10 years I have been going in for sport and I cannot imagine my life without it.\r\nI have been abroad and visited only two countries. We went on our vocations with daughter to Turkey and several times I visited my mother in Italy. I enjoyed the whole atmosphere inside Italy very much, especially Venice. I remember how we strolled along the San-Marco square and went for a row on the gondola.\r\nWhen I lived with my parents our family was very close. My father was a military pilot and he frequently took me to the airfield, where he used to show me his plane on which he was flying. We went on picnics I always recollect this time with deep warmth in my heart!\r\nI think that I am a kind, decent, feminine and self-reliant!\r\nI have applied to the dating agency, because I want to begin a new life in a new country. I believe that I will meet a good man for the further life who will love my daughter and me, we will have a friendly and happy family together!\r\nI want to see a faithful, reliable, generous, kind, smart man who has all-round interests by my side. \r\nI believe that I will meet a man like this and I will definitely make him happy! \r\nWith best wishes and hope for our further communication,\r\nYour Oksana",
