    "girls_info" => "I am a pleasant lady, friendly and sociable. I have a strong character and have made a good carrier. I am family- and goal-oriented, experienced and kind. I know exactly how to make my partner happy! I am very many-sided and my life isn't boring! My biggest wish for now is to make a happy family and enjoy each monent of happiness with my beloved!",
    "girls_1st_letter_subj" => "I am looking for reliable and sincere man!",
    "girls_1st_letter" => "Hello, dear! I am a serious and reliable lady, who wants to create a happy family! I am a many-sided person, who is very much romantic and loving, and from the other side has a strong character, can protect and defeat her family!\r\nI have a leading position in my work and have reached success in life! I work hard and try to do my best for my son and parents! I love and appreciate my family much! Family values are on the first place for me! From the other side I am very feminine and romantic - I like to go to the country-side and I adore sea! I love children much and I love animals! Especially I like cats! I also love my house and I have a lot of plants at home! I think that home is the main place for each woman! I am on this site because my dream is to find my beloved! I have loved already and I had a husband. Now I am divorced and I want to start everything from very beginning! It's very much important for me! So, if you are looking for sincere, loving and reliable woman next to you, write me!\r\nSincerely, Natalia.",
