    "girls_1st_letter_subj" => "Tender and sophisticated lady is looking for a partner!",
    "girls_1st_letter" => "Hello, I am a well-educated and well-mannered woman, looking for a true partner, who can understand and support me! Of course I believe in love but I don't look for a big passion - I just want to find a good friend and a reliable person who will be next to me in good and bad times! The other things are not so much important for me! I am a psychologist and I really can listen to people and hear them, support and understand! I am keen on sports, I like to visit cafes and restaurants. I also have a lot of friends and adore spending time with them! In summer time we often go to the country, to the sea-side! I also like pets and I collect spoons from different countries!\r\nClassical music and theatre are the things that are important for me - I think art makes our life better! I read good books and some psychological literature with great pleasure! I am very sociable and I am opened to all new things!\r\nI already have experience in family life and I know how to create a happy family!\r\nSo, write me, you will never regret that!\r\nSincerely, Zelya.",
