    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very caring, kindhearted, attentive and joyful person by nature. It is always easy for me to find a common language with any person. I look positively on life. And I never take things for granted. I value sincerity, openness and frankness.\r\nI like nature, sports and travelling. I have been to Europe; Belgium and Italy became my favorite places for holidays. I enjoy visiting cinema and theatre as well. Music is also a great way to relax after a working day. Every activity that brings delight and positive emotions is welcome!\r\nI would like to meet a man to create a loving relationship and build a family; I wish my partner would represent the following traits: kindness, care, honesty, attention, ability to understand and listen, who is sincere and enjoys life as it is",
    "girls_1st_letter_subj" => "Let’s enjoy life together…",
    "girls_1st_letter" => "My name is Nadezhda and I have two wonderful children. My daughter’s name is Darya and my son’s name is Daniel they both go to school. I’m a nail service master; I work in the beauty shop. My mother’s name is Larisa, she is a pensioner. My Dad passed away. I also have an elder sister; her name is Zhanna. She lives in Belgium for several years already; she is married to a Belgian man. Her son also lives in Belgium, he is married and has a child already. I’ve been married but now I am divorced.\r\nI have a wide variety of hobbies. I like pop music, whenever I have a chance I go to concerts. I also like to go to the cinema. Actually I do not have a lot of spare time, but when I have I like to spend it in the countryside with my family and my close friends. I like active pastime; I like to go in for sports, I like swimming. My schedule is rather tough, I spend most of day at work; I also have to take care of my children and do all the household chores. I do it all by myself, and to be frank I have no opportunity to look for my soul mate in real life, that is why I decided to turn to this dating service.\r\nMy ideal man is a reliable and open-hearted man, who is able to take care of his family and whom I can trust in every single life trifles. I’m very caring down-to-earth woman, tender, loyal, and I’m ready to follow my man to the end of the world. My ideal family is a partnership of two people, who trust each other, who face all the challenges together. I do not care neither of education or career of my future husband. What really matters for me is that my second half should be a reliable and honest man, a man whom I can trust my life. \r\nFor the very beginning I think corresponding and video chats through the site is ok; when we both decide that we can make a match, I’ll be glad to meet my man in my home city to get acquainted face-to-face. Unfortunately I do not speak any foreign languages.. Of course I studied English at school, but since I have never used it I forgot it. But I’m willing to study foreign language, as I want to speak the same tongue with my future husband. I still believe in miracles; and I sincerely believe that I will find my soul-mate here. Write me back and let’s start our acquaintance :)\r\nWith care,\r\nNadezhda",
