    "girls_english_proficiency" => "fluent",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am compassionate, kind, soulful, jolly, tender, warm and gentle person by nature. I look at life optimistically and see positive things in everything, I have a great sense of humor which helps so much in life, I am intelligent and communicative, attentive and caring, I am here to meet my soul mate and partner for love and life.\r\nI love cooking, I lead a healthy lifestyle, I enjoy listening to a nice music, I can`t say that I can listen to anything like rap or heavy metal and rock, one more passion of mine that is traveling and discovering the world around me, also I love interior design and handicrafts, I am good in floristic.\r\nI wish to meet a man, who knows what he needs in life, confident, loving, intelligent, able to understand and support, strong and purposeful, selfless when it comes to his family and relatives and compassionate, willing to have a loyal relationship based on love, fidelity and mutual trust, leading to a happy marriage in future.",
    "girls_1st_letter_subj" => "Faithful and sincere lady",
    "girls_1st_letter" => "When you will be reading this letter you will learn a little more about my life. I was born in village Burchack, where I lived since birth till my graduation from school, my parents still reside there. After school I have entered a pedagogical university in Melitopol and got married in 2005th, in 2007th I gave a birth to my child, a daughter her name is Sofiya. I got divorced in 2013th, because we couldn`t find common ground on many aspects in life, it just happened and I do not regret that I remained without my former husband. I have lived together with my parents till the 2016th and in spring of 2016 I decided to relocate again to Melitopol, my daughter entered gymnasium and learns foreign languages while I am combining my work at school as a teacher of foreign languages and literatures and also a managerial work dealing with online shop. So this is how my life was developing within the past few years. \r\nI am a positive person by nature and love life in all its manifestations, I spend my free time together with my daughter, we are going for walks in the park, my daughter likes different activities, she always joining me in my trips, for instance we have explored Carpathian mountains in the past I used to visit Crimea together with my parents. Of course there is a lot of dream destination I am willing to go and see personally, for instance I want to go to London, Paris or just fly to Australia, my childhood dream to go to Cyprus! And what are your dreaming about? \r\nI love nature and bicycle trips, I go to the gym and do work outs regularly, my daughter and me like to do different types of handicrafts, for instance embroidery or creating different toys and things from paper and sometimes beads. I am not a professional artist, but sometimes I draw anime, I wish to learn arts in future, maybe attending a school or courses. My daughter is good at painting flowers and dresses for dolls, she is willing to become a designer or a detective, because is fond of different types of TV shows and films, thrillers and detective stories…Another weakness of mine these are flowers, I adore them and also I love cooking and invent new dishes surprising my parents and friends with something delicious and yummy.\r\nSpeaking about my family I have a mom and dad (they reside in the village not far from the city and when we have time we go to visit by them) village is a village and there you may enjoy nature, fresh air, BBQ, plenty of people familiar to us since childhood) I also have an elder brother he is 2 years older than me, he has a family and a daughter, we are very close inside the family and always ready to support and listen to each other`s problems.\r\nIf you ask what kind of relationship my daughter has with her father to my huge regret this person has left our life for eternity, I deprived him from custody by law since he was not willing to support my daughter and rejected to pay alimony, for the past five years I have no idea where he is and what he does with his life. He will not be able to stand in the way of my daughter`s happiness and if I am lucky to find my man I am sure that we may relocate to live to a different country and to make this happen I will not need to wait to get permission from my former husband which is a big bonus!\r\nOk, this letter turned out to be quite a novel, I hope you are not slumbering yet sitting in front of the screen)))) I will write you more, but hope to hear from you and read something about your life, until soon!\r\nAlesya",
