    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "Attractive, loving, good natured and balanced lady, very communicative and open hearted this is how my friends would describe me. I am very hospitable and a good cook, I like to keep my home cozy and clean, I value attention and know what true feelings mean, I am here to meet my soul mate.\r\nI do ikebana, I can knit well, also I like to sew and do embroidering. I am a voracious reader, my favorite literature is classical French and Russian though I love modern trends and enjoy good movie. I like music, and it can be anything from R&B to classical and rock. I like traveling and see new places, exploring sights and beauties the world offers to the grateful admirer.\r\nI have a great desire to meet a loving, caring, trustworthy man, with beautiful soul. I would love to make friends with him and to allow our interest turn into mutual long-lasting relationship, I would appreciate if he would be leading healthy life style, could be attentive to the needs of his mate and would allow me to be me in his company.",
    "girls_1st_letter_subj" => "Honest, real, loving… ))",
    "girls_1st_letter" => "Thank you for dropping by my site. My name is Olga; I am single, well-mannered, loving, caring, understanding and trustworthy person by nature. This is what my family members and friends may say about me. I was raised in a loving and friendly family, where my parents lived till the end of their lives together and enjoyed the happiness of bright marriage. I have a younger brother and he has two beautiful kids Michael and Mary, we are close with him, but do not see us very often, because of the hectic working schedule that he has. He is working as a dentist.\r\nI used to work as a junior school teacher, loved working with kids it was my calling since youth. I do not have children of my own. I am communicative and very sociable person balanced and tend for harmony in everything. I am a great cook and I love doing things with my own hands, I am good at knitting, sewing and ikebana. \r\nRight now I am residing in Warsaw in Poland, where I am working for a family as a housewife, so if we will get along with each other and see the possibility to create our mutual future, we may meet in Poland or elsewhere in Europe after we will get better acquainted with the help of our letters using this fabulous web site.\r\nTo my mind individuality is important in every human being; only being unique a person can achieve something in life. I always tend to wish to achieve more, I like to learn and I am ok with a time spent in noisy company of friends as well as spending it at home reading a book. When I need time for myself I usually go to Khortitsa Island just to walk there it is a splendid place in Zaporozhye. \r\nWhy am I here, looking for my soul mate? A very good question,  probably I know that my beloved man is somewhere there living far away from my motherland and simply waiting for me to get in touch with him… What if it is you and you are reading the lines of my letter already by now?! As a charter member, please allow me some observations. Endless messages, flirting, and picture exchanges are just that...endless. They serve no purpose on this web site. Silly mail responses just for the sake of being able to stroke your keyboard are also just that...silly. And, unless I am terribly mistaken, this site was not set up to be a feeding ground for those who are addicted to instant messaging. If I contact someone, I am truly interested in that person. A pleasant \"no thank you\" does not make you a horrible person and I will survive the ordeal. I will be disappointed but, I will survive. Please trust me. This dating site can be a wonderful experience for all of us if we are here for the honorable reasons set forth and fostered by this website. I wish all of us the best of luck, wonderful meetings and many happy days. And certainly expect for an answer…\r\nUntil then, truly yours,\r\nOlga",
