    "girls_info" => "I am a cheerful lady, kind and communicative. I believe in true love and I wish to find my man here. I am serious about creating loving and caring family. I always choose positive way of thinking. My friends say that I am reliable and honest.\r\nI like to spend time with my dog - it is Labrador, he always charges mw with positive energy and cheerfulness. Every weekend my son and I go to cafes and cinema - it's our tradition. I also like reading and listening to music, I do jogging and keep fit. \r\nI think I need a man who is reliable, kind, serious and caring. He also loves pets, he leads a healthy way of life and likes children:) My man is attentive to me and patient, he is wise and cheerful, he is laborious and humorous.",
    "girls_1st_letter_subj" => "Charming Lady",
    "girls_1st_letter" => "I am very pleased to have the opportunity to introduce myself to you. My name is Galina. I live in the city of Zaporozhye, Ukraine. I can say that I am the most extraordinary creature that God could come up with:) I combine such qualities of character as intelligence and sensuality, emotionality and modesty, balance and impulsiveness.  The thing that unites these qualities is my excessive charm and brilliance of the eyes. By the way, my eyes can smile. When I experience a feeling of joy and inner harmony - my eyes smile, and when I am sad they lose their radiance.\r\nAt present time I am a graduate student at the Railway Technical University, since I work as an assistant manager in \"Ukrzaliznytsia\" - Ukrainian railway, I have to raise my category and right now I am studying to get master's degree. My specialization is \"Passenger service\". My first education is in the specialty of \"Engineer-mechanic\" but decided to continue my studies, because I like to improve and develop myself. In addition, education contributes not only to development, but also provides an opportunity to get acquainted and make friends with new and interesting people, to share professional ideas, help each other in the same field of activity. I hope to defend my master's work successfully and move to another position. Wish me luck!\r\nI have a big family. I live with my parents. They are retired, but are still active and prefer to work. I have got a son. His name is Spartak. He is a school-boy. My son is a fan of football, although he does not play it himself, because we could not find a good coach or a football club in our city, but he knows everything about football! Spartak is also fond of boxing and goes in for Thai boxing several times a week. I also have an older brother he is married and has got a son. \r\nAnother member of our family is a dog - Labrador Retriever named Chocolate. This is a very smart and playful dog who brings my family a lot of joy and positive energy. When I have free time, we spend it in the open air, and when the weather is bad, I like to read books. I read different books, beginning from Russian classics to psychology or esoteric literature. \r\nMy son and I try to spend as much time as possible together. We go to the cinema, have lunch in a cafe, walk in a park or just stroll through the evening city, discuss how the week goes and share news. In general, I have a very trustful and friendly relationship with Spartak, I hope that in the future it will remain the same. In summer we go to the seaside, at first to Genichesk, because it's the best place for  children's recreation and it is not far from our city and then we stay at my friends' place in Odessa. \r\nYou will probably ask why I decided to turn to the agency? The answer is very simple: because I am in search of my second half who is the best, the cleverest, kindest, the most sympathetic and he has an unusually beautiful soul. He is the man who saw good and bad on his way, but he remained a Human. He  knows the real values in life and has gained wisdom. He is very manly, but at the same time gentle and caring, in the depth of his soul he is romantic and is able to experience the feeling of love and do everything so that a woman who is next to him would feel herself not just a woman but a goddess ... I am sure I can find my soul mate here.\r\nI want to thank you that you took time to read my message to you!\r\nTalk soon!\r\nWith warmth,\r\nGalina",
