    "girls_info" => "I am very optimistic, positive and outgoing - I can easily reach understanding with people and find common language. I am life-loving, kind, non-conflict, peace-loving, caring and friendly. I like to smile and to make people around me smile too) \r\nI enjoy cinema and theaters, reading is one of my favorite activities! I enjoy sports and swimming is the kind of sport I regularly go in for. I like to be active and to relax calmly too. Cooking is my hobby - I like to cook dishes of Indian, Chinese and Ukrainian cuisine. \r\nI am looking for a good-tempered man, he is caring, humorous, stabile. I wish my future partner to be energetic, positive and resilient! My future partner likes to be in the comfort of home, he likes coziness and warmth of the family hearth. I wish to complete my man, to love and to be loved too. Find me soon, my second half!",
    "girls_1st_letter_subj" => "Let me introduce you to my world",
    "girls_1st_letter" => "I hope this letter will be interesting for you and you will decide to respond me. \r\nMy name is Inna, I live in a wonderful city of Zaporozhye, which is famous for its dam and the Island of Khortitsa. I hope one day if we happen to meet in my city I will take you there to spend wonderful time together. \r\nI lived all my life in Zaporozhye, I studied here and got a diploma of trade specialist. At those times this profession was in a huge demand - lots of shops, malls and trade centers were built, so I decided to study in the field of trade. Though since childhood I dreamed to become a psychologist. \r\nMy family is not very big: my parents, my daughter and my younger brother. My brother is married and has 2 children - they are siblings. My daughter's name is Alexandra. She has a diploma in aircraft design and works according to her specialty - she constructs helicopters. When she has free time we go to the swimming pool together. \r\nI enjoy sports, I was an avid cyclist in my childhood: when I was given a bicycle for my birthday - this was the brightest impression of my childhood! I was only 4 but I still remember that day clearly, I remember the joy and happiness that I felt. Another hobby that brings lots of impressions is travelling! I have been to Egypt, Israel, Spain, Germany and the USA (I visited my aunt's friend there). I would be glad to come back to Israel again and to the city of Nazareth another place I would like to see is Key West - the extreme point of the USA.\r\nI am life-loving person, I like to communicate, I believe that a key t successful family is communication and compromise. I am a good friend - lots of my friends are with me since childhood. But I do not have a beloved man next to me.\r\nI decided to post my profile here because I believe that men abroad are more romantic and manful, attentive and caring. I wish to find my soul mate very soon, to be happy with and to spend the rest of the life together. I wish to take care of my man, to spend time together. \r\nThe man that I see next to me is kind, well-balanced, he has a great sense of humor, he leads a normal way of life, moderately healthy. He is also energetic and optimistic, just like me) I would like my man to work, or to have a hobby that he likes and enjoys. He is also fond of travelling, music, comedies and educational shows.\r\nI hope your heart will whisper you that we can be a wonderful couple,\r\nWrite soon!\r\nInna",
