    "girls_info" => "I am very cheerful and I have positive outlook! I am honest, smart and beautiful! I have romantic nature and I enjoy being active with my close people. I am a normal lady, who is in search of love:) So I hope to find a reliable man with the same view on life!\r\n\r\nI like karaoke, singing is one of my favorite activities, I like to go hiking and I like picnics with friends. I like travelling inside Ukraine and outside my country too! I think it is very important to have hobbies that make your life full!\r\n\r\nI am so eager to have a loving family with my second half, who is honest, kinds, loving, romantic. He is also caring, intelligent, generous, has positive way of thinking and is family-oriented. My future  husband is a one woman man, he is faithful",
    "girls_1st_letter_subj" => "Family-oriented lady",
    "girls_1st_letter" => "I would like to tell you about myself, I am Tanya, I live in Zaporozhye. I am educated and intelligent lady. I have two diplomas, I am economist and specialist in government authorities. I have been working for 6 years in the field of economics, in a construction company.\r\nI had an experience of family life, unfortunately I was not lucky to get married once and forever, but this misfortune brought me here, so maybe we can try and build our own happy family in the future.\r\nI was married for one year, the reason of the marriage to fail was probably the age at what we got married we were young people, who have just graduated and we were not ready for family life and for taking responsibility. There were no understating in our family, so we divorced. I have no children.\r\nNow I live in the room in dormitory, I worked hard to be able to have this dwelling and I am proud that I have my own place to live. \r\nMy parents live in a village in Zaporizhia region, my mother's name is Raisa, she is in her mid-fifties, my dad is in early sixties, his name is Vladimir. \r\nWhy am I still single? I just have not yet met a man who is decent, honest, self-sufficient and serious about creating a family. First of all I believe that the fundamental factors for the family to be successful there must be feelings, mutual respect and attraction between the partners. \r\nI decided to register with the international marriage website because i think that only mature men, who are ready to create a family would turn to such website, and I hope to meet a family-oriented, wonderful man to create our own family together. \r\nI would like to tell you more about myself, I love music, travelling and hiking. I adore Ukrainian singer Sofia Rotaru, she is in her mid-sixties, but she is so attractive and beautiful and her songs are so close to my heart, they are about eternal values that are important for people. I dream to go to her concert one day! I like Russian films, romantic films about love, where good always defeats the evil, where loving hearts will be together no matter what. After the main characters of such films overcome a line of hurdles, dishonesty, betrayal their feelings are still so strong that they still want and can be together. Watching such films, I have string faith that love exists and one day I will meet a sincere, reliable, honest, generous, hardworking man, a loving man with whom I would like to live all my life, sharing my warmth, love and care, for whom I would like to give all myself and in return to receive love and respect!\r\nWith warmth,\r\nTanya",
