    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I can say that I am wise, kind and educated. I like sincerity and faithfulness in people. I am tactful and flexible, attentive and honest. I have lots of love and tenderness in my heart to give to the man who will love me!\r\n\r\n\r\nI like cooking, cinema, concerts and different activities. I like writing and I hope that one day I will be able to write a book:) Reading is my passion! I like to embroider and design clothes. Painting and drawing are also to my liking. \r\n\r\n\r\nI lack my second half, he is a strong and open-hearted man, he is sincere and tender. He is my hero. My man is selfless, he doesn't need to demonstrate that he is the leader, because he knows this already. My man is caring and loving. He is also sensual.",
