    "girls_1st_letter" => "Delicate and bright, I am ready to give: love, loyalty, sweetness, happiness, joy to you! I desire to share with you all the wonders the world offers to soul mates. I am here, only a message away from you, don`t miss writing to me! Yes! I am a family oriented woman looking for her number one man! Come into my life and you will always have delicious meal ready and waiting for you on your returning home and a smile on my sugar lips ready to meet yours) Wait for your letter, I want to prove it, that by being together with me you have obtained the best! Marina",
