    "girls_info" => "I am a wonderful housewife, I know how to keep my home cozy and neat. I am a reliable person and a good friend. I like to learn new things and develop my personality. I am kind and romantic, I am devoted to my close people and I really like to take care of them!\r\n\r\nMy passion is photography, I like to be a model for photo shoots and as well to be a photographer myself. If I had more spare time I would definitely make photography my number one hobby! I like fitness and different sports, I have recently joined Kangoo-jump club! It's a fun sport to do and keeps you very fit! I like Pilates very much too! Travelling is also a wonderful way to spend free time!\r\n\r\n\r\nI can see myself next to a reliable, caring, self-sufficient man, with a wonderful sense of humor. I would prefer if my man also liked sports and had his favorite hobby! This is also important that he is healthy without any bad habits. He is generous and romantic. I hope to meet a man with the same religious beliefs as I have.",
    "girls_1st_letter_subj" => "Perfect for you",
    "girls_1st_letter" => "I would like to start my letter to you with some background information about me.\r\nMy name is Anna and I was born and grew up in Donetsk, once it used to be a wonderful, prosperous city! I graduated from Donetsk Institute of Economics and Business Law with a master's degree in economics. After graduation, I worked mainly in the banking sector, and now I work as a manager in a commercial bank.\r\n\r\nIn my spare time, which, unfortunately, is very limited, I like to travel, take photos and being taken pictures of:) I go in for sports, one of the last hobbies is Kangoo Jump. I also like to go to the movies, to concerts and play bowling. I like historical films. One of the recent concerts that I attended was Pianoboy's concert - wonderful music which inspires and raises spirits. My father's nationality is Polish, and on Saturdays I study Polish language and culture in Polish society which is located in the Catholic church. What's your favorite spare time activity?\r\n\r\nI was in love, but under tragic circumstances, the person whom I loved, and with whom we were going to get married, died. Then the war began, and together with my mother I was forced to leave my native city. Now we live in Zaporozhye. \r\nMy mother's name is Tamara Nikolaevna, now she is retired, formerly she was in charge of a network of pharmacies in Donetsk. My father - Vatslav Stanislavovich, is now retired, had previously been deputy director of one of Donetsk factories. I have also got a half-brother, who is 13 years older than me, his name is Sergey, he lives in Russia.\r\nI love pets, and I had a very beautiful and clever cat in Donetsk. Now, due to the fact that I live in a rented apartment, it is not possible to have a pet, but I really want to:)\r\nI turned to the agency in the hope of meeting a decent man to create a family. I have seen so many examples of happy married life of two people from different cultures that I decided to try and told myself ''Why not?\" I am here with honest and serious intentions to find my soul mate, to start a new page of my life, with my beloved man by my side.\r\nWith hope,\r\nAnna",
