    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a family oriented, loyal and sincere woman, I am open and friendly, attentive and caring, I have a nice sense of humor and know how to make my beloved man happier. I am registered with the web site in idea to meet a reliable and strong man, who will become my friend and confident with whom I will be feeling secure and certain in my tomorrow.\r\nI wish to share my interests with my beloved man, of course it would be ideally if we can go to the gym together, watch movies along weekends, visit theater or reading anything interesting could share our views about the plot of the story. I love to spend my time inside my family.\r\nI consider that it is important to fist of all ask your life partner what can I do for you to make you feel better so that I could make your life brighter, to make sure that you are loved and satisfied with our relationship. I wish to meet a man who will look in one direction with me and who will be kind, wise and courageous, I am sure that you are reading through my profile right now, please, write me) I am only one letter away from you!",
    "girls_1st_letter_subj" => "From Ukraine, with love!",
    "girls_1st_letter" => "I would like to start our acquaintance with telling you some facts about myself. My name is Tatiana. My family consists of me and my two lovely kids, my daughter Daria who is 20 years old and my son Ivan, he’s 6 and half years old. In 1994 I graduated from school of supreme sportsmanship, for 9 years I’ve been engaged in water polo, I have some awards for it, even though they are not that significant, but achieved by persevering and hard work of a young athlete. During the period of doing sports, I took part in many competitions so I traveled a lot to different cities of former Soviet Union. \r\nI graduated from Classical Private University - faculty of jurisprudence and acquired profession of a lawyer. After graduation, I work in my specialty. To date, I work as a lawyer in a private company that deals with the pharmacy business. But I plan to radically change my occupation, since I have a desire to try myself in a different field of activity.\r\nMy mother's name is Nina, and father's - Vyacheslav, they both are 69 years old.\r\nI haven't got any pets yet, but we really want to have a little dog as a part of our family, especially my son dreams of a pet.\r\nI've been divorced for five years. Why not married? It's a difficult question) probably because I haven't met yet that special and unique person - my man.\r\nI have a big variety of hobbies, among them are reading books, swimming, sport, cinema and theater.\r\nI like to read. It certainly must be interesting books that make me think a lot, force my mind to be creative and develop my imagination. Mostly, it is some cognitive literature and fiction as well. If we talk about fiction, I prefer Russian classics like Bulgakov, Chekhov, Gorky, Dostoevsky, Leskov, Kuprin, Artsybashev, Babel, etc.\r\nI love to watch detectives and surely movies about love. I also like to watch those kind of films in which director makes the viewer think, ponder, make conclusions; films that you can talk over with your friends, in other words movies after which there is a so-called “aftertaste”. I very much love movies of the Soviet director Gaidai and other Soviet classics of cinematograph.\r\nI love calm music, but it can be any genre honestly. In my youth I was a passionate Beatles admirer. I preferred to listen to bands like Pink Floyd, Led Zeppelin, Deep Purple, The Doors, Scorpions, Dire Straits… I even listened to Manowar a little bit) so my music taste was very surprising for my classmates))). My father instilled me this love for music, as well as love for sport, books, etc. My father paid a lot of attention to my spiritual upbringing, and I am very grateful for that.\r\nI prefer to spend spare time with my children, especially often I spend it with my son. On weekends we go to the cinema, have walks around the city, eat ice cream, talk about everything, sometimes go visit my parents or friends. I often read children's books to him, but unfortunately like most modern children, he gives preference to computer games)).\r\nIn the nearest future I plan to go to the swimming pool with my son, in order to teach him how to swim and temper his character and body. He also does sports, he does Jiu-Jitsu. My daughter love to dance, she and her friends created a dance group. They rent a small room, where they are able to train and make their own choreography.\r\nI went to the marriage agency to look for a man because I think that with the help of professionals my search will be more successful and I will make my personal life happy much faster. Why dig a trench with a shovel, if you can do it faster with the help of an excavator))) And also meeting a man from abroad via agency is safer and more reliable.\r\nTanya",
