    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "In my nature I am a woman of a family, I like coziness of the home, I enjoy when the house is clean and neat. With great pleasure I do the housework: I enjoy cooking, baking etc. When I have time to rest I prefer to be outdoors, somewhere next to the river, sitting near the fire and enjoying the beauty of nature. In summer I go to the seaside.\r\n\r\nI enjoy walking, travelling and reading. I like to walk in the parks of my city where the air is fresh and one can enjoy the calmness of the evening. From time to time I go cycling - it's a nice way to keep fit and rest. To be in good shape I go swimming and I enjoy this very much too.\r\n\r\n\r\nI am looking for a real man, in this notion I put first of all an ability of my man to take decisions and to be responsible for the consequences. I am looking for a man with a kind heart, with good sense of humor, not mean. He is intelligent and well-educated. My heart will help me to choose the right man, I am sure I will feel you at once.",
    "girls_1st_letter_subj" => "Intelligent woman",
    "girls_1st_letter" => "I can be serious at work, but at home I am very soft and gentle. I can easily change emotions, and this helps in our tensed and rapid time, full of emotional stresses and overburdens. I think I was deeply influenced by my parents, my roots. I was born in Baku and my parents were also native people of Azerbaijan. The man is always the leader in the family. He is the provider. He is the one who takes care of the prosperity in the family, and the woman should create cosines and warm atmosphere at home. So my parents taught me. I really want to find a man for whom I will be eager to create comfort and coziness and give my love.\r\nI live in Zaporozhye, a wonderful city in the south of Ukraine. I have got a higher education in finances. For many years I have been working as a chief accountant in a huge company. I like my job though it is very difficult and very responsible. I need to know a lot of laws and of course to be able to apply them. The world of figures and reports is complicated, but very interesting.\r\nI live with my mother, in a multi-storey building. My mother is retired and though she is in her early 80s, she is very active! I have got a daughter, her name is Christina, she has got 3 diplomas of higher education and at the moment she is working in Germany - she is a teacher of macroeconomics in one of the Universities. She is a very creative lady, too - she composes poems and draws really well. \r\nWhen I was a teenager, I also wrote poems and read a lot, I read a lot of Russian classical literature: I.Tolstoy, I. Turgenev, A. Kuprin, A. Pushkin and other poets and writers. I was also a fan of science-fiction literature, I enjoyed reading S. Lem, Ray Bradbury, Aisek Asimov, Strugatski brothers. I still enjoy reading very much, but unfortunately I do not have as much time as I had before. \r\nBesides, I have other hobbies, I go to the swimming pool two times a week, swimming helps to relax after a tensed working day and to keep fit. I used to go in for Oriental dancing, but now I plan to start going in for Latin-American dances. I prefer active rest, when it is warm - I enjoy walking in the forest or along the river. In my city there is a beautiful river - Dnepr, with picturesque places and rocky shores. And another attraction in my city is the Island of Khortitsa - with its legends and mysterious energy - it is a marvelous place to visit. Every spring when the nature awakes from its winter sleep I enjoy going there and watching the magical process of revival of nature... I would like to show these places to you, if we meet one day))\r\nI think the main hobby of my life is travelling. Previously, I have been busy with upbringing of my daughter and all my attention was given to her. I love new impressions, this is why every time when I choose my itinerary - it is a new country. Over the past few years, I have visited Poland, the Czech Republic, Hungary, Croatia, Montenegro, Albania, Turkey, Germany, Austria and Israel. Each country has its own flavor, its color. In every country I went on excursions and each of them was very informative. \r\nI am looking for a man with similar views on the life, who will also be my friend, with common interests and hobbies. And of course, as any lady, I would like to be conquered by a Real Man. That's why I applied to the agency. I have a hope that you, the one who is reading this letter, will feel the connection with me and write me back, and I will become the lady from your dream, who you have been looking for.\r\nWith wishes of all the best,\r\nElena",
