    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "It is always hard to describe yourself but in my opinion I am kind, caring and gentle woman. I am the mother of three wonderful girls who my best friends. I can call myself a successful lady who also knows how to take care of her family, who is attentive and absolutely giving. I am trustworthy and open-hearted, understanding and sensitive too.\r\n\r\nSport is in the first place if I enumerate my hobbies. I go to the gym and I really enjoy this. If I continue telling you about my hobbies I will mention knitting:) Everyone in my family and my close ones wear something knit by me! The best present in my opinion is what you create wit your own hands. I like being outdoors and travelling. I cannot imagine my evening without a good book too. \r\n\r\n\r\nI am looking for a man, who is ready to be loved, who has a big heart to accept every emotion I can bring into it. I am in search of a man who is successful, goal-oriented, sure of himself and strong. He is also gentle and sensitive, neat and kind, giving and generous. I will feel myself a real woman next to the man who is reliable and honest. A great plus would be if he likes travelling too.",
    "girls_1st_letter_subj" => "Dream Woman",
    "girls_1st_letter" => "I am happy to send my first letter to you with a hope that you will let me introduce you into my life.\r\nI am Viktoriya from Ukraine. I was born and live all my life in a beautiful city of Zaporozhye. I finished school here and received college education too. I was a devoted student that is why I have lots of certificates and diplomas from various training courses. I used to work in the field of cosmetics trade but eventually I chose the career in the sphere of real-estate business. I give premises for rent. At the moment I still consider my choice of profession the best one and among the most profitable fields in our country. \r\nI live in a multistoried house in the 5th floor, I have lots of neighbors and we have friendly relations. I live in the city centre, but in a very picturesque area, next to the Dnieper river. I live with my three beautiful daughters.\r\nMy family are my daughters, my mother and my brother. My mother, Nadezhda, is retired and she lives alone, though I try to persuade her to come and live with us. She has been a widow for more than a decade, our father died.\r\nMy elder brother, Yuri, is a business man, he has got his own family and children who are already adults and have children themselves. His daughter’s name’s Ekaterina and son’s Nikolai, they all live separately but meet very often.\r\nMy daughters are beautiful, kind and loving creatures, I love them so much. My elder daughter, Maria, is a student at Zaporozhye National University, at the Faculty of Sociology and Administration. She is a part-time student, because she has started working. She likes sports, jumping and yoga, she’s also into reading and cooking. Sofia and Elizaveta have graduated from school and entered different High schools. Sofia wants to become a journalist, at the moments she tries herself in the field of modeling.  Elizaveta studies in Poland at the faculty of Foreign Affairs (Asian countries) . Girls help me about the house, they all love animals and travelling. Visiting and helping their grandparents is what they do very often.\r\nI like diversity in clothing and food. Cooking new and experimental dishes is one of my favorite activities. I cook Ukrainian national dishes with pleasure too. I like housed chores, keeping the house neat and cozy. I also like designing and changing interior in my flat. I like knitting, reading and being active. My favourite writers are Bernard Werber, Erich Maria Remarque and Richard David Bach. I like cycling and horse riding, going to the gym and swimming! \r\nMy daughters and I often go to the cinema. I like different genres, but most of all historical dramas, thrillers and comedies. I also like visiting exhibitions and fairs. I like driving and I can call myself an experienced driver. \r\nI like travelling, but I haven’t been to many countries yet. I visited Poland, Bosnia and Herzegovina, Yugoslavia (before its breakup). In summer we enjoy visiting Turkey. Each country has its unique national coloring, history and peculiarities. \r\nPeople say that I am sincere, attentive, caring, kind and responsive. I have a great sense of humour, I am also devoted and honest. I am faithful and supportive. I am not a great story-teller but I am a good listener. I don’t like being in the centre of attention. I hate pointless conversations and silly gossip, criticism and conflict situations. I am never bored when I am alone. When I have a spare minute I devote it to self-development or to my hobby. \r\nWhy I decided to register with this agency? Because I trust them. I know that the Internet is a huge World, and not to get lost in it I need a helping hand, in this case it’s my agency. With their help I will find the ONE who was created for me, and together we will live in happiness and harmony forever!\r\nI wish my beloved one to be self-sufficient, confident, purposeful, responsible, sensitive, caring, with a good sense of humor, strong and interesting. I think being employed for a man is a must. A man is driven by his image of himself, his occupation and his income. And what he does should bring him pleasure. If you lead an active way of life, you are in a good shape and you love to travel, then take my hand and let’s get together!\r\nWrite soon!\r\nViktoriya",
