    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very active, I love travelling and meeting new people. I am also goal-oriented, if I say something I mean this. I am gentle and caring and of course I love being with my close people. I believe in love and I hope to find the love of my life here. What is more I am a really kind woman.\r\n\r\n\r\nI enjoy traveling and learning about new cultures, I enjoy meeting with friend and relatives and of course spending time with my daughter. I have just started discovering completely new field for me – WEB-design! This is so captivating and interesting to study something new. I also like cooking and do this with pleasure. Drawing is another hobby I can put on this list. \r\n \r\n\r\nI am looking for a man who is humorous, who loves to laugh. I value good sense of humor in a man! My ideal mate is also independent and mature; he knows what he wants. He is also generous and kind, caring and knows how to spend quality time with his family. I also hope him to be neat.",
    "girls_1st_letter_subj" => "Hello to you, my love!",
    "girls_1st_letter" => "Nice to meet you! My name’s Vladislava and I am at the age when life only begins, there are still many plans to fulfill and places to visit…\r\nI was born in the South of Ukraine, in the city of Zaporozhye. Practically all my life I spent here, except the student’s years, when I studied in Kyiv National University of Trade and Economics. Later, when I came back to Zaporozhye I entered Medical College and mastered the profession of a paramedic. I worked and continued my studies, I joined the School of Cosmetology and I realized that this is the profession I dreamed of. So at the moment I am working as a cosmetologist. Also being a local distributor of professional cosmetics, I combine all three careers I obtained through my lifetime.\r\nI used to go in for professional swimming when I was a child. At the age of 14 I left this kind of sport, though it influenced me a lot. Thanks to swimming and other sports I keep fit. I also practice yoga; I enjoy it as it is a calm and beautiful kind of sport. \r\nI have a daughter, her name is Daria. She is a teenager, and I always support her, whatever she is interested in. She has a lot of interests, though some of them are beyond my understanding, we teach other a lot and are always ready to help with a piece of advice.\r\nI have lots of hobbies, one of them is knitting. It helps to relax and to go deeply into my thoughts. I also like embroidery. According to psychologist’s research these activities help to improve motor skills and ensure proper development of both cerebral hemispheres)) Together with these “serene” activities I truly enjoy being outdoors: hiking and travelling are my favorites! I have already visited Hungary, the Czech Republic, Poland, Germany, France and Bulgaria. Each country has its unique charm. It is very hard to say which country I liked most of all, I loved all of them)\r\nI like to go thee cinema or theater with my friends. I like visiting the first nights of good films, but I am selective while choosing a film – I do not like horror films or action films. I would prefer something light and kind to watch, to leave the cinema with a feeling of warmth, with positive thoughts. One of my favorites is “It’s Complicated” with Meryl Strip and Alec Baldwin. \r\nI live with my daughter, but my parents’ and my sister’s homes are not far from our place. We often visit each other and spend time together. Our mutual hobby is cooking - no wonder we cook delicious food when we gather together! \r\nBut, unfortunately, I cannot say that I live in complete harmony. I lack one huge piece of puzzle – a strong and caring man next to me. I wish to find a man who would share my interests, who would love to be next to me. I am looking for serious relationship with a nice, prosperous, active man of varied attainments, for someone who is just like me, looking for a soul mate. I am longing for trips with my beloved man, walks hand in hand and hearty conversations; this is what every ordinary human needs to be happy.\r\nIf this letter caused warm feelings in your heart, do write me))\r\nWith warmth,\r\nVladislava",
