    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am very caring, kindhearted, attentive and joyful person by nature. It is always easy for me to find a common language with any person. I look positively on life. And I never take things for granted. I value sincerity, openness and frankness.\r\n\r\nI like nature, sports and traveling. I have been to many places, for instance I have visited Check Republic, Poland, Budapest, Thailand and Australia, and I have been to Prague, which became my favorite place for holidays. \r\n\r\nI would like to meet a man to create a loving relationship; I wish my partner would represent the following traits: kindness, care, attention, ability to understand and listen, who would possess a nice sense of humor, and would be intelligent and reliable.",
    "girls_1st_letter_subj" => "For love",
    "girls_1st_letter" => "My friend has found her better half here, and has advised me to push my luck. I live and work as a manager in Zaporozhye city. It turned out in my life so, that until now I have not yet met a man who would have swapped me off my feet and would encourage me to create a complete family together with him, maybe because of the narrow circle of my acquaintances or maybe because of the simple and so usual fact that with men in my life as with spaces on the parking lot happened the same – the best ones were either taken and the available ones were for disabled…maybe a bit sarcastic way and not a very good comparison to utter such words here – that is me and who I am – quite self-sufficient, balanced, tender and articulate. I do know what I want from life.\r\nI would want my partner to be loyal and faithful to me as I am to him, because I don’t want to get my heart broken and I know how it feels to be on the receiving end. I am glad that we both feel the same way about having and building a long-lasting relationship with each other, because I am searching for a life time companion and not a one night stand. I do believe that marriage is something sacred and to be treasured. But I think that marriage is an equal partnership where both parties have an equal say in all matters, and not that the husband is dominant over the wife. I think that both parties need to have a certain independence from each other so that they will be able to treasure the beautiful marriage they have. Marriage is about mutual love, respect and understanding and these mean that while we are bound together in holy matrimony, we are free to live our lives as long as we do not exceed the boundaries of what matrimony is. Whilst being equal partners, I would of course love to shower my loved one with gifts of my feelings not because I want to buy his love but because I would just love to see him happy. \r\nAnyway, I will be glad to hear from you and will appreciate any questions you would love me to answer…\r\nAnna",
