    "girls_english_proficiency" => "poor",
    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am well-balanced and calm. I choose a healthy way of life, I do sports, cook and eat healthily and adore communication with children and animals. My heart is open, my mind is ready for changes. I want to meet my only one man. I wish to find you, my second half!\r\n\r\nWhen I have free time I communicate with my sons, we go to the cinema together and enjoy each other's company! I also enjoy travelling, but I do not like to do this on my own, I believe that a good company can make any trip better. I enjoy growing plant in pots, this is also one of my hobbies. Reading is very important for me, it helps both to relax and to develop my personality.\r\n\r\nI am looking for an honest, open-minded man, who is high-hearted, responsible and reliable. I know that my man is somewhere here, we just need to find each other. My future husband is also enjoying sports, travelling and being  reasonably active! I wish to meet a goal-oriented man, who will not notice obstacles on his way to me.",
    "girls_1st_letter_subj" => "Calm and caring",
    "girls_1st_letter" => "My introduction to you will start right now and I hope that my letter will touch the strings of your soul, so that our song will be sang in unison....\r\nI am an educator by profession and by calling, I enjoy working with children, I know their psychology really well and we find common language easily. At the moment I am working at the child development center. \r\nI am divorced, and I live with my grandma. My parents are retired, they are in their late 70s, so I try to support them and help whenever I can. I have got a niece; she is my brother's daughter, unfortunately my brother passed away at the age of 52. His daughter Anna and I are good friends. My sons are my pride! Roman, graduated from University in Lviv and started his career there, he works in the field of IT. My younger son Artem is the future navigator of long voyages. My sons and I are keen on theater, so when three of us have free time we go to the theater.\r\nI also enjoy cooking, I prefer to cook healthy food. When I wish to pamper my close ones, I cook \"Napoleon\" cake. A true delight for a sweet-tooth! \r\nI like to take care of my plants in pots, this brings relaxation and in the \"concrete jungle\", where I live, it is a good chance to touch the nature. \r\nTravelling is one of my passions too. I have been several times to Riga, this is a fabulous place to visit. My dad is a farmer sailor, so I still remember my bright impressions of the huge white steamboat and enormous waves... Lately I frequently travel to Lviv to visit my son, this is also a great destination to choose for a holiday. Have you ever been to Lviv? If not - put it on your itinerary!:)\r\nI am soft and calm, but recently I discovered a new trait of my character, I do not like to sit still, I need movement in my life. I do not want to spend the rest of my life in a lonesome flat, I wish to meet my man, my soul mate, who will enjoy the same things that I do. Who would also lead a healthy way of life, who would love to bike together with me, who would love to take my hand and never let me go. \r\nIf your heart jumped when you read these lines, do write a letter for me!\r\nI am looking forward to hearing from you,\r\nOlga",
