    "girls_info" => "I am emotional, trustful, energetic, successful, sensitive, punctual, responsible and very communicative person by nature. I have a wonderful sense of humor and feel at ease in any company. I can always find common language with people.\r\n\r\nI like to cook very much as I do it professionally I can surprise my beloved one with a very special and unbelievably tasty dishes. I am fond of choreography, photo, I like to lead an active style of life and to have an active rest in the nature. I like to attract bright impressions, I love diversity in life, to add vivid colors to my life.\r\n\r\nI would like to meet a kindhearted, responsible, successful and reliable man who is in harmony with himself, with a good sense of humor, sexual and sensitive, a man wishing to build a strong relationship leading to a happy marriage in future. I wish he could believe in happiness, could have a desire to make his woman a Queen, so that he could hear from her that he is her King, a man, who can love and estimate life and each moment of it. A man who likes traveling, music, active rest in the nature, who can admire the sunsets and dawns met in a company of his beloved one, the one who would feel the romanticism of a special evening spent together by the sea, or just under the open sky or by the fire-place watching the dancing fire.",
    "girls_1st_letter_subj" => "My heart is loving",
    "girls_1st_letter" => "My name is Tatiana; I live in Ukraine, in Zaporozhye. I have a son, his name is Yegor. Have you got any children, how old are they? Do they live together with you or separately? \r\n\r\nI am a cook by profession; I used to work as an engineer-technologist in the field of food production. Now I work as a manager of a caf&#233; and I really enjoy my work! One of my dreams is to visit a restaurant that is marked by Michelin star, together with you! I enjoy creating new recipes as well! Last year by the day of Easter, under my management there was cooked an Easter kulich, its weight was 500kg, it was put in the church and more than 6000 citizens tasted it. What kind of work do you do? \r\n\r\nSeveral years ago I was chosen to take part in a beauty contest in our city “Pani Zaporizhzhya”, I had a wonderful rest, got acquainted with the 8 other ladies-competitors – all of them were marvelous women, taking part in the contest itself, getting the award of “Pani Gracia” proved one more time the fact that I am feminine, successful, gracious and I should be happy. Happiness for a woman it is when her beloved one is by her side.\r\n\r\nI am an optimist by nature, and I am hopeless philosopher-romantic. I like to dance as it is gracious. In my dreams we are dancing together our love-dance at the Viennese Ball… I like to have an active rest in the nature, because it gives me a charge of energy, I like to take photos as they capture the beautiful moments which we can keep in our memories. I like to cook and to make my home cozy. I like to take care of home flowers. I dream about having a house of my own where there will be a lot of flowers and greenery. Now, please, tell me about your interests. \r\n\r\nMy biggest dream it is to meet a half of my heart. I want to love and to be loved. I imagine him as a kind and charming man, responsible and successful personality. \r\n\r\nI decided to apply to the dating system to make my dream come true. The work and home obligations are taking most of my time. Why would I want to meet my future abroad? Just because once upon a time when I went to get a consultation from astrologist I was foretold that “the star of my happiness” is shining abroad in the West. And why would you like to find a lady from Ukraine? \r\n\r\nPlease, write me about yourself, ask questions, it would be nice to get to know each other. \r\n\r\nWrite soon,\r\nTatiana",
