    "girls_other_languages" => "Russian, Ukrainian",
    "girls_info" => "I am a kind woman, with good upbringing, I am courteous and caring, I can call myself beautiful. I like to make my home cozy, to cook delicious food and to work. I am not a workaholic, but I like to be useful and to make other people's lives better. \r\n\r\nI really like to cook, this is one of my hobbies, I like to cook national food and to experiment with new dishes, try to replicate the recipes of famous chefs and amateurs! I like travelling and I would like to do this with my future husband more often. I like classical music and modern popular bands. Historical novel is the favorite genre of books for me. \r\n\r\nThe man I would like to meet is loving first of all, he is caring and kind. I wish him to be attentive to me, smart and unselfish. My future husband is strong and humorous, he knows how to appreciate a lady who is next to him. He is also generous and able to give enough of emotions to his second half!",
    "girls_1st_letter_subj" => "My love, where are you?",
    "girls_1st_letter" => "My name is Irina, I would be happy if you take your time to read my letter, addressed to you:) \r\nI consider myself to be an educated person, I've got a diploma in the field of trade. I have my own home and I have a big and happy family: my mother, two sisters, my son and nephews. Although we all live separately, we all gather in the parents' house to celebrate holidays. I live with my son Igor. He is a student, he will become a programmer in the nearest future. He likes computers and everything that is connected with them and this is why he chose this occupation. He spends his free time doing sports. In my free time I like to visit exhibitions or go to the cinema. I like to travel and to be outdoors. I love flowers and grow them at home. I adore reading books, developing my personality and I always strive to learn new things. I have a dream: to go to the homeland of my ancestors to Serbia. I wish to go there with my beloved man, to the country of affable and serious people. I am interested in this because I am a descendant of the Serbs. This is a romantic country that I dream to visit, to see graceful churches, see the ancient city of Maglich, 16 km from the city of Kraljevo. There is a fortress of Maglich Irina, located on rocky mountain - my namesake, I would very much like to see it. The fortress is the best monument of the Serbian military architecture.\r\nI am energetic, kind, sympathetic, peaceful, calm and gentle. I find joy in the small moments of life. I appreciate the peace and comfort. I avoid loud conversations and rude behavior. I have a delicate nature, I appreciate truthfulness and sincerity. I turned to the agency to meet the man who will fall in love with me and will complement me in everything. I dream of creating a strong family, where two people will be one unit!\r\nWaiting for an interesting meeting with you,\r\nIrina",
