    "girls_info" => "I am very kind, easy-going and cheerful. I have a great sense of humor, you will never be bored with me. I am a good mother and I wish to be a wonderful wife soon! I can easily find contact with other people, I am friendly and caring.\r\n\r\nI am fond of different sports, gym, jogging and swimming are my favorites. I like to cook delicious dishes for my closest people and they really like them) My life is always active, I like to be in the center of life, to go out with friends and to enjoy every minute that God gives to me.\r\n\r\nI have turned to the agency because I want to find my second half, my love and best friend, of course all of these in one person. I trust the agency because I personally know other couples who met thanks to them! Now I hope to meet my love here too! My man is generous to me and his closest people, my man is strong and protective. He is my superhero and my soul. I am waiting to meet him the soonest!",
    "girls_1st_letter_subj" => "I would like to find my soul mate",
    "girls_1st_letter" => "This is my pleasure to introduce myself to you. I am Yulia from Zaporozhye. I am a mother, a devoted friend and a good worker, what I wish to add to this list is \"a happy wife\":) \r\nI am very cheerful, I never give up and always strive to have the best in life and of course to give the best to my closest people. I follow the golden rule of etiquette - treat others as you want to be treated by them. I try to support those who are in trouble and be happy together with those who are fine. I teach my son Arthur the same. \r\nI have no place in my heart for envy, greed or hypocrisy. But it is full of love that I want to give to my man, the one who will win my heart and impress me with his strong character ability to be courteous and just his personality, this is what I value most of all.\r\nRight now I will stop this message, and send it to you with a hope that my words started a sparkle in your heart and you feel that we can be a couple...\r\nYulia",
