    "girls_info" => "I am sweet, kind, tender, shy, honest and cheerful lady. I am very romantic, open-minded and a one-man woman. I am family-oriented, loyal and trustworthy. Very giving, supportive and caring. I consider myself a sweet girl with a soft personality. I am keen on interior design, psychology, sports and spending time with my family. I love when life around me\" boils \"because I'm very active and sociable person. I'm \"easy on the rise\" and happily go to meet new experiences and acquaintances. I'm an elegant lady at a party and a sporty naughty girl when I'm \"fooling around\". My friends say that my smile can light the darkest day. Well, I agree with them! And I also have a great sense of humor (you will still have the opportunity to find out!). In spite of the fact that I am quite young, I am ready for a family and marriage and dream about kids. I think kids is the biggest happiness in the world the God's blessing. I will do my best so as my own children were grown in love and care, saw their parents happy as it is well known that only happy parents have happy kids.",
