    "girls_info" => "Thank you for coming on my page:) I hope that the characteristics that you are seeking the most in a future woman you will find in me. I am here to find my love, as all of us. I want to find my love - the one and forever! To me, love should be perfect, passionate, more important than anything else in life. I particularly I like family gatherings, and never miss a chance to spend time with the people I love. Some details about myself: I love life, nature, sport, traveling, dancing and knowing all new. I'm fond of fashion, arts. I am a decent and honest woman. I hate lies! hope you too! I hope we will be able to create a strong happy family together! Want to check ? ))",
    "girls_1st_letter_subj" => "we never know, right?:)",
    "girls_1st_letter" => "Hello and nice to meet you here)))))\r\n\r\nI am a person who hates lies and always speak openly and directly, so think i need to start here by telling the truth, and here it goes:\r\n\r\n- I am NOT here for games \r\n- I am NOT here for endless mailing \r\n- I am NOT here for just chatting and so on\r\n\r\nI am here to find a ONE WOMAN MAN and start to build with him REAL relationship in REALITY! \r\n\r\nThe most important thing - I DO NOT KNOW ENGLISH, but I am ready to learn it for my special man for us to communicate. Will you become my TEACHER ? if you are not scared that I do not know English , then let[s communicate and build relationship together. I am very tired of being alone, and I think I deserve happiness finally, like all people do. \r\n\r\nI will be happy to receive your reply, I am sure that our destiny has plenty of surprises for us, so you never know...))\r\n\r\nSincerely,\r\nAnjela",
