    "girls_info" => "I'm a gentle and romantic woman who wants to love and be loved. I'm ready to be a faithful partner in life, an affectionate wife and just a reliable person next to my beloved man. I am ready to give him all my warmth and tenderness of my heart. In my heart a lot of love, I'm ready to give it to a loved man. I know that relations are built on trust, respect and mutual understanding. \r\nAs you know Ukrainian women are very good housewives, and I am not an exception. Family values are very important to me and I know how to make family friendly and strong! I am a smart and good lady, with a big soul and a kind heart.\r\nAs for my interests - I love cooking most of all. Also reading books and watching some interesting movies. I hope some day we will have a chance to watch some nice movie together, cuddling and watching the kids playing and laughing next to us.",
