    "girls_info" => "I am very sporty lady and always reach my goals. \r\nNow my main goal is a family, happy and loving family and one man for all life, I am one man lady and family oriented. \r\nNot only inner beauty is important but also appearance. In my heart there is enough love now to share it with my other half. \r\nI always try to be fit and beautiful and will do all to be the best wife for my man. \r\nI adore sport and go to the gym, I have a dog and like jogging in the morning with him. I love my children and do my best to be a good mother. \r\nI'm faithful, cheerful and have a good sense of humor. I am very romantic, sociable and careful. My numerous friends consider me to be sincere and very romantic lady. I know that my real destination and happiness lie in a family hearth and reciprocal care. I would love to meet a man who is reliable, confident, caring, honest, well educated, successful, with a positive outlook on things and a good sense of humor. I like reading, socializing with friends, cooking, cozy home life, traveling.",
    "girls_1st_letter_subj" => "we will never know where we will meet the right person..",
    "girls_1st_letter" => "Hello first of all:)\r\nMy name is Elena and my name means sunny and shining. If you get to know me better you will know that it is true for sure:)\r\nI am a romantic and tender lady. I am responsible and kind. I believe in love and in the life after love)\r\nThe people say, that I have a good sense of humor and they like, when I make jokes and they laugh with me together....\r\nI am an honest person and I do not like hypocrisy and lies, because this kills us from all sides. I am sure, that all the relationships must be true, honest and with the sense of respect and with the understanding. These are the things, which can create the happy marriage. \r\nI would like to make acquaintance with a kind, generous, diplomatic man who respects women. I would like him to be with a good sense of humor, faithful, reliable friend in life.\r\nIf you think that we match, I will be glad to get to know you better)\r\nThank you for your attention.\r\nBest wishes,\r\nElena",
