    "girls_other_languages" => "",
    "girls_info" => "I am gentle and caring, honest and sincere, very feminine and sensual, sexy and passionate ... I am a very romantic girl. I am family oriented and loyal and. Very responsive, supportive and caring. I consider myself a good girl with a good heart.\r\nI would like to meet a man who is gentle and kind, but has inner strength and a passion for life, he likes simple things in life, such as long walks, holding hands, laughing together. He who loves to be happy. I'm looking for an ordinary person to share my life with him. I dream of a noble, intelligent and confident person, with a passion for life. A real man and gentleman, gentle and caring, who will embrace me and carry me in his arms. I dream of many things in life, but first of all I want to create a strong family, bring up beautiful and educated children and make my husband happy.",
    "girls_1st_letter_subj" => "we never know when we will meet our soulmate..",
    "girls_1st_letter" => "Hi!\r\nNice to meet you here. I like your profile and want to make acquaintance with you. I would like to tell you about myself and you decide if I can become a good couple for you)))\r\nI am very loving and positive person. I love my parents and my friends much. I love people who surround me because they make my life bright. The part of me is an active rest, a little extrim but sometimes i want to stay in a calm atmosphere. \r\nI like everything new and achieving new aims. I like visiting theaters, exhibitions, concerts, carnivals. I like looking after small children on the stage. I love children very much. I love my job!\r\nI love the nature, the sound of the sea, air, wind, sand. My dream is traveling around the world, build the house with my own hands, swim with dolphins, jump with parachute, climb the mountains and riding the horse.\r\nI like classic in the interior and I like beautiful clothes. I like well-behaved people. I like spending time with my friends, sitting near the fire, joking and singing the songs. I can't imagine my life without pets especially dogs. \r\nSometimes i do fishing, walk in the park, bike at night in the town as it has a special smell at night.\r\nI am fond of science, psychology, documentary films. I like meeting new people.\r\nI don't smoke and don't have bad habits. I don't like people who sit near the computer all the day round playing the games.\r\nI am looking for the man who is reliable, well-behaved, romantic, who can treat his wife and be a good father . I don't like egoistic men. I am looking for a man with a good sense of humor, who understands everything and who does not like arguing. I am looking for a man who is not only a good lover but a friend and partner in everything.\r\nI like men who know what they want, who are not jealous and who are strong. \r\nI think it is enough for the first time)))\r\nI hope you will write me soon\r\nWait for your letter and ask me any questions\r\nKseniya",
