    "girls_info" => "I am here to get acquainted with a worthy man who knows what he wants from life, has his plans and goals for which acquaintance, communication with me will be a wonderful addition to his beautiful life, and not the filling of voids.\r\nI like traveling, visiting new places, meeting new interesting people. I am fond of dancing and psychology, too. I am loving and caring, understanding and trustworthy. And I am looking for a man like that, too. I hate lies and think that it is unacceptable in relationship.",
