    "girls_1st_letter" => "Hello, my dear Friend,\r\nOf course I hope to find more than friendship here, but let's start with it first. So you agree?\r\nI am very calm, kind and merry woman. I always listen to my man and try to be the best woman for him. I love the life and always do my best to be in a good mood! You will never feel boring yourself when we are together.\r\nIn my free time I like sewing and knitting very much. Also I like traveling very much and spend time with my son. \r\n I am here to find a reliable, kind, generous man with a good sense of humor. Write me! I am waiting!\r\nI think I am a simple woman who is looking for her soul mate in a far away country..What kind of lady do you see as your wife? Is she perfect in everything or simple like a usual woman?\r\nI will appreciate your reply to my letter.\r\nHave a good day,\r\nSvetlana",
