    "girls_info" => "I love my life and try to enjoy every moment. I am a person who always tries to be in good mood and smiling, despite of I have inside of me. I like people and do my best to help or to give a piece of good advice if I am asked of it. I am kind-hearted and sympathetic, sociable and full of energy. I like salsa dancing, swimming, jogging, cooking, reading books and planting home flowers. I am looking for my second half here and dream about a happy family with kids.",
