    "girls_info" => "I am active, positive and purposeful!) I really love animals and nature. I love an active way of life, for me it is very important. Friends say that I'm kind and sympathetic). I am attractive and smart. I do not have any scientific awards, I do not know much about technique, but I read a lot, I'm interested in various things, I always look for something new and curious. Kind and gentle in relationships and with those who treat me well. With positive outlook on life. I have enough life experience, I can listen and tell stories well, I like to think about eternal things and talk about them. I know my advantages and disadvantages well, I do not think about myself too much, but I know myself the price. This is just a brief description. It's better to talk with me and get to know me directly through communication.",
    "girls_1st_letter_subj" => "Please recognize me in the crowd!",
    "girls_1st_letter" => "Hello, my foreign friend,\r\nActually, I am looking for more than friendship here..I am very active and cheerful, I have many friends and they are real, true friends to me..But they all have their own families..I want to have my own family very much..a loving and caring husband, with whom we will share all the good and difficult moments of life, enjoy every moment, travel, do activities, spend vacation, celebrate holidays at a round table..\r\nI can describe myself as a tender and sincere woman. I really like everything beautiful in my life, flowers, operas, theaters, exhibitions, concerts, art, nature, sea, mountains. I enjoy sports, traveling and learning everything new in my life. I am serious, reliable, honest, kind, communicative, tender, cheerful, attentive, romantic, optimistic.\r\nPlease look into my eyes, there you can see all the tenderness I have inside of me, and my heart will confirm it to you when we meet in real and you take my hand! \r\nHope to get to know you better,\r\nAntonina",
