    "girls_info" => "My hobbies are fittness, dancing and jogging. I like being fit and healthy. So healthy lifestyle is my motto. Also I like different concerts, movies and galleries. \r\nI am kind, I have open heart. I just want to love and give all myself to my beloved one. I am a good housewife. I cook very well and I know what man needs for being happy!:)\r\nI want my future husband to be understanding and reliable. I need a man who knows what he wants and who has got some goals in his life. I will be happy to find sincere man with a good heart.",
    "girls_1st_letter_subj" => "Give us a chance!",
    "girls_1st_letter" => "Please look into my eyes and you will see much love, tender and desire to be needed and loved there.\r\nI have a very feminine, tender and soft nature. I believe that a man must be strong and protective. A Man creates the form – a Woman fills this form. There is nothing that I wouldn’t do for my future husband, and of course I will expect that my beloved man will never be grudge in something for me!!\r\nI would like to say that I am looking for serious relationship. It is impossible to describe clearly the man I am looking for, but it should be someone who fully understands that no one is perfect. I am looking for someone who is honest, as it is the thing that I appreciate most of all. I would love to meet that man with whom we could share our lives. I hope that this is you and I can stop looking for love because you will give me everything I need. Let's try?\r\nSincerely,\r\nVictoriya",
