    "girls_info" => "I like embroidery and drawing, I am fond of design and sports. I am a person with many interests and hobbies. \r\nI am active, purposeful, both pretty and smart)), with a good taste. I adore healthy lifestyle. I want to love and to be loved. I am ready to create a new life with my beloved one)\r\nI can not imagine a world without smiles and laughter. I always look at the world positively, discarding the bad in life. I am a spark of energy and fill this energy all around. At the same time I am calm, well bread and I think I know what man needs for real happiness. I am sincere and kind woman who will paint your world in bright colors. I love to dream and I beleive my dream will come true, because in this world nothing is impossible.",
    "girls_1st_letter_subj" => "What is home?",
    "girls_1st_letter" => "What is home? My favorite definition is \"a safe place,\" a place where one is free from attack, a place where one experiences secure relationships and affirmation. It's a place where people share and understand each other. Its relationships are nurturing. The people in it do not need to be perfect; instead, they need to be honest, loving, supportive, recognizing a common humanity that makes all of us vulnerable. My biggest dream is to create such a safe place for my future family - my husband and our children, to be a good mother and a good wife. If you want to share our dreams and see the chance to build such a family together with me, please write me back.\r\nSincerely yours,\r\nJuliya",
