    "girls_info" => "I am a happy and cheerful person. I like cooking, traveling, being on nature and spending time in a good company. I am a calm person who does not like quarrels and arguments. I prefer always to find a compromise and come to an agreement. I am looking for a gentle, caring, loving man to create a family with. This is my biggest dream and wish. I love kids a lot and want my own very much. If I can be interesting for you, please write to me, perhaps it is a destiny that we are here together at the same time and looking for our soul mates. I know that I will be a good wife and will care about my husband, the house and the children.",
    "girls_1st_letter_subj" => "I will love you forever!",
    "girls_1st_letter" => "Hello, dear, and nice to meet you on this site! I'm always energetic, cheerful and positive. I am a very romantic girl. I am a faithful girl and trustworthy. I don't need the attention of many men, I want only one MY man for a life. I have a good sense of humor and I love to joke. I don't like lies! I never lie and always tell the truth. I love life, love to travel, to have rest on the nature, swimming, theater, art. In all I prefer the quality, not quantity. I like to read books and to watch romantic comedies. What I really need is a man of great heart, a man with sense of humor, a man who will love me and accept my love.\r\nWaiting for your reply,\r\nJuliya",
