    "girls_info" => "I am kind and sympathetic girl looking for a serious relationship. I'd love to meet a decent, grown-up man. I can say for sure that you will never regret if you take me as a wife, because I am an example of a real woman - sincere, passionate, loving and family-orientated. I consider myself to be smart and intelligent, helpful and easy-going. I believe in destiny and feel that my soul mate is looking for me somewhere here, too..Is it you?:)",
    "girls_1st_letter_subj" => "is it what you are searching for?",
    "girls_1st_letter" => "Hello my dear friend! \r\nPlease pay attention to my profile and read carefully what my soul wants to sing you! As for my character I can say I am very kind and good-natured woman, I like being myself and I am not too demanding to people. I am sincere and truthful lady. I am an easy-going and too feminine. Is it what you are looking for?\r\nI am very active and like outgoings very much. Besides I like skating, skiing, roller-blading, swimming in the pool. I like being with my family and devote myself to them. I love the life in all directions because I understand we live only once.\r\nI am here to find a man who will be tender and kind with me, who has a good sense of humor, who knows what he wants, who can make my dream true. My dream is to find my second half and move to his country to live with him.\r\nPlease write me back if you want to get to know me better and think we may be compatible with you.\r\nHave a great day!\r\nSvetlana",
