    "girls_info" => "As you know Ukrainian women are very good housewives, and I am not exception. Family values are very important to me and I know how to make family friendly and strong! I am a smart and beautiful lady, with a big soul and kind heart. Only my man will be able to appreciate it. Because with a right man a woman becomes happy and unfolds like a flower))) I'm full of energy but at the same time I can be calm and romantic. I am looking for my second half here and promise to be a devoted wife and a caring mother. I like different kinds of sports, yoga, swimming. Also I am fond of playing checkers and to solve puzzles:) I hope you would like to get to know me better:)",
    "girls_1st_letter_subj" => "can it be a start of something new?",
    "girls_1st_letter" => "Hello, my dearest friend,\r\nThank you for reading these lines of mine..I hope that it is just our joint beginning of something new:)\r\nLet me tell you a little about myself.\r\nMy name is Kristina and I live in a beautiful Ukrainian city - Kiev, which is the capital and the cultural, economical and educational center. You should only once visit it and you will fall in love with this city for ever:) \r\nI am very accurate woman with decency and polite thoughts. I am attentive to people who surround me and always try to do my best to be a good girl for everybody though it is not always good)) I am reliable person and always want to achieve my aims about what I will tell you later.\r\nI love doing sports and having an active kind of life. I like mountains, sea, forests, farms even. I like doing different new things like biking and hiking. Let's see what we can do together with you.\r\nI would like to meet a good man with kind heart and usual style of life. I would like you to be ready to come here to meet with me in real life and become my man if everything works between us.\r\nHope to receive your soon letter,\r\nKristina",
