    "girls_info" => "I am serious in my search, and I am family oriented. \r\nI believe that only a real meeting can decide everything. I am here for this real meeting that will change the whole my life. \r\nI'm an attractive, kind, decent young woman. I love coziness in the house. And also I like to spend interesting and actively free time.\r\nI like reading and watching melodramas and comedies. I like to go in for sports because it helps me be in a good shape. My favorite kinds of sports are dancing and swimming. It helps me be in good mood and makes me stronger.\r\nRespect, understanding, support for me is the main thing in the relationship. If we have the same priorities it's excellent, I will be glad to get to know you better.",
    "girls_1st_letter_subj" => "What makes you happy?",
    "girls_1st_letter" => "What makes you happy? Be healthy, have good family, stable work that you love and an opportunity to have the hobby that you like, right? The biggest challenge is to meet a proper person to become your partner, with whom you will walk hand in hand for lifetime(hopefully;) \r\nLife is too short and I believe that all the means to meet a right person and become happy are good - so let's get to know each other, I am Nadejda from Odessa, Ukraine, friendly, positive, sincere, kind, gentle, very romantic and passionate, hard-working and family-orientated. I want to create a family with the right person. And you?\r\nSincerely yours,\r\nNadejda",
