    "girls_info" => "I`m a cute, funny and sweet woman. I am intelligent and well-educated. I make delicious food, so my beloved will always be fed. I love children and I think that children is the most lovely thing that can happen in life.\r\nI`m very friendly person and I like my friends. I like to shine and to share all my positive emotions with my close people. I am merry, cheerful, bright and light)\r\nI want my man to be understanding and reliable. I need a man who knows what he wants and who has got some goals in his life. I will be happy to find sincere man with a good heart.\r\nMy favorite hobby is hand-made. Also I enjoy cooking and listening to nice music.",
    "girls_1st_letter_subj" => "Love has no borders, so why did you make them? Let's raise all t",
    "girls_1st_letter" => "Hello my darling!\r\nMy name is Anna. I was born and still live in Zaporozhye city, Ukraine. I was a happy child as I lived in a good and loving family, for which I thank my parents and grandparents a lot.  After graduating from the college I met my love and we decided to marry. I was young and he was young but we loved each other. We lived together for 5 years. I can’t say these years were awful but we were young and did not want to make everything to keep our family. Moreover I gave a birth to our daughter in 2011. But in 2012 year we divorced.\r\nMy daughter goes to school already, she is the loveliest girl in the world! She is very smart girl and I do my best to make her childhood happy.\r\nAs for me like a person I am very reliable and punctual. I like clean and decent in everything. All my free time I devote to my daughter now. But I want to devote it to my special man too.\r\nMy daughter and I like skating, going to the cinema, dancing, circus and theater. \r\nI don’t like no punctual and dishonest people .\r\nI hope you can become the best man in the world for me.\r\nWrite me about yourself. I am interested in getting to know everything about you!\r\nRegards,\r\nAnna",
