    "girls_info" => "I love children and take care of people. I'm active. I am engaged in fitness and go to the swimming pool. I also like cycling, fishing, hiking and very fond of travelling.\r\nI do not have much free time right now because I'm currently working. But I spend my weekends with pleasure in the family circle, joint walks, visiting entertainment centers. And joint cooking. And I also love my garden very much. I have many varieties of roses and plants. \r\nI like to read historical novels. I like interesting conversations, no matter what the topic.\r\nI am happy to go to the cinema with my friends and visit art exhibitions.\r\nFor me, the family is always on the first place. I dream of serious relationship, in which everything is built on love, respect and mutual understanding. In my house it is always light and happily. I love to receive guests.\r\nMy friends say that I cook well and the meals are always tasty. I hope to treat you to my dinner some day)",
    "girls_1st_letter_subj" => "we never know..",
    "girls_1st_letter" => "Hello, my foreign friend,\r\nI hope you are doing great today and my letter finds you in good health and mood. I would like to get to know you better and to see if we are compatible and can build a family together..That is what for I am on this site. I believe in destiny and reckon that we never know when and where we are to meet the person who is to become our destiny..I have been looking for him everywhere for a long time..and now I am here..Perhaps it is you and you are looking for me, too? It would be the greatest happiness to experience it. I can say with assurance that I am a really good woman - educated, intelligent, kind, tolerant and positive, but unlucky in my personal life..well..sometimes it happens. But I never give up, I know that I will be happy with my man and we will have a harmonious family with him. If you admit that this man can be you, please write me back. I hope for a good communication and a happy ending of our story.\r\nWaiting for your response,\r\nOlga",
