    "girls_other_languages" => "",
    "girls_info" => "I want to have strong relationships with my future only one, with mutual understanding and supporting each other. I am looking for a person to share my life with. I want to meet a real man, a man whom I give my heart and who will give your heart to me in response.\r\nI`m attractive, interesting, optimistic and open-minded girl, who enjoys life and tries to get all the best of it. Sometimes I am very relaxed calm and anxious to have fun and be happy. I am well-mannered, a bit modest and shy but at the same time quite outgoing and friendly.\r\nAs for the hobbies, I am fond of travelling, sports, psychology, art, but my priority is always family and the children. I dream to find the man here who will accept me like I am, who will be ready to be a father to my kids, and in my turn I will give him all the love I have inside of me and will make him the happiest man in the world.",
    "girls_1st_letter_subj" => "do you dream about a big family?:))",
    "girls_1st_letter" => "Hello, my dear friend. Thank you for reading these lines. I do not think I will say something special here, but I hope there will be chemistry between us and you would like to write me the answer. As you see from my profile, I have 3 children whom I love very much and I am doing my best to be a good mother to them. I realize it is a great responsibility for a man to marry a woman with 3 kids. So please if you are not ready to take such a responsibility, do not answer me. I am looking for not only a loving husband, but also for a caring father to my children. They are amazing, I promise you will love them! I love children and I would be happy to give my future husband one more little baby! I think children make a family a real family. If you dream about such a family, I will be happy to receive your reply.\r\nSincerely,\r\nElena",
