    "girls_other_languages" => "Polish",
    "girls_info" => "Jolly - this is the word I can describe myself most of all.... and that is why I am self-confident and kind, loving and tender... these are my main characteristics and for you to decide who am I for you.\r\nI am the lady who is always active in the life, also I like to stay calm and sometimes to laugh a lot. I enjoy this life and I think it is too short to spend it for some negative things. I love sports - volleyball, tennis, swimming. I like reading detective stories and action, I like movies and good music. I can be very different, and it will be always interesting for you to open something new in me)",
    "girls_1st_letter_subj" => "you will be happy with me for sure!!",
    "girls_1st_letter" => "I am a lady who can bring joy in your life and add bright colors! I am a lady who likes to smile, laugh and enjoy every day of life! I will be there for you and next to you, I will be doing my best so as you forgot about all your problems and troubles, we will cope with everything together! In return I do not ask for much..I just want love, attention and care. I appreciate romance and the real man's actions. I think that a man must keep his word and promises. A woman is a wife and a mother first of all..Maybe we will be able to find our joint happiness here? If you are tired to be alone, too, we can try to build harmonious relationship..Do you want it?\r\nHoping for your soon reply,\r\nJuliya",
