    "girls_info" => "I am pretty, kind and active lady with good sense of humor! I am a very versatile person so you will never be bored with me. I like to spend my time in interesting way and like open every day something new for myself! I don`t like to stand on the one place! \r\nI’m very active and energetic person. I love dancing and sports, that’s why I’m always in a good shape. It is very important for me to look nice for my man, to make him feel happy…Though I’m active I’m stay-at-home either…I like animals very much. But my mission is children...I can’t live without contact with those little angels .I ’m very romantic and sensitive …Walking along the beach at summer night with the man of my dream hand in hand is the best thing that ever could be…",
    "girls_1st_letter_subj" => "I believe in destiny. And you?",
    "girls_1st_letter" => "Hello, my dearest. You have no idea how much I want to find the man whom I can call like that. You may say it is strange that I am alone, because I am pretty. But unfortunately, not all pretty people are happy in personal life..and I am nit an exception. I have a son as you may see in my profile. He is quite a big boy, very kind and polite. But my marriage life did not work out, and since that time I am trying to meet my soul mate everywhere..I believe it can happen at any place..but I would be happy if HE was looking for me here, too..so as finally we found each other an d create a happy family together! This is what i am dreaming about!\r\nIf you think it may be you whom i am looking for, please write me back.\r\nBest regards,\r\nNataliya",
