    "girls_info" => "I am a person who likes active kind of sport. I go to the gym regularly. I like nature, sea, walks on fresh air. Also I am fond of cooking and like when everything is clean and tidy in the house. I like to take care of the family and love kids a lot. As for my character, I consider myself to be intelligent, cheerful, energetic, kind and sociable. I am looking for a reliable man for creating a family.",
