    "girls_other_languages" => "",
    "girls_info" => "I like travelling, it is the most exciting thing in the world! It`s so wonderful and interesting to learn new places, to meet new people! I dream to see the whole world! I am calm, intelligent and well bred lady. I am here because I know that foreign men are more clever, more intellignet and more family oriented than our Ukrainian men. My character is not difficult, I can find compromises, I am tender in love, that`s why i am sure my man will be happy with me. And of course I dream he will make me happy also.\r\nI am not looking for ideal man, but I would like he would have kind heart, open character, of course he should be attentive to me, because I want to feel his attention, understanding and support. I promise to give all myself to such man!",
    "girls_1st_letter_subj" => "and what is the most important for you?",
    "girls_1st_letter" => "Nothing is more important than being happy. Unfortunately, I still have not met someone whom I will love with all my heart and who will love me too in return.. I've been alone for a long time and now I'm finally ready to start a family and take care of my husband. I have a son, who is my world now, I love him a lot and this love is mutual..but still I can not call myself a completely happy woman..We are all born to love and to be happy..do you agree? we all want and need a loving person next to us..we all need sweet kisses, warm hugs, moral support when we have bad times, we need someone to wake up and go to sleep with..This is what I am looking for here..Maybe my person is somewhere here looking for me, too? Maybe you?\r\nIf you are searching for the same thing as me, please write me, I will be waiting.\r\nAlyona",
