    "girls_1st_letter" => "Please-tame me!' he said.\r\n\r\n'I want to, very much,' the little prince replied. 'But I have not much time. I have friends to discover, and a great many things to understand.'\r\n\r\n'One only understands the things that one tames,' said the fox. 'Men have no more time to understand anything. They buy things all ready made at the shops. But there is no shop anywhere where one can buy friendship, and so men have no friends any more. If you want a friend, tame me.'\r\n\r\n'What must I do, to tame you?' asked the little prince.\r\n\r\n'You must be very patient,' replied the fox. 'First you will sit down at a little distance from me-like that-in the grass. I shall look at you out of the corner of my eye, and you will say nothing. Words are the source of misunderstandings. But you will sit a little closer to me, every day...\r\nIt is not difficult to tame me...I just want to be a little girl next to my reliable strong man, who will love and care.\r\n\r\nAnd I do hope that this man is somewhere here..\r\nIf you have felt some chemistry between us, I will be glad to receive your answer to me.\r\n\r\nBest wishes,\r\nNataliya",
