    "girls_info" => "I am very hard-working and ambitious. I have goals and do my best to achieve them despite difficulties and problems. I do believe that a person can create his own destiny by himself, the most important is to work hard for it. I am very family-orientated. I dream about quiet evenings at home with my beloved person, with children, having nice dinner, laughing together and enjoying that time. And I strongly believe it will happen when the time comes. But I want it to happen as soon as possible)",
