    "girls_info" => "I am loyal, active, energetic and cheerful, caring, romantic person. I am full of new ideas and plans. I am merry girl and I don`t like just to sit at home in my free time. I believe I am easy going and earth down person.\r\nMy man should be honest, attentive, caring person. i want to share all my life with him, that`s why it`s good if he can laugh and has a good sence of humor. Of course, my man should can respect me and, family and friends.",
