    "girls_1st_letter" => "Let me introduce myself first. My name is Elena.) I hope we could be a nice and happy pair with you. Maybe we are created for each other and you are my second half? Who knows?\r\n\r\nI could never imagine myself being alone. But I think that it is better to be alone than in a bad company. Thatâ€™s why I am still single. I have not met my man yet, my second half. At the same time, we know the old truth fixed by God that every creature in the world needs to have its pair. I came here to find my pair, to find the man I can feel comfortable with. I hope we will like each other and we will be a nice couple together.\r\n\r\nThe main feature I want to see in my husband is honesty. I also want my man to be intelligent, reliable, sociable and a little romantic, of course. I am a young girl who is just looking for a simple womanâ€™s happiness and create a family. I am ready for it. And you?\r\n\r\nIn my spare time I prefer dancing, painting, to be in nature or to play bowling with my friends, sometimes it is good just to drink a cup of coffee with a good friend and talk about everything, also I enjoy just reading at home, watching a good movie or listening to nice music.\r\n\r\nWhat about you? I would be glad to get to know you better. What is love for you? What do you value in a relationship the most?\r\n\r\nI will be waiting for your letter with a great impatience!\r\n\r\nSincerely yours,\r\n\r\nElena",
