    "girls_info" => "I am positive and very active. I am cheerful and always in a good mood. I see everything in bright colors and I smile a lot. I am friendly and kind to people. I do not like quarrels, that is why I always solve everything with the help of compromise.I am full of passion, I am full of love. I want to have a man by my side and I want to take care of him. I want to wait for him when he comes home, I want to cook breakfasts and dinners for him. I want to wait for him and love him. Of course I want to be loved also. My parents made me polite and intelligent. I am family orientated and I am looking for serious relations.",
    "girls_1st_letter_subj" => "nice day for dating, isn't it?",
    "girls_1st_letter" => "you may ask me why I am in this site. I have a very simple answer. I think every woman wants to find HER MAN. I think every woman dream about attentive, soft, kind, interesting and intelligent husband who will love her. I am not an exclusion. I just want to be happy and to make MY MAN happy.\r\nYou may ask me why I am not searching the man in Ukraine. But I don't know where is my second half. I have already had unlucky experience in marriage, but he liked alcohol too much. As all our Ukrainian men he liked to drink and to hurt me. So, I didn't want to go on any more. And that's why I am here, on this site. Maybe you are my second half????????\r\n\r\nIf I fall in love I will be ready to go to your country or to stay here, in Ukraine. It is not important for me. I wish to be happy with my darling and it is important! If my future husband will want to live only in his country, I agree with him. I hope he will be my support in his country! I will be lovely, kind, the best wife for you if you are my half!\r\n\r\nNow I am going to tell you some words about myself. I am slender, nice, intelligent, educated, kind, sociable, easy-going woman. I think that I am a happy person but I haven't a women's happiness and I am looking for it! I am sure that it is in near future! Of course I love my son, he is very kind, active, nice kid, but I want to be happy as a woman! Maybe with you?\r\n\r\nIf you are interested in me, please, write me as soon as it is possible!\r\nI am waiting for your letter with a great impatience!\r\n\r\nNataliya.",
