    "girls_info" => "I am fluent in English, and I am ready to move. I am a loyal, kind and easygoing person. I am romantic and emotional, it is easy to hurt me, though I seem to be strong. I hate conflicts, and I think it is very easy to get along with me. I like reading, playing tennis, going to the movies, being outdoors. \r\nI am looking for a strong, attentive, reliable man. It does not matter where he lives, where he works, how old he is and if he has children or not. I want to find a good, kind and understanding man.",
