    "girls_1st_letter" => "My name is Zhanna. I would like to start telling about me from the most important thing - I am a serious and easy-going person. I am reliable, honest, faithful and intelligent. I love life despite it was not always kind to me, and I have a lot of positive energy. An active way of life is my motto. I never stop. I am sincere and open-minded and I appreciate these qualities in men.\r\n\r\nI work as an English teacher at the Agrarian University in Nikolaev. Nikolaev is located in the south of Ukraine, very close to Odessa. It is a very nice green city and I think you will like it if you come here to visit me). And if you want I could be your guide in my city). What about such an invitation?)\r\n\r\nHoping to receive your reply soon and to get to know you better.\r\n\r\nTake care,\r\n\r\nZhanna",
