    "girls_info" => "Talking about myself, I can say that I am a friendly, open, outgoing, active and positive lady. I have a lot of friends but I feel lonely without my beloved man. I hate conflicts that is why I try to talk and understand people.\r\nI love sports. I like to go to the swimming pool and I`m always active and full of energy. But sometimes I prefer just being at home and watching a nice film. I am a stay-at-home who loves coziness and comfort. Cooking is also my hobby.\r\nI am looking for a man who will support, understand, love and care about me. I also want to give all the same to him. I am sure I will be a good wife and a friend for my man.",
    "girls_1st_letter_subj" => "will you make my day?)",
    "girls_1st_letter" => "How are you today? I hope great and you are open to meeting your destiny.) We never know, when it will happen). My name is Elina and I am a photographer. Photography is my hobby and my work, I enjoy it a lot. Also among my hobbies are active kinds of sport, swimming, skating and playing tennis. I am very joyful and friendly, I get on well with people easily, that is why I have plenty of friends. All of them say I am a good friend and I am really proud of it). But anyway friends cannot replace me the love of a beloved person and cannot make me feel completely happy. Sometimes inside of me, I feel very lonely and really hope to meet my man here. I believe in destiny. And you?\r\n\r\nIf I could touch your heart, please write me back, I will be waiting for your soon reply. I would be happy to get to know you better.\r\n\r\nBest regards and wish you a happy day,\r\n\r\nElina",
