    "girls_info" => "I am a lady who wants to be happy, a lady who is looking for her second half to love, care, give myself to my beloved man. I am intelligent, caring, understanding, faithful and sincere.\r\nMy interests are different, I like reading, going to the movies with my friends, BBQ outdoors, camping, fishing and many other things.\r\nI am looking for a faithful man who will love and support me. He should be reliable, kind and clever.",
