    "girls_info" => "I am active and positive person, I am very livable and friendly! I can open my soul to any person. I just like to trust people:) I think that we also must see only positive in everyone! I like taking photos. There are so many amazing moments in life and I always want to leave them in my memory! I am creative. I can say that I am active and energy! I have nice body shape because I like taking care of myself!\r\nI see my man strong, purposeful and active! I want to see his smile because this life is full of wonders. I am sure that we will find a lot of common interest with him. I think that it is very important when you are looking at the same direction with your second half! I don`t want to waste my time on those who are just looking for fun. I am young but have a strong will! I want to have such a nice and loving family!",
    "girls_1st_letter_subj" => "do you believe in destiny?",
    "girls_1st_letter" => "My name is Kseniya. I really believe in this site and feel my love is looking for me here, too? Perhaps it is you?) We never know. I would be glad to get to know you better and to find some things in common with you. Do you agree?\r\nI have a soft and flexible character. I am a real woman and value all family traditions â€“ I like to cook and to give all my best feelings to my man! I like to care and give my tenderness to the people I love! \r\nMake small presents, whatever they are, to bring smiles on their face, visit interesting places together, make tasty and delicious breakfasts and dinners. For me nothing is more important than my family. We are very friendly and I am happy because of it!\r\n\r\nI would like my man to be careful, respectable and courteous. If we can share our interests - this means we can get on well and we will always have some topics to discuss! Ideal couple can be only between two best friends, partners, lovers. \r\n\r\nIf you write me back, you will make my day brighter. Maybe I will find what I am looking for? \r\n\r\nHope to hear from you very soon. \r\n\r\nKseniya",
