    "girls_info" => "I have a very kind, calm and loyal character. I am sure itâ€™s very important to have someone reliable by your side, and I am just like that.Friends can trust and rely on my any minutes. Iâ€™m not the kind of person who will betray or leave someone in trouble or just difficult situation. I am active, cheerful, energy, optimistic, easy-going, and open-minded. I am a creative person and I like to knit a very wonderful things, for example dresses for myself. I enjoy painting also. \r\nI am looking for an easy-going, attentive, serious, caring, understanding man with a sence of humor. I want to create a family and to make our common home cozy. Of course I dream he would be faithful, and decent man. I want to know that i can rely on my man any minute. It is very important for me! Of course he should love children because I have a son.",
