    "girls_1st_letter" => "My name is Diana. I am a cheerful, active, easy-going but serious woman. I like this life a lot, it has many surprises and it is very important to have a right life partner, that's why I am here. I had not the best experience in life, but I had it and due to it I have the best family values. I know what a person needs for happiness and I can give this to him! But I want to feel that I am loved also! I want to feel this love every day, every minute. I am tired to be lonely! Maybe you are my second half?\r\n\r\nI have a son. He is a very kind, sincere, cheerful and positive boy. I would be happy if my future husband will be a true friend for him.\r\n\r\nIf you are interested in me, please ask any questions and I will answer.\r\n\r\nHoping to get your soon reply,\r\n\r\nBest wishes and have a good day!\r\n\r\nDiana",
