    "girls_info" => "I am a calm person and I can enjoy the life to the fullest. I will tell you a little about me. I'm a sincere,  kind and loyal lady, I value  family most of all and all things connected with this main thing in life...\r\nI like dawns and sunsets, I like all seasons of the year, I like animals and plants...\r\nI have a friendly family, I try do everything for them!\r\nI belive in love! And you? I know that in our world it is so hard to find true love, more often people tell that love does not exist nowadays. But I think that only we can make our future and our destiny. I'll do everything to find my real love! Hope you help me in this uneasy search:))",
    "girls_1st_letter_subj" => "Let me introduce myself...",
    "girls_1st_letter" => "Hello dear !\r\nMy name is Elena. I am a new member here.\r\nI decided to join this agency because I want to find my husband here. I am divorced and have two daughters. One is an adult and she is married and lives in England and another one is still small.\r\nI am very serious as for relations with my man. You know, I am old-fashioned in a sense, I believe in getting to know a person, his personality, his persona and his soul and then deciding whether or not to risk a relationship with him. I believe that responsibility should always be there, that there should always be a \"string\". It speaks to a commitment to each other, to treat each other far above everyone else.\r\nIf the physical and material is all that matters, there will always be someone who is more beautiful, someone who is younger, someone who is richer either now or in the future. But I am looking for someone who will be special and perfect just for me. Do you understand what I mean?\r\nI would be delighted to start our communication and hope it may lead us to something serious.\r\nTenderly, \r\nElena",
