    "girls_other_languages" => "",
    "girls_info" => "I like music and art, I play the piano, I love nature, taking photos, doing sports, swimming, skating. I really enjoy travelling. I worked as a children's doctor, then in sports medicine, now I work in Red Cross.",
    "girls_1st_letter_subj" => "I want to know you better:)",
    "girls_1st_letter" => "Dear! \r\nAs you know, my name is Svetlana. I live in Ukraine, in big city Kharkiv.\r\nI graduated the Medical University with honored diploma. I was working as a\r\ndoctor at polyclinic, then I entered the clinical residency. Then I was working\r\nas an adolescent department head. Then I was working as a sport doctor at the\r\nSport School of Olympic Reserve. Now I work in the Red Cross Organization of\r\nUkraine, where I give lectures to the youth at schools and universities. I\r\nspeak on the conferences, sometimes on TV programs, sometimes my articles are\r\nprinted in the newspapers . \r\nI finished the musical studio on the \"piano\" class. But because of the lack\r\nof time I play piano seldom. But my love to the classical music remained. Also\r\nI like modern music, though tuneful, light (not the hard rock and so on). In\r\nwinter, when it's cold outside, I like to listen to music, to cook and to\r\ncreate home coziness. I find a great pleasure in communicating with nature,\r\nlistening to birds' singing. And I like to take pictures. I have many photos of\r\nthe sights and landscapes! \r\nI want to find the man who has the same soul, the character similar to mine. I search the reliable friend, life partner, caring, attentive and affectionate husband.\r\nIn man I value constant attention and real care about woman. In relations\r\nbetween man and woman I value mutual understanding, trust, decency and honesty\r\nmost of all. \r\nI think that you know me better now and I hope that we can have good relations and mutual understanding!\r\nI wish you good luck and good health!\r\nRegards from Ukraine!\r\nSincerely, \r\nSvetlana.",
