    "girls_info" => "I am joyful and energetic, but sometimes I am just calm. I love everything beautiful around me. I am very attentive and tender with people who are close to my heart. Sometimes I love to make dinners and invite my friend to join me. I love cozyplaces, but it can happen that I can attend a party. My passion is to get new knowledge. That`s why I am interested in economics, politics etc. \r\nMy goal in life is not only to find fulfilling as a personality but also as a woman and mother. I pay attention to my self-development and comfort around me. I am romantic and sensual. I respect traditions, I like cooking and welcoming my guests.",
