    "girls_1st_letter" => "Hello! I never thought that I would need the service of a marriage agency. I was married in the past during 7 years. It's a long story but I am single again now...I want to find someone who is serious and ready to start relations. My man has to be hard-working, loving, caring, understanding, gentle, intelligent, determined, honest, faithful, humorous. That is the perfect man but unfortunately, you can't find all these qualities in a man. But if you have more part of these so it's very good )).Let us light up a new star together, and call it Love. To my mind Love it is when the two souls meet each other at the right time! Such things as age, religion, education do not define a person fully, and outer beauty is not what I search for. I see beyond what is visible to the eye and the beauty I seek is what comes from within, from the heart. I would like to meet a man who will understand me, my preferences and will share my views on life, and who will make me complete. I know you can do it. What about you? What kind of woman do you look for here?\r\nAnna",
