    "girls_info" => "I am very joyful, energetic, sociable. I like to be active, to spend my time on nature. In my free time I go to a swimming club, to a park, cook something delicious. I am hardworking and I stand on my two feet. I look for a smart, loving man with positive thinking and sense of humor. He has to treat his woman respectfully and like children.",
    "girls_1st_letter_subj" => "I am serious about our communication.",
    "girls_1st_letter" => "Hello! Unfortunately, I don't know a lot about you, but I hope to know more! I did not have a lots experience in using computers and communicating through the Internet with other people. But I hope it will work. I am a sociable person very good with people socially, strong and determined, kind and generous, loving and passionate. I have a good sense of humor and enjoy meeting people of all occupations. Family is very important for me and love that is created within the family is the glue that keeps it together. In my free time I love to go to eat out, go to the cinema, read, visit my friends for dinner and they come to my place. Cooking for guests is a fun thing for me. I love going to the movies, beach, reading a good book, going to new places. I am attracted to positive people and the positive things in life. So, about a reason why I am here. I search for my soul mate, to share with him all my happiness and troubles. And love. I do not search for long extended correspondence, and I don't like to play in any soul games. I need to find real man for love and I hope it could be you. I am looking for a nice, loving and caring man, I want to love and to be loved, share all good and bad moments in life. Someone who knows what he wants in life. Communication is very important for me. I believe a relationship is like a garden. It takes lots of sun and water to make it grow. One of too much or a lack of one and the Garden will fail to grow. I am looking for a man in a foreign country because I believe in strong values. I believe in the good things in life. I also have strong family values. If you are looking for the same things, I'm waiting for your letter. I have not been to your country and I would love to get to know more about it and your people. I am very serious about you. \r\nAll the best! \r\nVika",
