    "girls_info" => "I am a calm and sociable Lady. I like children and I work as a children's doctor. I also work part time in a beauty salon.\r\nI like to go for a walk with my daughter, travel to other cities, embroider.\r\nI want someone who is sincere in his intentions and true. Someone who wants to have a family and happiness and who knows how to treat a woman. I want a loyal husband.",
